	(7663,15233,653,4,'HTML・CSS確認、Javascript及びjQuery基礎','jQueryは今まで学んでいなかったため、その利便性を確認することができました。\n主な構文\n$(document).ready(function(){$(\'~\').~});　基本構文\n$(\'~\').val();　value値の取得','2021-08-04 10:19:11','2021-08-04 10:19:11'),
	(7665,15001,648,3,'javascript/jQueryとコーティング応用','javascript/jQueryは調べて自分なりにできたのですが、コーディング応用になてサンプルサイトの作成に入ってからかなり難易度が上がってほとんど一から作るとなるととても大変でした。ですが、調べたり試行錯誤をして少しですが見本に近づくことができました。\n明日も引き続き完成させられる様に頑張ります。','2021-08-04 10:40:12','2021-08-04 10:40:12'),
	(7673,15306,652,4,'コーディング基礎・javascript/jQueryの学習','コーディング基礎\n自身の持っている知識とカリキュラムでの内容と相違がないか、また知らない部分はないかとの再確認とその後の実際に自身が持っている知識で課題を済ませれるかのアウトプット作業の確認をし課題提出→完了。\n\njavascript/jQuery\nこちらも自身の持っている知識とカリキュラムでの内容の相違がないか、また未知の部分はあるかの確認作業をし、アニメーションについてまだ未知な部分が多かったのでカリキュラム＋α自身で調べたサイト（jQuery animateなどでヒットした内容）で知識の落とし込みをし、その後一つ一つどう動くかの確認作業をしながらアウトプット作業・課題に取り組み、課題提出→完了。','2021-08-04 11:01:55','2021-08-04 11:01:55'),
