	(7780,15234,653,3,'コーディング応用 3-2','HPの再現制作は勉強法として高い効果があるので、今後も時間を見て行っていきたいと考えております。\nまた、要素を中央に置く方法として\n親position: relative;\n子position: absolute;\n	top:50%;\n	left:50%;\n	transform:translate(-50%,-50%);\n	width: 100%;\nとするといいことが分かりました。','2021-08-08 10:19:00','2021-08-08 10:19:00'),
	(7782,15521,652,3,'コーディング応用3-2,3-3','3-2\n一つ一つの部分を理解しながら作成し完了。\n作成後クラス設定などのまとめ方や命名方法などもっと改善の余地を感じ次からはそこの部分に意識をし、自身でも見る側でもわかりやすい文を作れるよう工夫し変化をもたらしたいと思います。\n\n3-3\n一つ一つ作りを理解しながら作成、提出後レスポンシブの部分で余白が出来ている為次回の出席までに再提出。\n作成に関してはそこまで時間は多く掛からず大まかの完成まではスムーズに行けたがレスポンシブデザインの部分で少し悩みもう一度落とし込み理解が必要と感じました。\nまた、3-2と同様に後から見直した際にもっと命名規則やクラス設定など見やすくわかりやすくする事は可能だと感じた為ここはやはり今後の課題だと思います。\n\n本日はこのまま指摘箇所を修正し3-3を完成させ、次のステップへの準備orこれまでのコーディングで感じた課題点などをもう一度確認、再度取り組むなどをして次の出席までを有意義に使いたいと思います。','2021-08-08 10:23:06','2021-08-08 10:23:06'),
	(7784,15536,602,3,'5-1 課題（DB基礎）','PDOのを使うのは初めてなので、理解しながら進めております。\n前回のコードが汚いのでリファクタリングや関数などを使用しております。\n$sql=\"update テーブル名 set 更新したいカラム where id = :id\";\nで更新できるのは分かったが元々あるIDを引き継いで更新するところに\nつまづいております。','2021-08-08 10:51:00','2021-08-08 10:51:00'),
	(7785,15525,651,3,'課題4-A ハンズオン 取り組み','PHP制作の環境構築・動画を見ながらコードを書く練習をした。\n環境構築に少し時間がかかってしまったが、実際にコードを書いて行く練習をしてワクワクしながら学習を進められている。\nまた、１５時の途中報告が遅れてしまった為、気を引き締めてしっかり意識していくべきだと感じた。','2021-08-08 10:53:40','2021-08-08 10:53:40'),
