	(7989,15735,652,3,'4-1 提出, 4-2 作業中','4-1 \n環境構築を終えて自身の理解を確認しながら一つ一つ1~14まで進め、完了後再度1~14までを理解しながらの確認を見直しがてら再度行い提出し完了。\nコードの読みやすさやインデント配置に気をつけながら取り組みましたが今回else if のインデントの部分を開けずにコードを書いていた点をご指摘頂きコードやインデントの確認をより一層行う様意識付けをしていく必要を感じ、そこを意識して次回から取り組みたい。\n\n4-2 \n1~10まで理解しながら確認し進め完了。\n11~20まで進める前にもう一度1~10の内容を見直しを含め理解してから進めたい。','2021-08-15 11:00:29','2021-08-15 11:00:29'),
	(7992,15763,602,3,'5-1 課題（DB基礎）','特定のidを持った要素の削除に躓きました。\nclassだと複数の要素の処理ができず、idだと一つしかJSが発火してくれないので\nforeachでループする数をidの後ろに名前を付けるという強引な方法でなんとか\n起こって欲しい挙動が得られました。\nクラス化や更に要素の共通化を行いたかったのですが、\nひとまず明後日提出してレスを頂こうと思います。\n先にDBの問題集を進めます。','2021-08-15 12:30:33','2021-08-15 12:30:33'),
