	(8120,15850,652,3,'4-2 完了　指摘点の修正','4-2\n11~20までいつもよりも時間を掛けて理解しながら今日は作業を進行。\n問題なく4も進んでいたと認識していたが見直し等の際に少し触ってしまっていたのか表示がされていない状態になっていたのを指摘後認識。\nまた、16も＊が++が--になっており出力結果と違う結果になっていることを指摘後に認識。\nここは再確認と確認し修正する際には修正点以外を変えてしまわない様に更に意識を持つ必要性を実感し次回からその意識を持ち取り組んでいきたい。\n指摘後すぐに修正し1~20を再確認し問題なく確認できた為明日提出予定。\n今日は残りの時間を再度1〜20の復習に費やしたいと思います。','2021-08-19 10:52:20','2021-08-19 10:52:20'),
