	(8280,16031,677,3,'javascript,jQueryの学習','サイトを見つつ、どうすればこの結果が得られるのかと試行錯誤したものの、情報収集の仕方があまり効率が良くなかったので、もう少し検索する際に求めている情報がすぐに出てくるキーワードを考えて調べるべきであったなと思いました。\njQueryが思っていたよりも難しく、もう少し頑張って予習復習を繰り返して身に着けていきたいと思いました。','2021-08-25 11:01:41','2021-08-25 11:01:41'),
