	(8315,15830,668,4,'コーディング応用、PHP基礎/アルゴリズム','コーディング応用では修正箇所がいくつかあった。そのなかで見本とは違うデザインの箇所があったので、要望通りのものを作り上げていくことが必要とかんじた。\nPHPの基礎では、配列の概念が難しかった。さらにIF文が絡むとより複雑化するので混乱しないように、より理解を深めていく。','2021-08-26 10:48:24','2021-08-26 10:48:24'),
