	(8349,16087,504,3,'SELECT文の取り組み','本日はSELECT文について[ＳＱＬ攻略 - Ｗｅｂ上でＳＱＬを実行しながらマスターするサイト]を見ながら勉強しました。\n自分で作成したcafeサイトのコードにSELECT文で特定のものを表示させたり、PHPadminで SELECT文を使用し特定のものを表示させたり色々試したりもしました。\n本日フィードバックいただいたDB接続ファイルの共通化を今後の課題では、初めから意識し、ファイルをまとめたりなどもう少しファイルが誰でも見やすいよう作業ていきたいと思います。','2021-08-27 10:02:16','2021-08-27 10:02:16'),
