	(8455,16147,620,3,'4-2提出・４－３取組中','講師の方に４－２課題を提出し、４－３に進んだ。\n今回の問題点として、基本的なコードの見やすさやインデントの修正主だった。今までコードを相手に見てもらう、見やすくしようという意識がなかったので、今後エンジニアとして活動していく上で、再認識できた。','2021-08-31 14:29:27','2021-08-31 14:29:27'),
