	(8468,16237,574,3,'5-2','長時間悩まずに進めているのでこのままのペースで進めていきたいと思いました。\'や\"を付け忘れたりスペースを入れないなど小さいミスがあるため、実行する前にミスが無いか確認を念入りに行っていきたい。','2021-09-01 09:09:06','2021-09-01 09:09:06'),
	(8476,16308,697,3,'2-A javascript 基礎知識の５まで','１つ目のHtmlのカリキュラムはスムーズに終えることができました。\n２つ目のjavascript/jqueryのカリキュラムは中盤まで問題なく進んでいたのですが、後半から少し詰まってしまい、調べたら解決できるものばかりでしたが時間がかかっています。jQueryの書き方でかけていないところが後半は数多くみられ、その修正をしています。\nAtomのエラーを教えてくれる機能のインストールをしていなく、もともとないものなのかなと決めつけてしまっていたので少しその点が落ち度かなと感じています。\n本来であれば、今日中に次の３のステップに進むことが目標でしたが、明日は３に進めるように計画を立てて３を終わらせる勢いで進めていきたいと思います。','2021-09-01 10:52:57','2021-09-01 10:52:57'),
	(8477,16265,621,4,'6-2 課題２（サイト機能追加・修正）','編集機能のバリデーション。\nテンポラリテーブルの削除、再作成。','2021-09-01 10:52:57','2021-09-01 10:52:57'),
	(8479,16240,668,4,'4-2 課題２（ループ練習）','for文を3つ入れてつくる構文では繰り返す中で表示しないように条件式を工夫する必要があった。\nifを入れる構文ではどのifやelseifで処理されるのか、分岐を考えたうえで作る必要があった。','2021-09-01 10:55:58','2021-09-01 10:55:58'),
	(8480,16305,698,3,'2-A javascript基礎知識','HTMLとCSSの基本は比較的早く進んだが、JavaScriptに入ってからはjQueryの文法を理解することや必要な情報を探し出すのに時間がかかってしまい、課題を進めるのに時間がかかっている。\n\n一度頭を休ませ、明日は今日以上に課題を進めるのが目標。','2021-09-01 10:59:53','2021-09-01 10:59:53'),
	(8497,16460,704,4,'コーディング基礎','コーディング基礎を全課程終了しました。\n画像のcss設定、インライン要素とブロック要素の違いについて理解が不十分なため、そこを重点的に復習したいです。','2021-09-02 09:50:28','2021-09-02 09:50:28'),
	(8498,16450,504,3,'DB課題、PHP クラスについて','本日はDBの課題が完了し、セルフチェックしました。\nDBでJOINなどの結合句を使用せずサブクエリのみでテーブル上に表示するコツが徐々にわかってきたので課題が完了しましたが引き続き復習し、落とし込んでいきたいと思います。\nまたPHPのクラスについて調べました、まだ理解できない部分が多くあるためしっか理解しながら進めていこうと思います。','2021-09-02 09:57:05','2021-09-02 09:57:05'),
