	(8506,16309,697,4,'カリキュラム２の完了からカリキュラム3の３－２まで','昨日のjQueryはなかなか解決できなかったものが、朝のものの数分で解決でき、スムーズに進みました。カリキュラム3は3－2までスムーズに進み、ホームページ作成に時間がかかっています。時間がかかるところではあると思いますが、もう少しやりたいことが調べずにすらすらとコードが書けるようにならないといけないなと実感しています。htmlを今まで重点的に行ってこなかったので、そこが痛手を負っていいる状況です。\nまた、些細なミスが多いので構文チェックのパッケージをインストールし活用しています。\n明日の目標としましてはカリキュラム３を終わらせることができれば上出来だと思います。\n引き続き引き締めて行っていきます。','2021-09-02 10:43:00','2021-09-02 10:43:00'),
	(8512,16331,698,3,'コーディング応用','本日は昨日詰まってしまったjQuaryから始め、コーディングに進みました。\nコーディングは作業指示書に書かれている内容が少なく、調べている内容が正しいのかが実行してからでしかわからないので多くの時間をかけてしまっていますが、明日までには完了させたいと思います。\n\n【改善が必要な箇所】\n・サイトに対しての背景画像が中途半端なところまでしか伸びない\n・中央揃えになるよう記述しているが左側に寄ったまま\n・ヘッダーの高さが高すぎる','2021-09-02 10:57:14','2021-09-02 10:57:14'),
	(8513,16241,668,4,'４－２　ループ練習','for文にtableを組み込んで表を作成するところで苦戦している。連想配列をcount関数で数を取得してから行ってみたが、なぜかうまくいかないので、空き時間に細かいところを考え見直していく。','2021-09-02 10:58:17','2021-09-02 10:58:17'),
	(8519,16372,671,2,'3－2　修正','コーディング応用３－２の修正を行いました。\n中央寄せの意図が分からず、苦戦してしましました。\n\nwrapperに1280pxを入れてmargin0 autoで中央寄せができたと思います。\n明日、提出する予定です。','2021-09-02 11:15:10','2021-09-02 11:15:10'),
	(8529,16239,653,2,'PHP基礎_アルゴリズム4-2','コメントアウトを予備として残しておきましたが、実際の業務ではNGなので今後は気を付けるようにします。\n別ファイルで残しておくなど、ほかの方法で対応するよう心がけます。','2021-09-02 14:30:50','2021-09-02 14:30:50'),
	(8531,16367,681,3,'コーティング基礎','最初の内容としては課題を進める中でどうしてもエラーにぶち当たることが何回もありました。\nけれど自分で色んなサイトを調べたりして正常に動いた時は達成感がありとても嬉しいと感じました。\n反省点としてはやっぱりエラーに対して自分で調べる時間を使いすぎて萎縮して講師の方に質問出来なかったのが自分の中で1番もったいないと思いました。\n後はもう少し自分で調べた時ももう少し物事を柔らかく考える力(難しく考えがちなので)必要であると感じた1日でした。\nこれからも自分の中でイメージの仕方を変えつつ頑張っていきます！','2021-09-02 18:04:27','2021-09-02 18:04:27'),
	(8532,16152,565,3,'5-1 課題１（データ参照・挿入・更新・削除）','データの削除と更新に取り組んだ。\nある程度の書き方は理解してきたが、うまく機能しない部分があるので機能するように引き続き取り組んでいく。','2021-09-02 21:24:47','2021-09-02 21:24:47'),
	(8540,16516,704,3,'Javascript/jQuery　2-A~B','昨日取り組んだHTMLよりJavaScriptの方が理解が浅いので、明日重点的に復習したい。','2021-09-03 09:52:13','2021-09-03 09:52:13'),
	(8541,16441,648,3,'DB基礎','５−１手直し','2021-09-03 10:01:29','2021-09-03 10:01:29'),
	(8545,16310,697,3,'コーディング応用','本日はコーディング応用3-2.3-3を中心に行いました。\n3-2はさまざまな修正が必要で調べる時間と書く時間両方の時間を割きました。\n全体を通してもう少しコーディングの手順を整理して記述していく練習をしたいと思います。\n予定より押してしまっているので引き締めていきたいと思います。\n次の工程では次のカリキュラムに移行できると思うの引き続き頑張ります。','2021-09-03 10:46:07','2021-09-03 10:46:07'),
	(8548,16332,698,3,'コーディング応用','提示されているお手本と作成したものが少しずつずれてしまい改善に時間がかかっている。\nヘッダーとフッターが他のcssの命令をきいてしまい思うように動かない。\n\n【次回始めるところ】\n・ヘッダーフッターの横幅を画面いっぱいにする\n・contents部分をboxにかえる','2021-09-03 11:00:00','2021-09-03 11:00:00'),
	(8552,16520,671,3,'提出のみ','本日、提出のみでの出席となります。','2021-09-03 11:13:23','2021-09-03 11:13:23'),
	(8557,16058,670,3,'コーディング応用３−２','サンプルサイトが完成しました！','2021-09-04 04:24:27','2021-09-04 04:24:27'),
	(8558,16469,602,4,'DB課題５ー２応用問題','課題５の応用問題集が終了しました。\n今まで使った事の無い関数等たくさん出てきてSQLの良い勉強になりました。','2021-09-04 09:43:27','2021-09-04 09:43:27'),
