	(8569,16524,653,3,'PHP基礎_アルゴリズム4-2','アルゴリズムについて深く考えられました。\n実務にも組み込めるように技術を身に着けていきます。','2021-09-05 03:55:23','2021-09-05 03:55:23'),
	(8574,16605,704,4,'Javascript/jQuery　２−１〜２ー５','※進捗報告を記入する欄で２ーAのみ表示されたため、「２ーA作業中」と記入しましたが、現在２−５作業中です。\nif文に苦戦しているため、重点的におさらいする予定です。','2021-09-05 09:52:40','2021-09-05 09:52:40'),
	(8575,16583,574,3,'5-2','SQL文の問題を解いていましたが、問題文を見てどういった形式の文で記載するか判断できるものや、何度も試したり調べたりしてから、表示させるためにはこのように記載するのかと気が付くものもありました。\nSQLでの記述は様々な時に使われると思うのでしっかりと覚えていくようにしたいです。','2021-09-05 10:01:50','2021-09-05 10:01:50'),
	(8576,16525,653,3,'01_PHP基礎_アルゴリズム4-3','algorithm4,5のテストケースを何とかして全部表示できないかとループ文の作成しようと試みております。\nしかし、時間をかけることは業務においても好ましくないので、手入力で確認を進めるために、どういった値をどれくらい用意するか明確にしていくことが重要だと感じました。','2021-09-05 10:05:38','2021-09-05 10:05:38'),
	(8577,16568,669,1,'psr2の設定','分からない事を質問したり調べたりしたのですが進展はありませんでした。','2021-09-05 10:12:02','2021-09-05 10:12:02'),
	(8579,16311,697,3,'コーディング応用','今日は昨日の続きを行いました。\n3-2,3-3両方ともほとんど完成していたのですが、細かいコードのミスやデザインと違っている部分をどんどん直していくうちに少し頭が回らなくなってしまい、その後の作業がなかなか進みませんでした。ですが、わからない部分などはなく、自力で解決できるものでした。\n最初の書き始めから手順などもっと詳しく記述して書いていれば、こんなに時間がかかるものではなかったと思います。\n明後日はphp基礎に入れると思うので引き続きよろしくお願いいたします。','2021-09-05 10:39:53','2021-09-05 10:39:53'),
	(8580,16510,662,5,'本日はDB基礎の課題を完了しました。','本日はDB基礎の課題を完了しました。\nSQLについては以前Progate等を通じて学習していたので、比較的早く進行させることができました。LIMIT文法は知らなかったので、とても勉強になりました。\n今後もDBについての知識を増やしていきたいです。','2021-09-05 10:41:55','2021-09-05 10:41:55'),
	(8581,16567,621,3,'6-3 課題３（ログイン機能）','本日は新規登録、ログイン機能の実装を行なった。\nユーザを新規登録する際にデータがうまく渡せておらず、データの登録に苦戦した。配列を表示すると、データがうまく渡っているか視認できる。\n現在ログイン処理で少し苦戦しており、セッションを使うことが大事だと知り、理解を深めていく必要があると感じた。','2021-09-05 10:44:31','2021-09-05 10:44:31'),
	(8583,16574,602,3,'課題6−２ 機能追加の２','6-1のMVC導入はView.phpの表示の仕方でつまりながらも本日終了しました。\n$_GETの動作状況等まだ完全に理解できていないところがあります。\n6-2選手詳細に選手の「得点履歴」を表示にて\nGoal.phpにてエラーが出たまま止まっております。\nJOIN ONでの複数のデータベース結合の使い方が上手く出来ず。\n以上不明点を復習しながら進めてまいります。','2021-09-05 10:48:09','2021-09-05 10:48:09'),
	(8588,16333,698,3,'コーディングが終わりPHP範囲に入る','【educureエラー？】\n日報提出前にeducureを更新した後、13:00に押したにもかかわらず再度出席ボタンが出たので日報を書くためにもう一度押した。\n進捗報告の部分も3-1以降カリキュラムが表示されまた3-1表示になっているが、実際は4-1です。\n\n【本日行ったこと】\nコーディングをお手本になるべく近づけて課題提出\n次の範囲であるPHPの環境構築の途中\n\n【次回】\nMAMPというPHPの開発環境を整える。','2021-09-05 10:59:41','2021-09-05 10:59:41'),
	(8597,16119,538,1,'自作、画面設計書の再提出','体調不良の為、提出のみとなりました。','2021-09-06 06:04:33','2021-09-06 06:04:33'),
	(8600,16570,670,3,'コーディング応用3-3','ヘッダーまで終わりました。引き続きコツコツ頑張ります！','2021-09-06 12:09:50','2021-09-06 12:09:50'),
	(8613,16621,699,3,'コーティング基礎','コーティング基礎の１－２marginとpaddingで躓いてしまったのでプロゲードなどを使ってHTML,CSSを初歩的なところから理解しないといけないと思いました。','2021-09-07 09:03:13','2021-09-07 09:03:13'),
	(8614,16537,700,3,'コーディング基礎について学習','テキストの編集～カリキュラム通りに画像を指定のサイズにて作成し、横並びに変更、並びに添付画像ファイルを実際に表示するまでの基礎を学習。\nコマンド入力になれず想定外に時間をとられてしまうこともあったが、不明点等を調べ上げて実際に動作した喜びも初学習にて実感。\n引き続きペースを上げて次ステップへと進みたい。','2021-09-07 09:07:51','2021-09-07 09:07:51'),
	(8618,16613,704,3,'jqueryテスト、レスポンシブデザイン3-1','jqueryテストが終了した。\nfor文に不安が残るので復習したい。\n引き続きレ、スポンシブデザイン3-1から続きを取り組んでいきたい。','2021-09-07 09:55:12','2021-09-07 09:55:12'),
	(8619,16686,707,3,'コーディングの基礎','HTMLとCSSのコーディングの基礎について行いました。\n本日が初日だったため不慣れな部分もありましたが、改めて動画等を観て復習します。\nまたプロパティは改めて調べます。','2021-09-07 09:58:05','2021-09-07 09:58:05'),
	(8623,16662,574,3,'5-2','SQL文の基礎問題が終了しました。実際に使う時は、様々なパターンがあると思うので、復習や新たな書き方など色々と調べていきたいと思いました。','2021-09-07 10:06:08','2021-09-07 10:06:08'),
	(8626,16676,565,3,'5-1 課題１（データ参照・挿入・更新・削除）','データの編集と削除に苦戦している。\n編集ページへの遷移なしでの編集、ポップアップ無しでの削除はできる。\nコードの書き方が悪かったり、idなどの値が入っていないのかもしれない。','2021-09-07 10:28:05','2021-09-07 10:28:05'),
	(8629,16655,648,3,'DB基礎','５−１手直し','2021-09-07 10:36:45','2021-09-07 10:36:45'),
	(8631,16587,668,4,'4-3 課題３（アルゴリズム','４−２のfor文を使う構文苦戦していたが、なんとかクリアすることができた。ループするのは便利だが理解するのに時間がかかってしまったので、忘れないように復習をしていく。\n４−３に入りユーザー定義関数が入り、概念を理解するのが難しく感じている。スマートにかけていないかもしれないので、なるべく見やすく簡単な処理でかけるように早くなりたいと思う。','2021-09-07 10:43:35','2021-09-07 10:43:35'),
	(8634,16312,697,3,'コーディング応用３－３，３－２修正','今日は3-3のコーディングに時間を費やし、残りは3-2の修正に入りました。\n３－２のコードはわかりにくかったので、初めからやり直そうと1から書き始めたのですが、頭がおかしくなりそうで途中であきらめ、元のコードから修正していくことにしました。\n元のコードがなぜこんなものを書いたのか疑うくらい混乱していて、詰まる場面が多くありました。気づいたら長時間没頭してしまっているので、適度に休憩をはさみつつリラックスできる環境を作っていきたいと思います。','2021-09-07 10:52:51','2021-09-07 10:52:51'),
	(8638,16334,698,4,'PHP環境構築/PHP学習','【本日行ったこと】\n・MAMPの設定.....MAMP内でMysqlが作動せず時間がかかっている。それ以外のエラーはないので早急に解決する。\n・PHP学習....推奨されたYouTuberキノコードさんの動画を見たが自分の使用しているPCがMacで動画はWindowsなので理解に苦しむ部分があり、現在違う方の動画を見て学習を進めている。\n\n【次回】\n・なるべく早く基礎学習を終え、課題に取り掛かる。','2021-09-07 11:05:31','2021-09-07 11:05:31'),
	(8639,16334,698,4,'PHP環境構築/PHP学習','【本日行ったこと】\n・MAMPの設定.....MAMP内でMysqlが作動せず時間がかかっている。それ以外のエラーはないので早急に解決する。\n・PHP学習....推奨されたYouTuberキノコードさんの動画を見たが自分の使用しているPCがMacで動画はWindowsなので理解に苦しむ部分があり、現在違う方の動画を見て学習を進めている。\n\n【次回】\n・なるべく早く基礎学習を終え、課題に取り掛かる。\n\n【進捗ボタン】\n実際4だが、表記が3-Aから進まないので明日確認する。','2021-09-07 11:06:55','2021-09-07 11:06:55'),
	(8642,16629,671,3,'PHP基礎知識','xamppをインストールして環境構築を行いました。\nまた、PHPの基礎知識の学習を行いました。\n・変数\n・演算子\n・配列\n・条件分岐\n・関数','2021-09-07 11:17:45','2021-09-07 11:17:45'),
	(8647,16121,538,3,'php自作','PSR2の設定でグローバルにインストールするということをしていなかった為、設定に苦戦にました。\n\n作成中の自作を、gitと連携したのち、githubにpushしました。（カリキュラムでは最後になっていますが、最初から使用したい為。）','2021-09-07 12:27:18','2021-09-07 12:27:18'),
	(8653,16674,620,3,'4-3のアルゴリズム2と３','本日は、課題４－３のアルゴリズム２を終えアルゴリズム３をメインに取り組んだ。\n最大公約数と最小公倍数の求め方がわからなかったので、調べながら変数を利用して行った。また、気づきとしてはif文を使用するとやりやすくなった。','2021-09-07 14:59:17','2021-09-07 14:59:17'),
	(8654,16606,537,3,'データベース','phpmyadmin','2021-09-07 21:31:53','2021-09-07 21:31:53'),
	(8665,16692,700,1,'020_Javascript/jQueryについて取組','Javascript/jQueryを使用してダイアログ表示することを学習。\n色々と実践してみたが思うようにいかず難航。\n新たに押下ボタンを設置してダイアログを出す事は出来たが、既存画像に紐付けることがうまくいかず本日終了。\n本日実践したことの振り返りと、新たに情報収集をして明日に臨みたい。','2021-09-08 09:04:37','2021-09-08 09:04:37'),
	(8667,16688,504,3,'MVCクラス作成','本日はオブジェクト指向のMVCクラス作成の作成に取り組んでいました。\n理解がなかなか出来ずうまく進めることが出来なかったので再度調べ直してりして課題に取り組みました。','2021-09-08 09:49:21','2021-09-08 09:49:21'),
	(8668,16614,704,3,'コーディング応用 3-1,2','レスポンシブデザイン、及びテストサイトの作成を行いました。','2021-09-08 09:53:05','2021-09-08 09:53:05'),
	(8671,16729,538,3,'PSR2のエラーの修正、モック作成。','PSR-2のルールより出たエラーの解決に悩み、自動整形できるようにfixerをインストールしました。','2021-09-08 10:13:21','2021-09-08 10:13:21'),
	(8672,16742,538,3,'psr-2のエラー解決、モック作成。','psr-2のエラー解決に悩み、自動整形できるようfixerをインストールしました。','2021-09-08 10:14:55','2021-09-08 10:14:55'),
	(8673,16742,538,3,'psr-2のエラー解決、モック作成。','psr-2のエラー解決に悩み、自動整形できるようfixerをインストールしました。','2021-09-08 10:15:06','2021-09-08 10:15:06'),
	(8676,16588,668,4,'4-3 課題３（アルゴリズム）','トランプのポーカーの役判定を行い、カードの不正チェック、並び替えまでいったが、いくつかあるパターンの役判定につまずいてしまった。そもそもカードの不正チェックもかなり苦戦したが、foreachが役に立ったという感じだった。そして配列に対しての様々な関数について知識不足感じたので、そこも復習していく。','2021-09-08 10:32:15','2021-09-08 10:32:15'),
	(8678,16313,697,4,'3-2修正とPHP基礎','今日は課題提出とともにその修正とPHP基礎に入りました。\n以前、軽くどのようなコードで書くのかを見たことがあったのと、Javaよりも簡単なコードでしたので、スムーズに進みました。\nこれまでの学習を通じて苦手な部分が明確になってきました。私の場合は、Webページのコーディングが苦手なようです。html,cssコーディングに関しては、以前学んだことのあるものでしたので、自分の力量を過信していたみたいです。\n間違って覚えていることなどが多く、3-2のコーディングではその間違いが全面に現れ苦労しました。これから日々復習しつつ進めていきます。','2021-09-08 10:36:07','2021-09-08 10:36:07'),
	(8679,16737,706,3,'Javascript','フロントの実装の中でJavaScriptの重要度や動きのあるページにするためには必要不可欠なのでしっかりと理解して自分のものにするために取り組みました。','2021-09-08 10:45:33','2021-09-08 10:45:33'),
	(8681,16335,698,5,'phpの実践','【本日行ったこと】\n昨日まで調べて学んだ配列や条件分岐の出力など。\nJavaを学んでいた分早く理解することができ、特別に解消に時間がかかるようなエラーもなく順調に進むことができた。\n\n【次回から】\n課題2のループ文に入ってからはしっかり理解をしないと後に時間がかかってしまうので、確実に定着させてから課題を進めていきたい。','2021-09-08 10:47:56','2021-09-08 10:47:56'),
	(8682,16708,707,3,'JS、jQueryの学習','主にjavascript、jQueryの基礎についてインターネットで調べ、コードを書くなどを行い、勉強を行った。\n2-1に関してはポップアップにおいてアラートの仕組みを理解出来た。','2021-09-08 10:51:17','2021-09-08 10:51:17'),
	(8689,16683,677,3,'jQuery課題','思い通りには進まなかったものの初日よりは理解できる範囲が広がり、ある程度応用の仕方などもわかってきたので、空いた隙間時間できちんと勉強を進めつつ、課題のほうも進めていきたいと思いました。','2021-09-08 11:04:30','2021-09-08 11:04:30'),
	(8690,16656,648,3,'DB基礎','間違えてファイルを消してしまい、５−１の課題が最初からになってしまいました。','2021-09-08 11:14:27','2021-09-08 11:14:27'),
	(8713,16615,704,4,'コーディング応用3-2','３−２がほぼ完成しました。\n今週中にコーディング応用を全て終えたいです。','2021-09-09 07:44:39','2021-09-09 07:44:39'),
	(8714,16741,700,3,'2020_Javascript/jQuery','クリックイベント～If文までを実施。\n一つ一つがまだ調べないと実行できないが、そうして何度も試行錯誤するうちに覚えてくることも多くあり、まだスタートして間もないが少しずつ知識として吸収できているのを実感。\nペースを上げていきたいが、まずは目の前の課題に集中して取り組みたい。','2021-09-09 08:59:36','2021-09-09 08:59:36'),
	(8718,16526,653,3,'アルゴリズム基礎4-3','全課題に対して見直しとテストケースを表示できるようなプログラムを組もうとしましたが、ケースの量が多く2分で表示しきりませんでした。\nひとまず、最低限の結果を手動で検証するようにしたいと思います。','2021-09-09 09:59:27','2021-09-09 09:59:27'),
