	(8737,16745,707,2,'JS、jQueryの学習','昨日と同じくJavascript、 jQueryの勉強を行なった。\n背景の色の変更、またアニメーションに関してを中心に勉強を行なった。\nしかし、まだプログラムの動きがまだ理解出来ない部分があったので、明日も同様に行いたい。','2021-09-09 11:18:34','2021-09-09 11:18:34'),
	(8741,16677,565,3,'5-1 課題１（データ参照・挿入・更新・削除）','ポップアップでのデータ削除ができない。\nポップアップ、データ削除、それぞれ単独だと機能するが、ポップアップの処理のの部分にデータベース削除のコードを書くと機能しなくなる。\nデータの編集に関しては、編集して更新をしてもデータが更新されない。\n自分と同じようなエラーの人の記事を参考にしたりしているが形にできていない。','2021-09-09 20:49:04','2021-09-09 20:49:04'),
