	(8750,16771,700,3,'if文~メディアクエリについて','if文～メディアクエリについて学習。\nif文に関しては、すぐに理解することができ、スムーズに進行することができた。\nメディアクエリについても、まずはmedia screenにて画面サイズに応じて変更できるよう設定できるようになった。\n追加で、課題では図形のみであったが、文字を図形内に入力し、fontsizeやcolorも画面サイズに応じて変更も実施した。','2021-09-10 08:58:24','2021-09-10 08:58:24'),
	(8752,16766,504,3,'MVC作成','本日はMVCの作成に取り組みました。\n国を含めての作成になるのですがうまく結合ができないため、再度復習しながら作成していこうと思います。\n理解したと思ったら理解できていなかったりするので細かく調べながら進めていこうと思うます。','2021-09-10 09:48:40','2021-09-10 09:48:40'),
	(8756,16337,698,4,'ループ文復習/アリゴリズム','【今回】\n・前日にスラスラと解けていた問題が今日になって混乱する部分があったので、ループ文の復習に時間をかけた\n\n【次回】\n最初の1時間だけループ文をし、アリゴリズムの課題に入る\n\n進捗報告ボタンではループ文になっているが、9日の木曜日に次に進む許可をいただいているので実際に取り込んでいるのは3-4です。','2021-09-10 10:20:47','2021-09-10 10:20:47'),
	(8757,16590,668,4,'4-3 課題３（アルゴリズム）','本日中に終わらせることができなかった。理由としては、役を組むのにかなりの時間を要している。しかし本日でポーカーの役を一通り組むことができた。あとは、役が同時に出てしまったり、エラーがでなかったりなどの条件分岐を見直す必要がある。','2021-09-10 10:39:33','2021-09-10 10:39:33'),
	(8758,16775,671,4,'4-1課題提出','4-1の課題を提出いたしました。\n4-2の課題、ループについて学習中です。','2021-09-10 10:42:19','2021-09-10 10:42:19'),
