	(8777,16314,697,3,'ループ練習','今回はルーオプの練習に取り掛かりました。\njavaの時にはなかなかここまでのループの練習に取り掛からなかったため、少し頭を使うことに疲れた印象です。\n基礎の部分はある程度応用できているので、応用部分をしっかりと復習していきたいと思います。','2021-09-12 02:15:58','2021-09-12 02:15:58'),
