	(8783,16832,644,4,'4−1 php基礎','phpの基礎的な記述について勉強した。\n環境によって改行の記述が異なるのに苦戦した。\n結果的に使い分けについて学べた。','2021-09-12 10:03:58','2021-09-12 10:03:58'),
	(8785,16527,653,3,'PHP基礎アルゴリズム 4-3 , 4-4','ナベアツシステムの正体が、FizzBuzzというプログラムを組んだ人の技量を測るものであることを知りました。\nまた、コードを書く際にシンプルさを追求することに目を向けるとよいとご指導いただきました。\nなるべくコードに無駄な部分が発生しないように、今から意識していこうと思います。','2021-09-12 10:07:10','2021-09-12 10:07:10'),
