	(8787,16294,610,3,'PHPバリデーション','cafeサイトのjs処理に時間がかかっていたのをようやく\n提出できました。今日からはバリデーションの機能の追加に\n入りましたが、入力値チェック実装の際に様々な機能があることを\n検索で知り、普段自分が使っていたサイトもこういう仕組みを使って\nいたのかと知ることができ勉強になりました。引き続きなるべく手を\n早めて進められるよう頑張ります。','2021-09-12 10:12:20','2021-09-12 10:12:20'),
	(8789,16338,698,4,'アルゴリズム','【今日行ったこと】\nアルゴリズム課題の3までを行った。\n\n【次回】\n課題の中でポーカーを理解していないと解けない問題があって、その理解から始めたいと思う。','2021-09-12 10:17:08','2021-09-12 10:17:08'),
	(8790,16793,621,5,'6-3 課題３（ログイン機能）','ログイン処理を行うときはセッションを用いる。\nユーザ情報をセッションに格納し、ブラウザのcookieに保存する。\nユーザのセッションファイルを削除することログアウトをすることができる。','2021-09-12 10:20:58','2021-09-12 10:20:58'),
	(8791,16316,697,3,'ループ練習　レッスン17−２０','本日は、昨日お休みしたため、前回行った復習に時間を割きました。\nその後にアルゴリズムの応用に入りました。\n簡単な数学的問題が苦手なので初歩的な調べも行いつつ行いました。\n２日間何も考えられなかっただけでこれほど頭から抜けていることに驚き、毎朝復習しなければいけないなと感じました。','2021-09-12 10:21:44','2021-09-12 10:21:44'),
	(8794,16829,602,1,'6-2 課題２（サイト機能追加・修正）','前回と同じく選手詳細に選手の「得点履歴」を表示してください。\nで躓いております。\nJOINを使用しての結合は上手くいっているのだが、\nvar_dump()でfetch使用の時はbool(false)、fetchAllでもarray()で\nそもそも変数に値が入っていない状態です。\nもう一度１からyoutube渋谷で働くエンジニアチャンネル等を見ながら\n試行錯誤していたのですが、結果まだ表示させることが出来ていない状態です。','2021-09-12 10:34:04','2021-09-12 10:34:04'),
