	(8819,16528,653,3,'PHP基礎/アルゴリズム 4-4 課題４（お問い合わせフォーム）','jqueryで外部ファイルのヘッダーフッターを取得することについて、調べながら進めていきました。\n現段階では、調べたサイトでのjqueryのバージョンが低いのか、コンソールで見る限り読み取れていないので、最新版に変えるなど試行錯誤を続けていきます。','2021-09-14 09:27:10','2021-09-14 09:27:10'),
