	(8822,16857,504,3,'MVC の追加機能','本日はMVCへの追加機能の課題を取り組みました。\n途中つまづいたので、再度課題を復習し直し、取り組んだら進めるようになりました。\n復習したことにより前よりオブジェクト指向について理解ができるようになりました。','2021-09-14 10:02:05','2021-09-14 10:02:05'),
