	(8826,16339,698,3,'アルゴリズム','【今回】\nアルゴリズムの複雑な課題を行なった。\nポーカーを知らなかったこと、講師の方のエラー画面と異なる画面が出たことにより作業が遅れてしまった。\n\n【次回】\nエラー設定の方法をいくつかのサイトで確認し実行してもエラーが出ないが、再度環境を見直す。\n次の課題であるフォームを終わらせ、テストの範囲まで可能であれば進みたい。','2021-09-14 10:13:57','2021-09-14 10:13:57'),
	(8827,16591,668,4,'4-3 課題３（アルゴリズム）','jokerを取り入れることで一段階難易度が上がった。しかし、ジョーカーなしで一度作っているので、細かいところを条件分岐して作成し、完成することができた。ジョーカーが加わることで特にエラーの条件が複雑して時間を要した。\n４−２、４ー３と進捗が遅れているので、４−４ではどうしたらより効率的にできるか考えながらやっていく。','2021-09-14 10:16:57','2021-09-14 10:16:57'),
	(8828,16317,697,3,'アルゴリズム練習','本日はアルゴリズムの問題にとりかかりました。Javaのスクールでは行えきれなかった応用が多く、考え方を導き出すのにだいぶ苦労しました。\nもう少し根本的な考え方を本などを買って知見を深めたいなと感じました。\n引き続きよろしくお願いいたします。','2021-09-14 10:18:13','2021-09-14 10:18:13'),
