	(8830,16890,707,4,'javascript、jqueryの課題（4-5）、CSSについて','本日は課題2において4-5を行なった。\nif文について新たに理解が深まった。\n\nコーディング応用のレスポンシブデザイン基礎はまだ理解が深まっていないため、明日はコードを書き、理解を深めていく。','2021-09-14 10:23:09','2021-09-14 10:23:09'),
	(8849,16888,565,3,'5-1 課題１（データ参照・挿入・更新・削除）','更新をデータベースに反映できていないので、講師に質問をしました。\nPHPMyadminでの編集はデータベースに反映されていました。\nSQLは正しく、PDOの使い方の部分で抜く漏れ等のミスの可能性があるということだったので、もっと確認していきたいと思います。','2021-09-15 03:52:49','2021-09-15 03:52:49'),
