	(8859,16910,504,3,'MVC 削除機能','本日はMVCの削除機能の追加を取り組みました。\n削除ボタンにより非表示にすることができたのですが、挙動がおかしいので再度考えてみようと思います。','2021-09-15 09:35:45','2021-09-15 09:35:45'),
	(8860,16907,700,2,'サンプルサイト作成(続)','前回に引き続き、サンプルサイトの作成に着手。\n大まかな状態としては完成しつつあるが、微調整やうまくコントロールできていない箇所があるため、そこの修正に本日着手。','2021-09-15 09:45:59','2021-09-15 09:45:59'),
