	(8866,16318,697,3,'アルゴリズムとサーバー（PORT）エラー解決','本日は、前半にアルゴリズムの分からなかった部分を調べ、取り掛かりました。\nその際に、逐一実行をしていたのですが、コードがWEB画面に保存されず、（履歴が残っている状態）新しいコードを書いても更新されずそのエラーに取り掛かりました。ポートをkillコマンドで削除したりインストールし直したりして結局、portの異常のためにエラーでした。\nアルゴリズムは、もう少し頭を柔らかくして考えないと進まないと反省しています。\n引き続きよろしくお願いいたします。','2021-09-15 10:22:01','2021-09-15 10:22:01'),
