	(8869,16340,698,3,'お問い合わせフォーム','【今回】\n昨日起きたエラーの解消から次のフォーム作成。\n完成図のサイト見本を見ながら同じものを作成するのだが、ヒントが少なく手探りの作業も多い為苦戦している。\n【次回】\n時間内前半でまずは見える部分のコーディングを行い、終わり次第システムの作成を行なっていく。','2021-09-15 10:27:19','2021-09-15 10:27:19'),
	(8871,16892,565,3,'5-1 課題１（データ参照・挿入・更新・削除)','改めてPDOの使い方を見直した。\nPDO部分のコードの書き方にあまり問題が見当たらない。\n編集後の情報の受け渡しが上手くできていないのかもしれない。\n引き続き見直して取り組む。','2021-09-15 10:46:52','2021-09-15 10:46:52'),
	(8872,16592,668,4,'4-3 課題３（アルゴリズム）,4-4 課題４（お問い合わせフォーム）','お問い合わせフォームでより実践的な内容になり、データを送信するときどこに格納していくのかを明確していく必要がある。ディレクトリの管理も行い、どのルートで開くのかも確認が必要と感じた。','2021-09-15 10:47:43','2021-09-15 10:47:43'),
