	(8879,16920,677,4,'一か月面談と、課題','面談をした際に講師の方にお聞きした方がいいこと、違うやり方や、質問の仕方や、目的などさまざまな事を話すことができ、考えをアウトプットしたことで方針や目的を再確認して、少し安心できたような気がしました。\n今取り組んでいる課題を目標や期日をもって提出していけるように計画を立てたり、課題の効率的な取り組み方を考えたので、これからもう少しペースアップしていけたらなと思います。','2021-09-15 11:23:51','2021-09-15 11:23:51'),
