	(8902,16934,504,3,'MVC バリデーション','本日はMVCの誕生日のバリデーションを取り組みました。\n存在しない日付のバリデーションを組むときに表示などはされるのですが、なぜかエラー表示が出てきてしまのでエラーが出ないよう再度考えていこうと思います。','2021-09-16 09:56:16','2021-09-16 09:56:16'),
	(8904,16341,698,3,'フォーム作成','【今日】\nお手本のサイトを見てサイト作成。\n先にphpファイル内にHTMLとCSSでお手本と同じ形のサイトを作成し、後からJavaScriptを加え、phpに直せるところは修正していく予定を立てた。\n\n現在はお手本より足りないところはいくつかあるが近しい地点までは作成することができた。\n\n【明日】\n足りないところを補いつつphp、JavaScriptを足す。','2021-09-16 10:12:35','2021-09-16 10:12:35'),
	(8905,16949,700,2,'サンプルサイト作成(続)','前回に引き続きサンプルサイト作成。\n昨日不明点や思うように操作できない直面に当たったが、本日再度学習することにより、細かな課題点を修正。\n残りレイアウトの微調整のみ。','2021-09-16 10:15:09','2021-09-16 10:15:09'),
	(8907,16847,704,3,'PHP基礎','4-Aほぼ完了しました。','2021-09-16 10:43:53','2021-09-16 10:43:53'),
	(8908,16953,651,3,'課題4-4 取り組み','サイトの見た目を完成させ、jQueryのクリック⇒スクロールと一定スクロール時のnavの固定を実装した。','2021-09-16 10:43:58','2021-09-16 10:43:58'),
	(8910,16321,697,3,'アルゴリズム修正とフォーム作成','今日は先日からのアルゴリズムの修正から入りました。\nポーカー判定はもっと簡単なコードを用いてできると思うのですが、別の方法がなかなか分からず、長いコードになってしまいました。\nフォーム作成に関してはヘッダー、フッターの共通化やJSのコードも出てきたので復習になりました。やはり、まだ調べることを片手に進めているので頭にまだしっかり入っていない証拠だなと感じました。復習の量を考えたいと思います。','2021-09-16 10:49:45','2021-09-16 10:49:45'),
	(8914,16958,648,3,'DB基礎','５−１最終確認','2021-09-16 10:57:00','2021-09-16 10:57:00'),
	(8915,16593,668,4,'4-3 課題３（アルゴリズム）','ポーカーの誤りを見つけたため、再編集を行った。ジョーカーのエラーで、条件分岐がうまくいかず、通常のスートの０でエラーが出なかったり、元の配列の１番目以降にジョーカーが来た時にエラー判定を行わなかったなどがあり、細かい修正をしてはまた別のところを直すという感じになってしまった。確実に終わらせて次に行きたいと思う。','2021-09-16 10:57:26','2021-09-16 10:57:26'),
	(8917,16931,716,3,'コーディング基礎、JS','実際の案件で触ったことがありましたが、\n復習として学習しました。\n\nJQの基礎の部分も続けて学習いたしました。','2021-09-16 11:07:30','2021-09-16 11:07:30'),
	(8919,16639,538,3,'php自作','php自作取り組み中です。\nformにname属性を書いていなかったためpostリクエストが受け取れないエラーに悩んでしまいました。','2021-09-16 13:14:38','2021-09-16 13:14:38'),
	(8925,16926,620,3,'4-3','本日は、4-3の課題提出のみを行いました。\n前日は、インデントを揃えるように。と岩崎講師の方からご指摘を頂き修正しました。\n\nATOMでは問題がなく、VSコードではエラーになったので、原因がわからなかったので、設定をやり直しました。\n\nまた、再提出をした際、\n井上講師よりalgorithm4の変数が変になってるとご指摘頂きました。\n\nインデントを揃える際、誤った文字を入力してしまったので、最終確認を怠らず次も取り組んで行きたいと思います。','2021-09-16 22:55:56','2021-09-16 22:55:56'),
	(8935,16876,563,4,'PHP基礎課題4','PHP基礎課題4の課題を修正完了','2021-09-17 06:09:11','2021-09-17 06:09:11'),
	(8936,16970,700,3,'サンプルサイト作成(続)','本日で課題No3 3-2サンプルサイト作成を講師チェックまでは進めることができたが、ご指摘有り。\n細かなレイアウト調整に再度取組中。\n画面サイズが変わるごとに配置が崩れてしまうため、メディアクエリをうまく活用してバランス調整したい。\n時間はかかっているが、日に日に自身なりにこうした方がいいのではないか、等が浮かぶので成長は感じている。','2021-09-17 09:04:07','2021-09-17 09:04:07'),
	(8939,16611,698,3,'フォーム作成','【今回】\n昨日同様HTMLとCSSで課題の基礎作成。\n見本と同じようなものが完成したので次回からはJavaScriptとPHPを組み込んでいく。\n\n【次回】\nJavaScriptを加えると想像しているものと違う形態になってしまいエラーが出たりするので原因を調査しつつ進めていく。','2021-09-17 10:03:50','2021-09-17 10:03:50'),
	(8941,17000,718,4,'コーディング基礎','本日は、HTML/CSSを活用してコーディングについて学んだ。\n独学でも少し触れた部分もあったが、フレックスボックスについては知らなかった為、新たな知識を取り入れることができて良かった。','2021-09-17 10:10:56','2021-09-17 10:10:56'),
	(8943,16848,704,4,'PHP基礎','4-Aが終了し、4-1取り組み中です。','2021-09-17 10:32:49','2021-09-17 10:32:49'),
	(8944,16320,697,4,'PHPフォーム作成','本日は、フォームを作成する際のページ作成をメインに行いました。\n毎回、OSによってのレイアウト崩れが生じます。\nOSを二台活用しているため、OSによってレイアウトがなぜ崩れるのかいくつか調べましたが、まだはっきりとした解決になっていません。\nメインページのJSなどもほとんど完了したので、メインのフォームに取り掛かれそうです。\n引き続きよろしくお願いいたします。','2021-09-17 10:37:00','2021-09-17 10:37:00'),
	(8949,16978,611,3,'4-3 課題３','4-3 課題３\n4、５のポーカーの課題をテスト、修正中です。','2021-09-17 10:56:18','2021-09-17 10:56:18'),
	(8950,16990,715,3,'コーディング基礎','難易度の高さに最初は戸惑いましたが、自分で調べ少しずつ形になると達成感と学びがとても大きいかったです。１日の目標のカリキュラムを達成できず、とでも悔しいので、少しずつ取り組み方を覚え、効率よく学習していけるように次に活かしたいです。','2021-09-17 11:04:30','2021-09-17 11:04:30'),
	(8953,16594,668,4,'４−４　課題４（お問合せフォーム）','データの受け渡しがうまくいっていない。phpと併用で上手に動かないのでデータの型やパスの間違いも確認が必要。また、時間をなるべくかけないようにお問合せのページやホームページのメインページなどできるところから進めていく。','2021-09-17 12:54:37','2021-09-17 12:54:37'),
