	(8962,16927,620,1,'4-3再提出','井上講師よりご指摘頂いた、\nalgorithm4の修正箇所を再度取り組みました。\n$huseicard3の変数が機能していなかったので、機能するよう修正をかけました。明日提出いたします','2021-09-18 08:04:58','2021-09-18 08:04:58'),
