	(8973,16529,653,2,'アルゴリズム基礎　4-4　','jsを使ってヘッダーフッターを共通化はしたものの、フォームのページではCSSが正しく読み込まれていない状態にあります。\nCSSの内容を再確認していきます。','2021-09-19 08:37:09','2021-09-19 08:37:09'),
	(8974,17029,677,4,'課題3-3取り組み','あと少しで終わるという段階までこれたので、一応は自分の目標としている日数には届きそうかと思いました。\nなかなか取り組めない時間もありますが、これからも時間をうまくやりくりして課題の進行をしていけたらなと思います。','2021-09-19 09:09:56','2021-09-19 09:09:56'),
	(8975,17003,700,3,'サンプルサイト作成(続)','前回提出時に指摘点があったため、レイアウトの調整を実施。\n一通り完了したが、ミスがないかしっかりと確認してから次回提出予定。','2021-09-19 09:40:22','2021-09-19 09:40:22'),
