	(8977,17019,504,3,'MVC データの更新機能追加','本日はデータの更新機能の追加と、再度バリデーションの見直しをしていました。\nプルダウンでのidから受け取ったデータを更新画面では表示させない機能なども追加しました。\nまだまだ理解ができない部分がありますが前より理解ができるようになってきました。\n引き続進めていこうと思います。','2021-09-19 09:56:56','2021-09-19 09:56:56'),
	(8978,16998,718,4,'JavaScript/jQuery','本日はNo.2の課題を行なった。on()とanimate()に少し手間取ってしまったが、インターネットを駆使することで理解することができた。また明日にでも復習を行い理解度を高めていきたい。','2021-09-19 10:09:00','2021-09-19 10:09:00'),
	(8979,16938,698,3,'フォーム作成/アルゴリズムテスト','【今回】\n・フォーム作成完了 \n添削にて、POSTでお問い合わせフォームの情報を出力する部分に修正\n・アルゴリズム(渡された数字が素数かを判定など)課題\n\n【次回】\nアルゴリズム兼テストを終わらせる。\n次の範囲がデータベースなので、その範囲に入る前に復習をしてから進む。','2021-09-19 10:10:19','2021-09-19 10:10:19'),
	(8980,16995,621,5,'6-4 確認テスト（お問い合わせ作り直し）','MVCで作成した時のデータベースの接続や、やり取りが上手く理解できない所があったので前項で作成したコードと見比べながら、処理の流れを順番に追っていくと、どんな処理順で動いているかが分かり理解することができた。','2021-09-19 10:15:55','2021-09-19 10:15:55'),
	(8981,16295,610,2,'php バリデーション','ｊｓとphｐのバリデーションに取り組み中です。\nフォームの文字数制限や電話番号の形式の設定に詰まっています。\n正規表現や関数など、様々な表し方があり勉強になりました。\nもう少し方法を調べ、機能を実装できるよう頑張ります。','2021-09-19 10:20:58','2021-09-19 10:20:58'),
	(8983,16950,716,3,'JavaScript,jQueryとレスポンシブ','実際に使用していたが、まだまだ基礎の知らないところも学ぶことができた。\nもっと応用もできるようにスピード感を持って取り組んでいきたい。','2021-09-19 10:32:38','2021-09-19 10:32:38'),
	(8987,17018,602,3,'PHP応用 課題２ 機能追加 5のバリデーションまで','idを新しく振りなおすROW_NUMBER関数がmysqlで使えなくて\nselect(select)の様に二つ使って実装しようとしたが上手くいかず、\n@rownum=0;を使って１ずつ足していく方法を採用しました。\n\n論理削除のJSのポップアップでの削除について\ngetElementByIdがforeachを使用していたので複数取得になり\n最初しか発火しなくてclassやquerySelectorAll等使用してみたが上手くいかず\nJQueryで論理削除を行いました。　＄(\'.delete\').click(function()\n\nbirthのバリデーション設定まで完了しました。\n引き続き作業を行います。','2021-09-19 10:39:14','2021-09-19 10:39:14'),
	(8988,17020,669,3,'4-2','4-2lesson17の修正をしました。','2021-09-19 10:40:10','2021-09-19 10:40:10'),
