	(8996,16322,697,4,'バリデーショ,お問い合わせフォーム,ホームページ作り','本日はメインでホームページ作成とその中に記載するJSのコードを書いていました。ｈｔｍｌ、ｃｓｓに関してはだいぶ慣れてきたのですが、JSに関してはまだまだと感じました。だいぶ日にちが経過し、書き方を見直す必要がありそうです。特に詰まる場面もなくスムーズに進みましたので休みあけ、しっかり取り組んでいきたいと思います。引き続きよろしくお願いいたします。','2021-09-19 13:01:06','2021-09-19 13:01:06'),
	(8998,16512,662,5,'課題6-3が終わりました。','課題6-3が終わりました。パスワードのハッシュ化に多少手こずりましたが、新規ユーザ登録から作ることで解決しました！！\n課題6-4は火曜日に提出致します！！','2021-09-19 15:30:55','2021-09-19 15:30:55'),
