	(9010,17050,715,3,'javascript,jquery','本日はjavascript,jqueryｖに進み新しいことを学びました。新しい課題でも一体、何を意味しているのか考ることが多いです。ですが、まず一つ一つ理解し、実際にコードに触れていけば解決できることを、前回のコーディング基礎での課題で経験したので、一歩ずつ頑張っていきます。','2021-09-21 08:59:51','2021-09-21 08:59:51'),
