	(9014,17041,504,3,'MVC ログイン機能追加','本日はログイン機能の追加を取り組みました。\nまだ取り組み始めたばかりでわからない事があるので一つ一つしっかり理解していきたいです。','2021-09-21 09:56:26','2021-09-21 09:56:26'),
