	(9019,17063,669,3,'4-3取組','４－３のlesson2に取り組み中です、計算に苦戦しています、しっかり復習してまた取り組みたいです。','2021-09-21 10:08:14','2021-09-21 10:08:14'),
	(9020,16939,698,2,'バリデーション','【今回】\nバリテーション作成\n途中で起こったエラーが多く、思うように課題を進めることができなかった。\n\n【次回】\nバリテーション課題を最初の2時間以内に終え、アルゴリズム最後のtestまでを終わらせる。\n\n【起こったエラー】\n・バリデーション(jsのものとphpのもの2種類)を作成する課題だが、jsは表示されるもののphpがうまく表示されない。\n・atomが重いのか使用しているMacが落ちてしまい再度立ち上げるまでに1時間かかってしまったので現在はVScodeと併用している','2021-09-21 10:10:46','2021-09-21 10:10:46'),
	(9022,16323,697,3,'バリデーションとその他XSS、ダイレクトアクセス禁止など','本日は昨日作成したホームページにバリデーションやセキュリティ対策などを加えた学習を行いました。\n\n多くの方法がある中、いろんな言語を知っているせいかコードを書く際に混乱する場面がありました。\nセキュリティ対策などは大差のないコード量なので一つ的確なものをインプットしてしまえばそれを多用できるのでひとまずどのようなコードを使ってやるのか覚えるところから入ったほうがいいかとおもいました。\n\n\n本日の後半には以前に出たVScode でのサーバーエラーが発生しました。\nなぜ毎回サーバーエラーが出るのか疑問を幾つか上げてみました。\n1.スクールに通う前にポートを自身で変更したりしていた。\n2.Gitとの連携をvscode 上で設定していて、\n新規でファイルを作ると全てのコードがGitにステージングされている状況が発生している\n\nこれらがあるのでそこらへんからエラーがどこから湧いているのか解決していきたいと思います。\n明日はデータベースに入れるよう尽力します。\n引き続きよろしくお願いいたします。','2021-09-21 10:19:13','2021-09-21 10:19:13'),
