	(9055,16530,653,2,'2020_PHP基礎/アルゴリズム　4－4','今回は引き続き、問い合わせフォームを含めたサイト作成を行いました。\n見た目に関してはobject-fitやline-heightなど今まで意識していなかったCSSを使用したことで、より手軽に見た目を整えることができました。\n次回、お問い合わせフォームの作成について深く学んでおきます。','2021-09-22 10:07:58','2021-09-22 10:07:58'),
	(9056,17097,562,3,'php基礎4-4','php基礎4-3完了\nphp基礎4-4取り組み中','2021-09-22 10:15:27','2021-09-22 10:15:27'),
	(9058,16324,697,4,'phpでのValidation修正','本日はValidationの作成がメインでした。JS,ｐｈｐでのＶａｌｉｄａｔｉｏｎはすぐに終わり、ＸＳＳ、ダイレクトアクセス禁止を作成していましたが、途中で確認画面に移行する画面遷移がうまくいかず長時間頭を悩ませました。\n\n何十通りも試行錯誤を重ねましたが解決に至らなかったので、講師の方に質問をしました。回答のヒントをもとにようやく根本的な間違いがありそうな個所を見つけることができましたが、いまだ解消にはなっていません。\n\n新たな方法で1からコードを書いてみるのもいいかなと思い、すこし目標日数が過ぎてしまいますが、行ってみたいと思います。','2021-09-22 10:17:17','2021-09-22 10:17:17'),
	(9061,16940,698,1,'バリデーション','【課題】\n・氏名/ふりがな/電話番号/email/お問い合わせ内容をJsとPhPで作成\n\n【今回】\n課題を提出したが以下の不足\n・電話番号の数字外入力の規制はできているが入力必須ではないのに入力しないと進めない(JS)\n・バリデーションに引っ掛かり入力画面に戻った際、名前のふりがなとお問い合わせ内容のデータが消えている\n2日続けて思うように課題を進められないスランプに陥っている。\n1つ訂正するとできていた部分にエラーが出たりする。\n\n【次回】\n焦らず一旦は今ある課題の不足を埋める。\n・','2021-09-22 10:27:56','2021-09-22 10:27:56'),
	(9062,17081,718,4,'No4.4-1','本日は、PHPの基礎構文を学んだ。他の言語と同じような処理方法が多かった。\n日時を扱う関数の処理方法が難しいと感じた為、復習していく必要があると感じた。','2021-09-22 10:31:42','2021-09-22 10:31:42'),
	(9064,17055,648,3,'DB基礎','５−１確認してもらっています','2021-09-22 10:40:40','2021-09-22 10:40:40'),
	(9069,16895,668,4,'4-4 課題４（お問い合わせフォーム）','他のファイルにうまく飛ばないケースが多々あるので、パスを確認して修正が必要。今までより実践的な課題となっていて、前回課題のポーカーではゴチャゴチャしてしまった印象があるのでなるべく見やすさにも気をつけたい。','2021-09-22 10:55:34','2021-09-22 10:55:34'),
	(9073,17035,704,4,'php基礎','4-1を終了し、4-2取り組み中です。','2021-09-22 11:51:29','2021-09-22 11:51:29'),
	(9083,17074,722,3,'コーディング基礎テスト及びステップ２','2−２に入ってから進捗が悪く、詰まっている感じがある。\n明日、再度調べたのち質問等で解消していきたい。','2021-09-22 19:50:58','2021-09-22 19:50:58'),
	(9085,17090,565,3,'5-1 課題１（データ参照・挿入・更新・削除）','PDOを見直した。\n改めて様々な記事を見てコードの書き方を見直したが、まだ上手くいかない。\n引き続き取り組んでみて、わからなかったまた講師にお聞きして解決していきたい。','2021-09-22 22:10:36','2021-09-22 22:10:36'),
	(9096,17154,504,3,'MVC ログイン機能追加','本日はログイン機能に、ダイレクトアクセス禁止、権限の機能の追加をしました。\nファイルも多くなってきてしまったのでrequire関数を使用し、再度見やすいようにしました。\n現在、パスワードのハッシュ 化 、 暗号化に取り組んでいます。','2021-09-23 09:52:11','2021-09-23 09:52:11'),
	(9097,16941,698,2,'バリデーション学習','【今回】\n前回ウェブで検索して出た物を理解しきっていないままコードに記述してエラーが出続けていたので、今日は一旦バリデーションの学習に時間をあてた。\n\n【次回】\n今日学習したものを踏まえ課題を解く。','2021-09-23 10:08:43','2021-09-23 10:08:43'),
	(9098,17122,669,3,'4-3取組中です。','lesson2を終了させました。','2021-09-23 10:08:52','2021-09-23 10:08:52'),
	(9100,17113,610,3,'PHP バリデーション','phpとjsのバリデーションがおおよそ終わり、\nダイレクトアクセスを禁止する部分に入りましたが、上手く設定が出来ず調べながら試行錯誤中です。事前調査のなかで理解が浅かった部分がありましたが、検索をする中でどのように使うのかがなんとなく理解でき、勉強になりました。','2021-09-23 10:12:22','2021-09-23 10:12:22'),
	(9103,16514,662,5,'課題６−４を終了しました。','課題６−４を修了しました。\nPSR2のコーディングルールチェックを提出時に怠ってしまったり、無意味なコードを多数記述してしまいました。今後きちんと反省して自作に臨んで参ります。\n課題自体はそれまでの内容に比べて比較的容易でした。\n今後も宜しくお願い致します。','2021-09-23 10:14:50','2021-09-23 10:14:50'),
	(9104,16325,697,2,'html,validation修正','ここ数日、少し焦りもありざっと情報を入れたら、パンクしてしまいました。\n想定していなかったご指摘を受け、確認OKをもらった箇所でしたので頭の整理が追いつきませんでした。\n\n今までで学んだことは\nhtmlでも自身の思い違いの部分が明確になったこと。\n自身の能力をしっかり見定めることができている。（自身の力を過信しすぎ）\n焦りは大切ですが、その焦りが頭を混乱させ、詰まってしまいました。\n明日以降は頭をすっきりさせる様に基礎をもう一度見直したいと思います。','2021-09-23 10:15:00','2021-09-23 10:15:00'),
	(9105,17138,574,3,'6-2','別テーブルのデータを呼び出す方法を考えていましたが、望んだ結果を\n出すことが出来ませんでした。質問したところテーブル結合を行った方が良いとのことでしたので、テーブル結合を使用した呼び出し方を考えていきます。','2021-09-23 10:16:48','2021-09-23 10:16:48'),
	(9107,17125,700,3,'コーディング応用サンプルサイト作成','No3-3に取組中。\n一部レイアウトにミスがあったため、修正中。','2021-09-23 10:28:24','2021-09-23 10:28:24'),
	(9108,17129,718,3,'PHPループ文','本日はループ文を学んだ。\nいくつもの種類があり何度も行うことで様々な思考力がついている感じがしている。引き続き取り組んでいきたい。','2021-09-23 10:29:51','2021-09-23 10:29:51'),
	(9109,16896,668,4,'4-4 課題４（お問い合わせフォーム）','お問い合わせフォームをHTMLからPHPの拡張子に変えることでcssが微妙に機能しないところがあった。他にも見本のデザインと異なるページとなっており、修正を行った。さらにjqueryを使い動きのあるところも加えた。\nまだ完成が見えていないが、一つ一つ潰していく。','2021-09-23 10:30:23','2021-09-23 10:30:23'),
	(9110,17115,707,4,'3-3 サンプルサイト制作','サンプルサイト（株式会社Lenew）の制作に取り組んだ。\nレスポンシブデザインの面で対応しているエリアと対応していないエリアが分かれているため、コードを改めて確認する必要がある。','2021-09-23 10:30:44','2021-09-23 10:30:44'),
	(9112,17117,621,5,'6-4 確認テスト,7-1 設計','ログイン処理時の分岐やDB登録内容の出力など、基礎で学習したif,foreach構文などの基礎的なものの応用でアプリが出来上がっていくので基礎を固めておくことが大切だと感じた。','2021-09-23 10:33:39','2021-09-23 10:33:39'),
	(9113,17036,704,4,'PHP基礎ループ','4-2課題取り組み中です。明日提出予定です。','2021-09-23 10:39:26','2021-09-23 10:39:26'),
	(9115,17140,648,3,'DB基礎','手直し中','2021-09-23 10:40:33','2021-09-23 10:40:33'),
	(9118,17145,644,3,'4-3 課題３（アルゴリズム）','今回はphpの勉強というより、頭を柔らかくする必要があった。\nポーカーのアルゴリズムにジョーカーを追加する課題で詰まってしまったので、次回は改善したい。','2021-09-23 10:57:07','2021-09-23 10:57:07'),
	(9119,17099,602,3,'PHP応用6-2の機能追加','PSR-2のコーディングルールに従って\nnamespaceの設定で躓いておりました。\n記載の方法に問題があり、質問させて頂いてヒントを頂いたおかげで\nエラーを解決できました。\nnamespaceはいわゆる名前付けの様なもので\n使いたいファイルでuseを使用するのですが、\nあくまで呼び出し方はあまり変わらずに\nuse namespace class名と記載して\n＄test = new class名（）； インスタンス化\n＄test2 = $test->index(); メソッドの呼び出し\nまだ完璧ではないですが、フレームワークでもよく分からず\n放置してたところだったので、少しでも理解出来て良かったです。','2021-09-23 10:58:48','2021-09-23 10:58:48'),
	(9121,17149,565,3,'5-1 課題１（データ参照・挿入・更新・削除）','PDOの更新を取り組んだ。\nwhere句のidや変数が原因ではなく、$pdo->prepareする際にカラム名を利用していなかったがために更新がされなかった。\nそこを修正したら更新できた。\n削除の際のjavascriptがまだ十分な形ではないのでそこの修正を取り組んでいく。','2021-09-23 11:20:29','2021-09-23 11:20:29'),
	(9124,17105,671,3,'4-2,4-3','4-2の学習及び提出を行いました。\nまた、4-3の学習について取り掛かりました','2021-09-23 12:21:18','2021-09-23 12:21:18'),
	(9126,16879,563,4,'PHP基礎課題5','エラーチェック　提出前確認','2021-09-23 13:05:09','2021-09-23 13:05:09'),
	(9132,17146,722,4,'引続き2-2,2-3の取り組み','2-2では構文に見落としがあったために大幅な時間を掛けてしまった。\n2-3も終わってみるとシンプルな内容だっただけに、これも時間をかけ過ぎた感じがある。\n調べ方もブラウザだけでなく動画サイト等も利用しながら、理解度がより早くなるよう工夫していきたい。','2021-09-23 23:53:23','2021-09-23 23:53:23'),
	(9133,15855,640,3,'課題','課題に取り組みました。','2021-09-24 00:42:02','2021-09-24 00:42:02'),
	(9136,17015,620,1,'4-3課題修正','再度、4-3を提出し、\n\n岩崎講師より、\nバージョンの変更、\nエラーの確認、\nテストケースのコメントアウト、\nを修正するよう指示を頂きました。\n\nバージョンを8から7にさげるために、バックアップをとること、エラー修正をメインに行っている中です。','2021-09-24 08:19:28','2021-09-24 08:19:28'),
	(9137,17171,611,3,'4-3 課題３','4-3 課題３\nインデントを修正中です。','2021-09-24 09:36:15','2021-09-24 09:36:15'),
	(9139,17153,504,3,'MVC パスワードハッシュ化、新規登録機能','本日は新規登録時にパスワードをハッシュ化する機能、以前登録されていたメールアドレスへのバリデーションを取り組みました。\n不正ログインへの対応をかなり細かく見ていかないと後でユーザー情報が盗まれてしまったりするのでこの部分は気にしすぎるくらいしっかり気にしていこうと思います。\n他に対策できることがあるか普段から情報を集めていこうと思います。\nまた以前作成したCafeサイトのファイルをMVC仕様にまとめる作業もしました。\n以前自分で作成したファイルが見辛かったので苦労しています。\n後で作業することも考えて最初からしっかりまとめていこうと思います。','2021-09-24 10:06:29','2021-09-24 10:06:29'),
	(9140,16326,697,4,'valirration修正とレイアウト修正、DBハンズオン','本日は昨日の修正に入りました。\n昨日パンクしてしまいどんなものも頭に入らなかったのですが、\nPHPのコードを1から別の手順で作成したところ少しコードは長くなってしまいましたが、うまくいきました。\n以前は便利そうな型を見つけて作成していたため、自身の手順を理解していないのが原因でした。\n今回、長く修正に時間がかかってしまったものを糧に今後の課題を見つけました。\n\n１　複雑なものは簡易手順書を作成する\n２　配列で作れるものは配列でコードをまとめる（理由：今回1から書き直したもので最初配列を用いてコードを簡潔に書いていたのですが、少しそこの理解で混乱してしまっていたのでより多く配列、連想配列を練習し混乱しない状況を作りたいと思います）\n\nDBに関してはJAVAの時も楽しくかつ得意なほうでしたのでスムーズに進められると思います。\n今後PHPでの自作を行うにあたり、西田原さんがおっしゃっていた構造を考えることですが、だいたいのコンセプトはできているので、DBの学習を行うと同時に並行してカラムやどんなデータが必要か詰めていきたいと思います。\n引き続きよろしくお願いいたします。','2021-09-24 10:13:37','2021-09-24 10:13:37'),
	(9141,17141,648,3,'DB基礎','５−１手直し中','2021-09-24 10:21:02','2021-09-24 10:21:02'),
	(9143,17165,574,3,'6-2','詳細画面への追加で新たに関数を作ろうとしていました。\nsql上では表示されてもphpで実行するとエラーが出て止まってしまったので原因を調べて解決しようと思います。','2021-09-24 10:23:42','2021-09-24 10:23:42'),
	(9144,17161,700,3,'サンプルサイト作成(続)','No3-3を提出まで実行できたが、ご指摘点あり現在レイアウト修正中。\nSP時と通常時のレスポンシブ対応がうまくできておらず、再度学習中。','2021-09-24 10:27:23','2021-09-24 10:27:23'),
	(9146,16942,698,3,'バリデーション提出','【今回】\n昨日までにエラーが起きていたところを修正し時間内に課題を提出したが返答がなかったので次の課題には進めず。\nその間にCSSで増えた知識を整理した。\n\n【次回】\nアルゴリズム範囲テスト','2021-09-24 10:32:29','2021-09-24 10:32:29'),
	(9151,17037,704,4,'PHP基礎ループ','課題2を提出し、確認終わりました。次のアルゴリズムに進みます。','2021-09-24 11:25:49','2021-09-24 11:25:49'),
	(9157,16897,668,4,'4-4 課題4（お問い合わせフォーム）','cssで親要素にfilterを使い、子要素にpositionで場所を指定しようとすると、positionが効かなかった。背景画像に透け感を出したかったのでfilterではなく、background-blend-modeを使い解決できた。','2021-09-24 13:15:21','2021-09-24 13:15:21'),
	(9171,16882,563,4,'2020_PHP基礎課題5','JSバリデーション作業中','2021-09-26 01:15:25','2021-09-26 01:15:25'),
	(9177,17038,704,3,'PHP基礎','4-3アルゴリズム取り組み中です。','2021-09-26 09:43:27','2021-09-26 09:43:27'),
	(9182,17126,716,3,'コーディング応用、PHP基礎','・レスポンシブ\n・PHP基礎学習\n→基礎学習に時間をかけ過ぎなので次回注意すること','2021-09-26 10:07:10','2021-09-26 10:07:10'),
	(9183,16943,698,2,'データベース作成','【課題】\nphpMyAdminでMYSQLテーブルを作成。\n前回までに作成していたcafeHPに接続する\n\n【今回】\n・phpMyAdminをダウンロードした後にMAMPが作動しなくなり、MAMPを再インストール。\n・MAMPのポート番号が被ってしまうのでターミナルでkillを行う。\n・MAMPエラーでmysqlが開かなくなってしまった\n《原因》\nMAMP から MySQL を終了させるときに一部プロセスが残ってしまう\n《解決方法》\nkillall -9 mysql\n\n・phpMyAdminでのテーブル作成終了\n\n【次回】\nHPに作成したデータベースを接続','2021-09-26 10:09:52','2021-09-26 10:09:52'),
	(9184,17198,602,4,'PHP応用 6-3 6-4完了','ログイン機能の実装と以前作成したcafeをmvcモデルに作成し直しました。\nログインに関してはhash化した後の照合もpassword_verify（,）を使用し\n難なく行うことが出来ました。\n躓いた点しましては、変数の型idは持たせる必要があるかどうか等で躓きました。\ncafeに関しては、フレームワークを使わない、フルスクラッチ？を用いることで\n一つ一つ動きを確認することが出来ました。特にModelsのインジェクション対策やデータベースの結合は大変勉強になりました。\nしかしながら説明出来るかと問われるとconstructやデータベースの利用についてあやふやな点が多いため、自作でしっかりと理解できるように取り組んでまいります。','2021-09-26 10:22:48','2021-09-26 10:22:48'),
	(9185,17162,718,2,'No.4-3　アルゴリズム','本日は、アルゴリズムのポーカーの役を判定するプログラムの制作を行なった。\n一日のほとんどをカードの不正チェックのプログラム作成の時間にあてたのだが、それでもコードが思いつかなかった。やりたいことは頭で浮かんでいるのだがそれをコードで表すことができなくて苦労している。使えるメソッドがないかもう少し模索してみようと思う。','2021-09-26 10:25:53','2021-09-26 10:25:53'),
	(9188,16531,653,2,'PHP基礎/アルゴリズム 現在のステップ 4-4 課題４（お問い合わせフォーム）','jQueryを使ってオーバーレイの表示やログイン表示などを調べながら進めました。\nfadeout,inなどをif文とうまく掛け合わせて使っていきたいです。','2021-09-26 10:31:35','2021-09-26 10:31:35'),
	(9190,16327,697,3,'DB課題1','本日はデータベースのコードを書くことに取り掛かりました。\n接続に関してはJavaにもやり方はたくさんあると思いますが、一つしか習っていなかったのでPHPにこれほど色々な方法があるとは思わず、いろんな使い方が出来そうな気がしました。\nその他の使用法などはJavaと変わらないのでコマンドプロンプトなどでも入力していきたいと思います。\n\nだんだん自作のプランを煮詰められるようになってきているのでデータベースが終わる頃に自作のデータベースも同時に完了する勢いで頑張りたいと思います。\n引き続きよろしくお願いいたします。\n\n今週は頭を使い、消費が激しい1週間でしたので明日はしっかり休み来週に備えたいと思います。','2021-09-26 10:44:41','2021-09-26 10:44:41'),
	(9191,17212,562,3,'4-4お問い合わせフォーム','ヘッダー作成\n外部ファイル共通化','2021-09-26 10:44:50','2021-09-26 10:44:50'),
	(9202,17147,722,5,'2-2〜2-5,3-1取り組み','2-2でつまづいた以降は比較的スムーズに進められた。\n3-2でこれまでとは打って変わってウェイトの重い課題が出てきたので、可能な限り短期間でクリアしたい。','2021-09-26 19:18:27','2021-09-26 19:18:27'),
	(9205,16513,662,5,'課題7-1に取り組みました。','課題7-1に取り組みました。ER図の解釈に戸惑いましたが、なんとか作成できました！！画面仕様書が見づらくなっていたので、修正してすぐに提出したいと思います！！','2021-09-27 11:16:42','2021-09-27 11:16:42'),
