	(9227,16328,697,4,'DB参照、挿入、削除、更新','本日はDBアクセスから参照、削除、挿入、更新を行い、加えてHP作成をしていました。\nportでのエラーが度々起こり、その解決にも時間を費やしました。\n頭の中で流れはできているのでそこにどれだけコードを当てはめて不足なく描けるかが自身の課題です。\nまた、もっと関数やincludeするファイルをうまく活用し、コードが見やすくてかつ簡潔なものを目指したいと思います。\n\n\n明日は課題１の完成を目指し、課題二に入れるようにしたいと考えています。\n引き続きよろしくお願い致します。','2021-09-28 10:06:15','2021-09-28 10:06:15'),
	(9228,17224,653,3,'PHP基礎/アルゴリズム 4-4 課題４（お問い合わせフォーム）','PHPフォームのバリデーションを主に行いました。\nバリデーション自体は様々な方法があり、PHPファイル一つで行う手法なども見られましたが、今回は入力・確認・完了で工程が分かれておりましたのでそれに従った作成を行いました。\nひとまず、基礎で勉強した配列などがどう応用されているかの理解ができました。\nissetをはじめとする入力内容確認に特化したプログラムについても、追々深く学んでいきます。\n進捗が遅れている表示があると、ストレスを感じますが修行と思って耐えます。','2021-09-28 10:29:34','2021-09-28 10:29:34'),
	(9229,16898,668,4,'4-4 課題４（お問い合わせフォーム）','padding-topで画像をページの幅が変わるごと縦横いっぱいにするために使った。そこでcalcでプロパティの値を計算式で実行した。要素の幅や画像をpx値で指定する代わりに、数値を計算した結果を反映させた。','2021-09-28 10:31:32','2021-09-28 10:31:32'),
	(9231,16944,698,2,'データベース','【課題】\n・PCにDBサーバを構築\n・前の課題で作成したcafeのHPお問い合わせフォームに「挿入」「参照」の機能を足す\n\n【今回】\nターミナルで確認したところDB、テーブルともに作成はされているが、フォームに入力してもデータが格納されない。\nアドミン左上にlocalhost:8889となっているがMAMPのmysqlポートは3306\n同期のパソコンではポート番号はなくlocalhostの記載のみある模様。\nお問い合わせフォームに「挿入」「参照」と出るようなコードを書いているがデータが格納されていないので確認ができていない。\n\n【次回】\nmysqlとadminの接続、そして作成済みPHPファイルとの接続','2021-09-28 10:34:53','2021-09-28 10:34:53'),
