	(9265,17280,565,3,'5-2 課題２（SQL基礎)','sql練習問題_基礎に取り組んだ。\n文法の組み合わせの違いによって表示される時とされない時があるので、一つの方法だけで判断せずに違う組み合わあえで表示させることが大事。\nNULLが表示される文法とされない文法があったりしたのでこれからも注意していく。','2021-09-29 08:44:56','2021-09-29 08:44:56'),
