	(9278,16329,697,4,'DB、sqlをまとめる、DB練習問題','本日は昨日の続きと最後の方にDBの練習問題に取り掛かりました。\nsqlでの操作では、しっかりを関数を用いて全てまとめられていなかったので修正を何度かしました。sqlに関しては今行っている練習が大切だと思うので繰り返しできたらと思っています。\n\nphp自作に関して\n以前、西田原さんにもお伝えした、社内チャットツール（ギフト交換あり）のようなものを作成しようと考えています。個人チャットと複数チャットに加えて何かを送れるようなものを思考中です。いくつか調べたところ、「ライブラリを使った方がいい」といったものをいくつか見かけたのでその場合は検討したいと考えています。\n将来的に自社のチャットツールを作るお話がありましたので少しアイデアを絞り簡易的なものが作れたらいいなと思っています。\n引き続きよろしくお願いいたします。','2021-09-29 10:22:55','2021-09-29 10:22:55'),
	(9279,16945,698,1,'9/28日報参照','【今回】\nコードではなくサーバ側のエラーが多く進むことができなかった。\nmysqlのパスワードをターミナル上で変更し、再度ログインができるのを確認した後Myadminを開くとエラーが出てしまいログインページにすら遷移しない。\nMAMPのmysqlにログインしようとしても同じ現象が起きる。\n\n現段階ではMAMPとMyadminの使い方に慣れていないため、Javaのデータベースの方が簡単のように感じる。\n\n【次回】\n同期と13時からZOOMをつなげ第三者からの視点でエラーを見てもらう。\n現在進捗の表では5-Aになっているが、5-Aには提出課題がないため、実際に取り組んでいるのは5-1','2021-09-29 10:30:06','2021-09-29 10:30:06'),
