	(9287,16899,668,4,'4-4 課題４（お問い合わせフォーム）','基本的なHTML.CSSをつくり、動的な所をjqueryで作った。スクロールの位置を取得するscroll topでヘッダーを透明から黒帯に変更し、固定した。あと、データの受け渡しをしっかりやっていく。','2021-09-29 11:46:19','2021-09-29 11:46:19'),
