	(9293,17357,707,3,'サイト余白の調整','改めてサイト幅の意味を知った。\nまたサイト幅の調整で要素の幅も改めて計算して調整を行なった。\nweb制作において重要な部分の1つだと感じたのでweb制作を行う際には第一に意識していきたいと考えている。','2021-09-29 15:15:01','2021-09-29 15:15:01'),
	(9301,17209,620,3,'4-3 課題修正提出','4-3課題を提出しました。\npsr2を導入できていなかったのでその部分の修正を行いました。\nまた、岩崎講師より、始めのwarningの部分は仕方のないこととご指導頂き、3時間ほどわからず戸惑っていたので、\n解決して次に進んことができました。','2021-09-30 03:30:08','2021-09-30 03:30:08'),
