	(9309,17414,652,4,'課題4-4','ページの必要な要素をまず羅列し用意し、それからcssに取り組みある程度レイアウトを整えその後js→問い合わせフォームという流れで作業工程を予定し、本日はheaderのレイアウトを整えるまで完成。明日でcssのレイアウトを終わらせjsに入るのを目標に取り組んでいきたいと考えています。\nまた、工程を組んで予定するのはいいがいつまでにどこを完成するかを予定する所までを考えると自身への取り組みを予定までに終わらせる練習などにもなると思い次回からそこを念頭に置いて作業していこうと思います。','2021-09-30 08:59:47','2021-09-30 08:59:47'),
	(9310,17400,700,3,'No3-3コーディング応用サンプルサイト作成','課題提出を何度か実施。\n見本とのズレを指摘され修正中。','2021-09-30 09:12:30','2021-09-30 09:12:30'),
	(9314,17410,504,3,'画面遷移書作成','本日は画面遷移書の作成を取り組みました。\n遷移書を作成しないでいきなりコードを書き始めると途中でミスがあった場合修正が難しいことがあるので大切さがわかりました。\nまた自分で考えたアイディアを作成するのは楽しいです。','2021-09-30 09:56:17','2021-09-30 09:56:17'),
	(9316,16946,698,2,'データベース','【今回】\n昨日までのエラーを解消し、課題に取り組める状況になった。\nMyAdminを使用したPHP上でのデータベース接続はネット上に記事がたくさんあるのでコピーペーストをすれば課題を解くことは簡単だが、一つ一つのコード意図を学習することを以下の理由から優先することにした。\n・データベースの範囲はJavaを学習したときに一番最初に躓いた範囲\n・この次の大きい課題がPHP自作\n\n課題の取り組み速度は一旦滞るが、後で立ち止まるよりもしっかりと理解してから進む。\nデータベース学習をしつつ自作課題はどのようなものを作るかを考える。\n\n【次回】\nデータベース学習','2021-09-30 10:15:39','2021-09-30 10:15:39'),
	(9317,17215,574,3,'6-2','誤字脱字や余剰な記号を記述するなど、小さいミスが\n多く発生してしまいました。\nブラウザ上でエラーが出てから、気が付く状態なので、\n記述時のチェックをさらに気を付けて、このような小さいミスによる\nタイムロスを少しでも削減していきたいです。','2021-09-30 10:15:58','2021-09-30 10:15:58'),
	(9318,16330,697,4,'db練習、コマンド確認、手順作成','本日はデータベースの練習基礎、応用に取り掛かりました。\nJavaでも扱いましたが、あまり練習をこなしていないjoin の部分やJavaの時には扱わなかった関数を用いた応用などは新しい要素で新鮮味がありました。\nアドミンを用いてスクールでは行っていますが、ターミナルもしくはコマンドプロンプトでも同じ実行が行えるように同時に確認していました。\nPhpmyadminが現場でどれほど使われているのかわかりませんが、使用感というのをどちらの場合でも体感しておくために少しタスクを増やしました。\n\nまた、昨日まで行っていたホームページ上での操作をもう少し定着させるために手順書を作成しています。\n明日は練習問題を終わらせて次のステップに進みたいと考えています。\n引き続きよろしくお願いいたします。','2021-09-30 10:16:09','2021-09-30 10:16:09'),
	(9319,16992,610,2,'php バリデーション','前回のPHP相談会の際に教えて頂いた方法で、\nｊｓをオフ設定にしてPHPのバリデーションに取り組みました。\nｊｓとＰＨＰで行うバリデーションの違いは以前よりは理解できたと思います。\nフォームの空チェックや文字数制限をしたいのですが上手く表示が\nできない為、引き続き検索しながら頑張りたいと思います。','2021-09-30 10:18:37','2021-09-30 10:18:37'),
	(9320,17364,502,3,'PHP基礎4-2','lesson18取り組み中です。','2021-09-30 10:23:30','2021-09-30 10:23:30'),
	(9322,16900,668,4,'4-4 課題４（お問い合わせフォーム）','本日は入力したデータをセッションで保存するために＄_SESSIONを使い、ページ変わってもデータを維持されるようになった。セッションとクッキーの違いについて改めて復習して自分の知識にしていく必要があると感じた。','2021-09-30 10:38:54','2021-09-30 10:38:54'),
