	(9352,17450,715,4,'コーディング応用','コーディング応用に入り、基礎振り返り、自分で応用し、頭で考えでサンプル通りにページを作成するのは実践的な取り組みに近づいた気がします。まだまだ慣れてないコードやもっとこう書けばシンプルに適応される書き方などがあり、勉強に励みたいです。','2021-10-01 10:00:45','2021-10-01 10:00:45'),
	(9353,17326,698,2,'DB学習','【今回】\nDB含む関連ツールの学習\n\n【次回】\nDBに接続し5-1を終わらせる','2021-10-01 10:09:01','2021-10-01 10:09:01'),
	(9355,17378,697,3,'DBSQL練習終了','本日は昨日の続きでDBSQLの練習問題にとりかかりました。新たな関数なども用いて行いインプットの要素も増えました。\nSQLの練習ではここまでSQLを叩いたことがなかったので複雑なSQLになると手順を追いつつ行わなければ厳しかったです。\n一度混乱したときはYOUTUBEの基本解説のようなものを参考にしつつ、学習していました。\n\nこれまでPORTのエラーが何度か出ていて、どれも同じエラーなので瞬時に解決できるものではあるのですが、Windowsの場合だと毎回PORTを切る必要がないのでmacではなぜこのようなものが出てしまうのかもう少し調査する必要がありそうです。\n\n日曜日からはMVCに入るのでJavaの記憶を呼び起こしつつしっかり定着できるよう学習の仕方も工夫していきます。\n\n引き続きよろしくお願いいたします。','2021-10-01 10:24:05','2021-10-01 10:24:05'),
