	(9388,17577,716,1,'4-1 課題１（PHP基礎構文）','コーディング規約を自動で検知する設定\n拡張機能を設定するのにかなり手間取ってしまった!\n\n学びは、他にも色々なコーディング規約があることを知れた！','2021-10-03 10:05:11','2021-10-03 10:05:11'),
	(9389,17498,698,2,'DBにデータ追加','【今回】\nmysql, MyAdmin共に作成したPHPファイルと連携することができた。\n長く時間をとってしまったがエラーが多く出た分その対処法を幾つも知ることができたので今後似たようなエラーが出た際は焦らずに対処できるかと思う。\n\n【次回】\n以前作成したHPにボタンの追加やテーブルの追加を行えば現在行っている範囲は終わるので最初の1時間ほどで仕上げ、DB応用に入る。','2021-10-03 10:08:49','2021-10-03 10:08:49'),
	(9391,17580,621,3,'企画、要件定義','機能の洗い出し。画面遷移図の作成。企画書の作成。','2021-10-03 10:15:34','2021-10-03 10:15:34'),
	(9392,17618,745,2,'コーディング基礎','HTMLとCSSを用いて文字の表示、要素の背景色、要素の配置、画像の表示を実践しました。\nタグの使い方やCSSでのデザインが難しく、思い通りな結果にならない時に解決策を導き出すことに苦労しました。\nグーグルクロームの検証ツールを使うことで自分がコーディングした内容をブラウザ上で確認することができ、marginやpaddingを視覚的に見ることができたので思い通りの結果にすることが出来ました。','2021-10-03 10:16:40','2021-10-03 10:16:40'),
	(9393,17379,697,5,'MVCハンズオン、MVC作成','本日は初めにMVCのハンズオンに入りました。\n前回は終了時間の手前に確認テストが終わり、MVCのハンズオンに数分だけは入れたばかりでしたのでその続きを行いました。\n\nMVC作成においては少し整理をしつつ繰り返し行わないと定着しないので、流れをまずインプットする必要があると考えます。\n\n本日の途中で、山口めぐみさんのSQL接続のなかなか解決できないエラーと、並びにコードの中身をのを拝見し、解決にまで誘導できました。\nJavaのスクールの際に、経験者の方から教わっていた感覚を思い出し、今度は自身がその立場となって解決に導くことができたのでより自身のPHPの理解が深まりました。誰かに説明することがこれほど自身の理解につながると改めて実感しているところです。\n\n「二つのスクールを経験してのことですが、Evandで初学者の方に是非お勧めしたいことが以下のことです。\nEvandでPHPを学んでいる方々のスラッグお話は聞いているので、\nもし何かつまずいた時やなかなか解決できない場合など進んでいる方にアドバイスをいただくのはメリットがあると思います。（もしそのようなことをおこなっていたらすみません！文章などで説明は難しいですが、Zoomなど活用できれば両者の成長になるかと思います。\nもちろん、かけひさんにアドバイスをもらうのが一番効率的でかつ分かりやすいと思いますが！）」\n\nめぐみさんのSQLのエラーに関してはPHPスクール以前から不思議なエラーがたびたび吐かれていたので、今回の解決で今までのエラーが吐かないという保証はないですが、一旦は解決ができて一安心しました！\n\n月曜日からは流れをより掴み、課題②もしくは３にい移行できたら理想です。\n引き続きよろしくお願いいたします。','2021-10-03 10:17:50','2021-10-03 10:17:50'),
	(9394,17617,718,4,'No4-4 お問い合わせフォーム','本日はPHPを用いてお問い合わせフォームを作成した。\n時間はかなりかかってしまったが、jqueryの復習やhtml/cssの復習にも繋がった。','2021-10-03 10:19:00','2021-10-03 10:19:00'),
	(9397,17639,653,3,'PHP基礎4－4、4－5','PHPのお問い合わせフォームを修正しました。\nPHPのバージョンは基本的に７代で開発が行われているため、それに従って作り直しました。しかし、エラーが発生する原因は８から新たに加わった機能を用いたためではなく、ポートが自分のローカルのもので固定されていたためでした。\nプロトコル、ホスト名を取得し、ポートを問わず使えるサイトにしていくよう心がけます。','2021-10-03 10:24:12','2021-10-03 10:24:12'),
