	(9444,17380,697,3,'MVC作成、応用２','本日はMVC作成でうまくいかなかった部分の改善と課題②のほうに移りました。\n課題②でのMVC操作ではMAMP、もしくはＨＴＭＬでの更新がページ更新がうまくいかず、設定を見直したりしていました。新しい更新がなかなか反映されず、時間差で表示されたりしていたのでなかなか次に進むことができませんでした。\n\n明日は応用のステップのログイン処理まで進めればベストと思っています。\n引き続きよろしくお願いいたします。','2021-10-05 10:23:47','2021-10-05 10:23:47'),
