	(9479,17822,504,3,'画面仕様書作成','本日も画面仕様書の作成を取り組みました。\n仕様書を作成しているとどのようなAppを作成していかなくてはならないかが明確になってきてきました。\n仕様書は作成はできたの再度見直して記入漏れなどがないか確認して行こうともいます。','2021-10-06 09:38:59','2021-10-06 09:38:59'),
	(9482,17532,574,3,'6-3,4','悩んでいた部分は記述漏れが原因でした。\nまとめて一気に進めようとすると、エラーの原因が判別しにくいため、\nこまめに確認を行うようにしていきます。','2021-10-06 10:09:21','2021-10-06 10:09:21'),
	(9483,17500,698,1,'DBテーブル','【今回】\n以前作成したHPにデータベースのテーブルを出力し編集画面や削除を行うというものだが、ゲット変数の送受信がうまくいかず苦戦している。\n画面遷移は成功しているが<h1>タグなどで囲んでいるものも出力されない。\nデータベースの範囲に入って早1週間経つが、こんなにも苦戦するとは思っていなかった。\n\n一度わからなくなり調べると、得ることのできる新たな情報が多すぎて結局のところどのようにすればいいのかがわからなくなってしまう。\n\n講師の方へ質問しようとも考えたが、今の頭の中を言語化するのが難しくざっくりとした質問になってしまうのでできない。\n\n【次回】\n今週中にはDBを終わらせないといけない。\n今は詰まることが多すぎてモチベーションを保つのが課題。','2021-10-06 10:26:08','2021-10-06 10:26:08'),
	(9485,17503,502,3,'PHP基礎4-3','lesson2取り組み中です。','2021-10-06 10:28:30','2021-10-06 10:28:30'),
	(9486,17381,697,3,'MVC再構築、MVC課題２','本日はMVCの再構築をしました。理由としては昨日のエラーの原因が設定ファイルをいじりすぎた可能性が出てきて、初期のファイルを保存していなかったのでその解決ができるかなと思い再構築に取り掛かりました。\n\nMVC自体の流れは掴めているのですが、いざ新しくさまざまな方面から組み立てるとなると、コードの書き方がまだ完全にインプットできていないので自分の構想とリンクができない状況があります。まだ、MVCは取り組み始めてばかりですが、何度も繰り返し行っていきたいと思います。\n課題にも取り掛かることはできたのですが、少し忘れている復習の部分がありその点に関してもCafeCafeのコードを復習しつつ次に繋げていきます。\n少し、進捗が遅れています。申し訳ありません。\n詰まっているわけではないので引き続き頑張ります。\n\n引き続きよろしくお願いいたします！','2021-10-06 10:30:44','2021-10-06 10:30:44'),
	(9493,17741,668,4,'4-4 課題４（お問い合わせフォーム）','入力データを渡すときに、別のページに渡していたのを、同じページ内でやりとりするようにした。表示に関しては条件をつけて分岐することで入力画面、確認画面、完了画面を表示するようにした。あと少しで完成できそう。','2021-10-06 10:56:41','2021-10-06 10:56:41'),
