	(9515,17329,538,3,'php自作','MAMP環境でメール送信関数を使うための設定に苦労しました。','2021-10-07 04:20:32','2021-10-07 04:20:32'),
	(9517,17536,704,4,'PHP基礎','フォーム取り組み中です。','2021-10-07 06:11:47','2021-10-07 06:11:47'),
	(9523,17832,698,1,'DB','【今回】\nVScodeでデバッグを行っても削除ファイルにうまく推移しない。\nいろんな方法を調べて数多のコード記述方法を学んだがどれもしっくり来ず、想像している通りの動きにならない。\n躓く時間か長い分PHP自作では何を作ろうかと考えている時間も長く、エラーで躓いた時は自作課題で必要なファイルなどを考えている。\n【次回】\n自分がやったこととその際にどのようなエラーが出るかをまとめたので講師に助け舟お出してもらいたいと思う','2021-10-07 10:06:41','2021-10-07 10:06:41'),
	(9524,17504,502,3,'PHP基礎4-3','lesson3取り組み中です。','2021-10-07 10:20:03','2021-10-07 10:20:03'),
	(9527,17533,574,2,'6-4','バリデーションで以前と同じ記述をしていて、望んだ動作をせず、\n時間をかけてしまいました。\n記述を少し変更することで動かすことが出来るようになったので、\njavascriptやjqueryについてさらに学んでいこうと思いました。','2021-10-07 10:31:35','2021-10-07 10:31:35'),
	(9536,17742,668,4,'4-4 課題４（お問い合わせフォーム）','フォームのsubmitのネームによって条件分岐を与えて、ひとつのページ内で入力、確認、完了完了ページが出来上がった。XSS対策を付け加え、エラーをjQueryで出すようにできた。大変だったが出来上がってよかった。','2021-10-07 10:58:18','2021-10-07 10:58:18'),
	(9540,17866,722,4,'4-1','4-1のうちlesson13まで進めることができた。今日中に１４まで終わらせて提出を行いたかったが、少し時間が足りなかった。\n後半は日付に関する課題が多かったが、同じ結果を出せる関数がいくつかあり、調べるうちにどれを使用するのが最もスマートなのか考える必要があると感じた。（date関数と2038年問題など。）\n明日は4-2を可能な限り進めていきたい。','2021-10-07 11:04:01','2021-10-07 11:04:01'),
	(9542,17382,697,3,'MVC課題2.MAMP再インストール','報告が遅れて申し訳ありません。\n以下の作業内容を行なっていたら時間が過ぎてしまっていました。申し訳ないです。\n\n本日は午後の途中まで課題の方が順調に進んでいました。\nですが、急にphpmyadmin が開けなくなりその解決の調査に時間をかけていました。\nネットに転がるどんな解決策も通用せず、\nMAMPをアンインストールし、\n再インストールし直して再構築を始めました。\nadmin内のテーブルなども再構築し、以前行っていたカフェのデータを再インストールしたもので出力できるかどうかも試しました。\n\n今回のエラーの根本は\nSQLが起動していないことが原因でしたが、\n起動の対策をしてもターミナルでログインできるのにアドミンの方では全く機能せず、未だになぜこのようなことが起きたのか原因がわかっていません。\n\n課題の方は順調に進んだこともあり、その反動で再構築がなかなか辛いものがありました。\nこの再構築を糧にもう一度MVCを一から作るのでより理解を深めれればと思っています。\n\n引き続きよろしくお願いします。','2021-10-07 11:17:59','2021-10-07 11:17:59'),
	(9544,17694,648,3,'DB基礎','５−１取組中','2021-10-07 11:30:41','2021-10-07 11:30:41'),
