	(9555,17759,563,2,'php バリデーション作業','ダイレクトアクセス対策\nパターン検証\n体調不良で早めに切り上げてしまいましたすみません。','2021-10-08 07:55:43','2021-10-08 07:55:43'),
	(9559,17892,700,3,'ＰHP基礎について学習','まず、前回からphpcsがatomにてうまく動作しなかった点で、いろいろと調べたが修正できず、講師に質問。\natomが自身のOSと合っていないかもということで、VSCをインストールすることを推奨されたので、VSCで改めて再設定し実行するとうまく動作。\nそのため改めてNo4-1のエラーチェック及び修正を実行し、現在講師チェック待ち。','2021-10-08 09:02:35','2021-10-08 09:02:35'),
	(9563,17900,504,3,'テーブル定義書作成','本日はテーブル定義書作成を取り組みました。\n定義書を書いていると、機能の動きを考えるようになりより明確にわかるようになってきた気がします。\n自分でテーブルを作成する事は今回初なので難しいですが引き続き作業していきます。','2021-10-08 09:52:21','2021-10-08 09:52:21'),
	(9566,17820,715,2,'コーディング応用','もう少しで3-２が終わります。短い時間で進捗に変わりはありませんでしたが、集中して取り組めました。','2021-10-08 10:02:28','2021-10-08 10:02:28'),
	(9568,17909,740,3,'1-3の横並び','ブロックを横並びにするために、自分で調べたものを当てはめながら作業していた途中です','2021-10-08 10:04:09','2021-10-08 10:04:09'),
	(9569,17833,698,1,'データベース修正','【今回】 \n講師の方に見てもらいアドバイス頂いたところを訂正し、提出をしたが\n・レイアウトが崩れる(レスポンス対応までしなくていいが画面サイズを変更しても崩れないように)\n・お問い合わせフォームを新規で入力したあと編集が出来ない(私のPCではそのようなエラーが確認できず、方法が異なるかしれないので確認中)\n\nこれらの問題が最後に発生した。\n\n土曜はスクールがおやすみなのでその間に訂正を行い日曜日に新しい分野に入りたい。','2021-10-08 10:04:30','2021-10-08 10:04:30'),
	(9570,17383,697,3,'MVC再構築、MAMP再インストールの続き、課題２バリデーション','本日は昨日に再インストールしたMAMPを再設定し直し、MVC6-1の雛型を作り直しました。\n昨日までに作成していたコードで新たなエラーがいくつか発生しましたが、解決でき課題に少し入れました。\n\n課題２のバリデーションや編集機能、などMVCの組み立てに少し戸惑ってしまい、再学習の時間にもあてました。\nコードをまだすらすらと記述できていないことが自身の課題と感じています。コードをもっと多く書きアウトプットの質を上げないと自作でうまくいかない気がしているのでphpテストはすらすらと記述できるようにこのMVCの課題で身につけていきたいと考えています。\n\n引き続きよろしくお願いいたします。','2021-10-08 10:09:28','2021-10-08 10:09:28'),
	(9571,17505,502,3,'PHP基礎4-3','lesson4取り組み中です。','2021-10-08 10:09:36','2021-10-08 10:09:36'),
	(9572,17578,716,3,'4-2 課題２（ループ練習）','・for文\n・foreach\n・配列\n・多次元配列\n\n上記の基本的な記述と使い方を理解することができた。\n検索することがかなり多いので流れだけでも考えて記述できるようにする。\nあと、もう少しスピードを上げてやっていく。','2021-10-08 10:11:52','2021-10-08 10:11:52'),
	(9573,17845,574,3,'6-4 7-1','以前行った部分の修正として、行った方法の間違いや、\n改めて正しい記述方法を知ることが出来ました。\n設計の流れを学び、誰に向けた、何のため、どのようなものなのか、\n明確にしてHPの製作を行っていこうと思いました。','2021-10-08 10:20:42','2021-10-08 10:20:42'),
	(9574,17897,746,3,'コーディング基礎','余白を設定する際は、要素の内側と外側どちらに設定するかによって、marginとpaddingを使い分ける。\n中央寄せの指定もボックス要素やインライン要素によって方法が異なるので使い分けが難しかった。','2021-10-08 10:21:00','2021-10-08 10:21:00'),
	(9576,17626,610,2,'php jqueryバリデーション','引き続きバリデーションに取り組み中です。\n検索しバリデーションプラグインを使う方法、関数・エラーメッセージを設定する方法などが出ましたがイマイチどれも上手くいっていません。\n未入力や入力形式の間違いなどエラーの際にコメントが表示できるように\nすることと、その際は送信ボタンを押しても進めないようにするのが課題です。\n次回までに解決しなければ質問して先に進めるようにしたいです。','2021-10-08 10:37:42','2021-10-08 10:37:42'),
