	(9586,17743,668,4,'５−1 DB基礎','データベースについて動画学習を行い、実際にphpmyadminで動かしてCRUD処理を行なった。データの追加、更新、削除に関してはシンプルな印象だったが、データの取得に関しては集計関数を使い様々な検索方法があるのでたくさん触れて覚える必要があると感じた。','2021-10-08 12:23:52','2021-10-08 12:23:52'),
