	(9604,17538,704,4,'PHP基礎','フォーム作成中です。','2021-10-10 04:36:19','2021-10-10 04:36:19'),
	(9606,17916,700,3,'ＰHP基礎課題No4-1取組','課題No4-1取組。\nエラーのチェックが自分のＰＣ上では問題ないため提出したが(外部ウェブサイトでも問題ないことを事前チェック済み)、指摘を受けたため、どこに問題があるのかをご教授願った。\n一人でしっかりと不明点を学習することも大事だが、前回ＰＨＰＣＳが動作しないことについて、ＯＳとエディタの相性を指摘されたため、こういったシステム関連に関してはしっかりと聞いて時短していきたい。','2021-10-10 06:18:38','2021-10-10 06:18:38'),
	(9607,17761,563,3,'PHP test','基礎確認テスト','2021-10-10 08:01:45','2021-10-10 08:01:45'),
	(9611,17579,716,3,'4-3 課題３（アルゴリズム）','検索がかなり多くなってしまっている。\nもう少し基礎の理解とそれを応用できるようにする。\n\nソースコードがわからない場合でもメモに記載して\n自分の中の考えを言語化してみる','2021-10-10 10:03:26','2021-10-10 10:03:26'),
	(9612,17937,602,4,'7-2自作の製造','7-1の設計書の作成が完成いたしました。\nER図の中間テーブルについてお教え頂き中間テーブルの用途が理解できました。\n画面仕様書にて時間がかかりましたが、本日から製造にテーブルの用意と環境構築が終わりました。\nPKやUKがよく理解できておりませんので、引き続き調べながら製造に入ろうと思います。\n目標としては今月中に発表の予定でおります。','2021-10-10 10:04:57','2021-10-10 10:04:57'),
	(9613,17928,718,4,'4-5 課題５（XSS、バリデーション、メール送信）','本日はバリデーションを中心に行った。\nメールアドレスのバリデーションを行うのが一番難しく感じた。','2021-10-10 10:05:05','2021-10-10 10:05:05'),
	(9614,17834,698,3,'SQL基礎','【課題】\nSql基礎:47問\nSql応用：24問\nSQL文を使って与えられたテーブルから指定されたデータを取り出す\n\n【今回】\nやっと前回の課題が終わり、sqlの範囲に進むことができた。\nsql文は数学を解くような感覚なので楽しく取り組めている。\n今回は基礎の21問まで進んだ。\n\n【次回】\n基礎応用問題ともに終わらせて水曜からPHP応用に入れるようにする。','2021-10-10 10:06:14','2021-10-10 10:06:14'),
	(9615,17846,574,3,'7-1','画面遷移図を学び、制作を進めていました。\n自分だけではなく他の人に見せても分かりやすく\n煩雑にならないようにしていきます。','2021-10-10 10:10:59','2021-10-10 10:10:59'),
	(9616,17384,697,3,'MVC課題２','本日はMVCの課題２に取り組んでいました。\n先日のMySQL接続エラーが再び発生したためその解決も行いました。\n\n前回、ずべて再インストールし直し、設定ファイルなども何もいじらずMVCを組み立てられていたので今回発生したものはどこに原因があるのか早期に発見できたのでよかったです。\n\n課題２では指定されていた内容と少しニュアンスがずれたことを一部してしまい、その修正に時間がかかっています。\nまた、頭を整理できていなくコードで詰まる場面が多々ありました。\n再度MCVの構造を見直す時間を取りたいと思います。\n引き続きよろしくお願いいたします。','2021-10-10 10:12:11','2021-10-10 10:12:11'),
	(9617,17925,745,4,'Javascript/jQuery','クリックイベントや入力した文字をアラートで表示したり、アニメーションを実装しました。自分の書いたコードが目に見えて動いて確認することができ、やりがいがありました。しかし、目に見えるものだからこそしっかりコードで命令しないと思い通りに動かないので細かいミスがないか確認し、１つ１つの動きを実装していきました。','2021-10-10 10:13:51','2021-10-10 10:13:51'),
	(9618,17952,757,3,'HTML基礎','本日から開始の研修、最初のコーティング基礎を取り組みました。\n事前に他サイト等で調べてはいたのですが、やはりシステムがうまく動かなかったりと構築に時間がかかってしまいましたが、なんとかこの時間内で最初の取り組みを終了できてよかったです。\n来週はワクチンの接種日というのもあり受講が困難になると思いますが、なんとか他の時間を使ってこれから学んでいきたい。','2021-10-10 10:22:12','2021-10-10 10:22:12'),
	(9619,17918,621,4,'企画書の作成','画面遷移図、画面仕様書の作成。\n仕様書は提出物であることを心がけ作成する。','2021-10-10 10:23:21','2021-10-10 10:23:21'),
	(9621,17919,746,3,'javascript 基礎知識','javascriptの基礎を学んだ。\n数学的な要素が加わり少し難しく感じた。','2021-10-10 10:25:26','2021-10-10 10:25:26'),
	(9624,17351,662,4,'自作しています。','自作しています。Google MAP APIを利用した地図機能は付与できました。あとはAjaxによるいいね機能の付与です。先週初頭にPCが故障してしまい、自作が大幅に遅れてしまったので、タイムロスを取り返します。','2021-10-10 10:39:02','2021-10-10 10:39:02'),
