	(9627,17627,610,2,'PHPバリデーション','ｊｓのバリデーションがやっと完成し、ＰＨＰバリデーションに\n取り組みました。関数や書き方を調べ当てはめてみましたがどれも\n上手くいかず苦戦しています。\nページの遷移やデータの送り方など様々な書き方があり、\n改めてPHPは難しいと感じましたが、教えて頂いた改善方法をもとに\n動かせるよう頑張ります。','2021-10-10 10:46:15','2021-10-10 10:46:15'),
	(9632,17664,653,1,'DB基礎5-1','フォームに入力した内容をデータベースに追加するシステムをcafeサイトに付け加えました。\nエラーが発生したものの、それらを解消し無事に追加されたと思われましたが、追加がされませんでした。\nそれについて様々なアプローチを行いましたが、いまだ解決されません。\nさらに深く調べる必要がありそうです。','2021-10-10 10:56:38','2021-10-10 10:56:38'),
	(9635,17903,744,3,'javascript/jquery2-2~2-5','構文の種類が増えてきて理解に時間がかる。\nカリキュラム外のサイトを通して理解を深めていかなければいけない。','2021-10-10 11:09:49','2021-10-10 11:09:49'),
	(9641,17735,620,3,'4-4','4-4のhtml.css.お問い合わせホームをメインに行いました。お問い合わせホームの名前、メアド記入の文字数の指定方法がわからなかったので、調べて解決することができました。\n送信できておらず、申し訳ありません。','2021-10-10 14:17:59','2021-10-10 14:17:59'),
	(9644,17938,707,3,'php for文のループについて','バブルソートのアルゴリズムについて2つのfor文の理解に時間がかかった。またphpとは異なるが、エイリアスからはバイナリデータしか圧縮にて作成出来ないと分かり、相手に送る際にはデータの状態も見ておくることを心がける。','2021-10-10 15:40:12','2021-10-10 15:40:12'),
