	(9656,17967,700,3,'PHP 4-2取組中','For文のネスト文法について学習中。\n頭が少し混乱してきたため、整理もかねてもう一度しっかりと学習に取組。','2021-10-12 09:18:05','2021-10-12 09:18:05'),
	(9657,17839,722,3,'4-1','4-1の課題提出まで行うことができたが、２箇所の修正をいただいた。\nうち一ヶ所に関しては保存のし忘れによるエラーがそのままになっていたため、確認不足の点で気をつけねばならないと感じた。','2021-10-12 09:28:47','2021-10-12 09:28:47'),
	(9659,17998,504,3,'テーブル定義書','本日はテーブル定義書を作成していました。\n実際にテスト作成し、どのDBが必要かなど再度検討を行なっておりました。\n見直していたら機能の修正部分が見つかったので再度画面遷移書、画面仕様書を手直しているところです。\n最終確認時も見直して修正箇所があった際には修正して行こうと思います。','2021-10-12 09:54:07','2021-10-12 09:54:07'),
	(9660,18001,715,3,'3-2','ページ縮小でレイアウトが崩れてしまうので、そこを主に取り組みました。\n今日はまとまった時間で作業を行えたのである程度進みました。コーディング応用に関しては、このぐらい時間をかけないと初心者には調べることが多くなってっしまうので、普段から短い時間ではなく、極力固まった時間を作って取り組みたいと思いました。','2021-10-12 09:59:09','2021-10-12 09:59:09'),
	(9661,18001,715,3,'3-2','ページ縮小でレイアウトが崩れてしまうので、そこを主に取り組みました。\n今日はまとまった時間で作業を行えたのである程度進みました。コーディング応用に関しては、このぐらい時間をかけないと初心者には調べることが多くなってっしまうので、普段から短い時間ではなく、極力固まった時間を作って取り組みたいと思いました。','2021-10-12 09:59:17','2021-10-12 09:59:17'),
	(9664,17507,502,3,'PHP基礎4-3','lesson5取り組み中です。','2021-10-12 10:04:11','2021-10-12 10:04:11'),
	(9666,17977,756,4,'コーディング基礎、Javascript基礎','コーディング基礎を終了し、Javascript基礎知識を学んだ。自分で手を動かしながら復習をし、知識の習得に努めたいと思います。','2021-10-12 10:09:23','2021-10-12 10:09:23'),
	(9669,17744,668,4,'5-A ハンズオン（DB基礎学習）','データベースとPHPをつなげることができた。今まではフロント側がメインだったが、データの管理も加わることでより実践的になるので、しっかり身につけていきたい。','2021-10-12 10:17:24','2021-10-12 10:17:24'),
	(9670,17385,697,3,'MVC課題6-2','本日は先週からのMVC課題6-2の途中から始め、この課題では半ばあたりでsql エラーが相次いでしまっていたため、復習も兼ねて学習の時間を設けつつ課題に取り組みました。\n課題の問題文には書かれていない余計なことをいくつかしてしまっていて、もう少しその部分を無くせば早く終わっていたと思います。\n提出までできませんでしたが、完了することができました。19時以降はログイン機能の予習と自作の構成について考える時間とします。\n\n自作に関してはAjaxを用いることが調べていると大切だと拝見し、技術スキルの習得とともに学べたらと思っています。\n引き続きよろしくお願いいたします。','2021-10-12 10:18:40','2021-10-12 10:18:40'),
	(9671,17835,698,4,'DB基礎終了、PHP応用へ','【今回】\nDB基礎を作業目標通り2日間で終了し、PHP応用に進むことができた。\nざっとPHP応用では\n・オブジェクト指向事前調査\n・MVC役割ごとにファイル作成(イメージを掴む)\n・削除や表示の機能追加、バリデーションやポップアップ、入力フォーム作成\n・ログインテーブル作成、権限付与\n・応用確認として前回作成したcafeHPをMVCで作成し直し\n\nこれらのことを行うのだが、Java を学んだ際に苦手だったリクエストパラメータなども含まれているのでこのPHP応用課題を進めるにあたって苦手範囲も理解できるようにし、PHP/Java共に理解を進めていきたい。\n\n【次回】\nオブジェクト指向事前調査を明日の15時までに済ませる。\nMVC役割ごとにファイル作成をする課題(6-1)が目標日数3日とされているので今週中に終わらせることが目標。','2021-10-12 10:19:38','2021-10-12 10:19:38'),
	(9673,17931,574,3,'7-1','シンプルで分かりやすいような遷移図を目指して、制作中です。','2021-10-12 10:30:06','2021-10-12 10:30:06'),
	(9676,18003,723,3,'コーディング基礎、Javaspript/jQery','コーディング基礎は終わり、提出したがPCがフリーズしたため、Javaspript/jQeryの学習はあまりできなかった。また、jQeryはプロゲートで学習していない関係もあり、一から調べる作業をしたが、Javaspriptをより簡単にしたようなもので楽しく学習できたと思う。今回が勉強会初めてということもあり、勝手がわからないところもあったが、今後も勉強会に参加して学習していこうと思う。','2021-10-12 10:35:02','2021-10-12 10:35:02'),
	(9697,18006,648,3,'DB基礎','５−１取組中','2021-10-13 03:46:39','2021-10-13 03:46:39'),
