	(9704,17789,565,3,'5-2 課題２（SQL基礎・応用問題）','SQL練習問題に取り組んだ。\n取得の仕方の組み合わせを理解していくのが重要だと感じた。\nまだ理解できていないものもあるので覚えて問題を解いていく。','2021-10-13 06:51:13','2021-10-13 06:51:13'),
