	(9716,17386,697,4,'6-2終了、6-3ログイン機能','本日は昨日日報にも書いた通り、6-2の課題を提出し、6-3のログイン機能の実装に進みました。\n6-2ではサニタイジングやxss、入力値などの値保持も記述したため、cafe cafeの再取り組みではスムーズに書けそうな感じがしています。\n\nログイン実装に関しては\nいろんなやり方が存在するので自作でもどのようにログインを作るか思考中です。\n自作に関してですが、PHPの場合、ショッピングサイトのようなデータベースからの操作が多い印象を受けているので、その部分をもう少し加えられたチャットツールのようなものが作れれば良い学習になるのではないかと感じています。\n\n引き続きよろしくお願いいたします！','2021-10-13 10:18:02','2021-10-13 10:18:02'),
