	(9753,17387,697,3,'6-３ログイン機能','本日はログイン機能とその課題に準じた学習をしていました。\nログイン機能の実装はスムーズに行えたのですが、password_verifyがfalseに飛んでしまい、その原因を調べていました。\n本来であれば、新規登録のようなものを作り、その段階でhashしDBに登録ですが、今回は登録は手動とのことでしたのでphpMyAdmin内にあるインサートからhashをかけログインのコードを記述しました。ここが原因ではないかと考えています。\nvar_dumpで中身を見てもしっかりと受け取ることができているのであと一歩といった感覚です。明日は引き続きこの調査の解決をしていきます。\n\n引き続きよろしくお願いいたします。','2021-10-14 10:07:40','2021-10-14 10:07:40'),
