	(9791,18130,715,3,'3-2','今日は課題提出し、修正の途中になっております。修正をするにあたり、どこまでコードを書き直すのか（または、書き直せばいいのか）判断するのが難しく、コードの書き方と理解が曖昧だったことに気づきました。（修正しずらいコードになっている）見本通りにひとまずやってみた結果なので、今回の失敗によって「親要素、子要素で使用すべきコードをきちんと理解し、何の要素を自分が割り当てて組み立てているのかイメージしながら作らないといけない」ということを学べました。divでまとめるのも、「きちんと親要素の中で子要素がどういう動きをするのかをイメージし、cssで働きかけるコードの要素は的確なのか、無駄なコードを書いていないか」自分に足りていない考えが多く学べたので、一つずつ実践していきたいです。','2021-10-15 09:59:52','2021-10-15 09:59:52'),
