	(9796,17388,697,4,'ログイン機能、6-4準備','本日は昨日の続きから行いました。\n昨日、起きた問題ですが、私の認識違いでした。\n課題の文章を噛み砕いて深読みしすぎていて作成するもの自体がずれたものでした。\nですが、修正し、提出からOKもいただきましたので一安心いたしました。\n\nもう間も無く自作の方に入りますが、\nいろいろ調査しているとWebsocket 、Ratchet ライブラリを用いたほうがチャットだけ見ると実装が安易なようで、非同期通信におけるリアルタイムチャットは上記を使用するのが主流と拝見しました。なのでそれらを用いることが良いのであればチャットの機能を作成したいと考えています。\n\n引き続きよろしくお願いいたします。','2021-10-15 10:14:47','2021-10-15 10:14:47'),
