	(9844,18181,602,1,'PHP自作7−２製造（AjaxとAPI）','PHP自作の製造を進めております。\nいいね機能にてハートの発火は出来ておりますが、\nDBとの非同期通信が上手くいかず、\nAPIを使ったGoogleのログインも画面は用意できましたが、\nユーザーをどう登録させるのか分からずにいます。\n引き続きエラーの意味を一つずつ調べ進めて参ります。','2021-10-17 10:27:42','2021-10-17 10:27:42'),
