	(9846,17389,697,4,'6-4 cafeの再構築','本日は以前作成した cafe cafeの再構築を行いました。\n\nほとんど完成し、あとは微調整を加えるだけなので火曜日の初めに提出できると思います。\n\n自作に関して少し知見を増やすべくyoutubeで様々なライブラリなどの動画を見ています。\n海外の方が出しているものが多く、すごくわかりやすく参考にできそうなものが沢山ありました。\nもう少し面白味のようなものが欲しいと思っているのでアイデアをどんどん出して良いものを作り上げれればと思っています。\n引き続きよろしくお願いします。','2021-10-17 10:31:59','2021-10-17 10:31:59'),
