	(9888,17390,697,5,'6-4再構築完了、自作設計','本日は初めにMVCでホームページを作り直す課題の提出から始まり、修正もなく自作に入ることができました。\n\n自作の設計ではもう一つほどオリジナリティがある（Evand,suprieveらしさ）を加えたくその点で思い悩んでいました。あまり機能を詰め込みすぎるのも時間配分なども考えて適度の量に設計していきたいと考えています。\n自作は以前から行ってみないと考えていたものでしたので、これから手順を追いつつ制作していくことがすごく楽しみです。\n\n今の設計の段階はJavaの時に一番重要と言っても過言でない段階と認識しているのでしっかり組み立てていきたいと考えています。\n引き続きよろしくお願いいたします。','2021-10-19 10:05:47','2021-10-19 10:05:47'),
