	(9996,17667,653,2,'db基礎_5-1','続けて、データの削除機能の実装を試みました。\nやはり原因はjsにあり、要素を<a>とすることでinputよりも工程を踏まなく、簡潔に書けたと思います。\nしかし、phpはローカルではhtdocsに入る前提という先入観から、どの環境でも動くことへの想定がなされていませんでした。\nhtdocsに入れなくても作動するよう理解を深めていきます。','2021-10-21 10:32:11','2021-10-21 10:32:11'),
	(10001,17750,668,4,'5-A ハンズオン（DB基礎学習）','DBへの追加、編集、削除機能を実装することができた。しっかりと反映もされた。次の課題のCRUD処理のセレクトではいろんなパターンがあるので、しっかり身につけていきたい。','2021-10-21 10:54:02','2021-10-21 10:54:02'),
