	(10033,18104,698,4,'PHP自作内容案を出す','【今回】\n始まってすぐにPHP応用の課題を出し、やっと自作課題に入ることができた。\n\n作品案としては、同期が自社で使用出来るようなものを作成すると聞き、その考えには同意見であったのでスクールが終わっていつか実際に使用できたら面白いと考え、被らない機能で考えている。\n\n【次回】\n何となく何を作るかは浮かんでいるので画面遷移図・画面仕様書・ER図・テーブル定義書に時間をかける。','2021-10-22 10:12:20','2021-10-22 10:12:20'),
	(10036,17393,697,3,'自作設計','本日は大体の方針は決まったのですが、ここ数日チャット機能におけるwebsocket,Ratchet の参考資料や動画を拝見してなかなか理解が追いつかず、Ajax でも実装も視野に入れて設計を考えました。\nRatchet の方が良いという記事を見つけたのですが、見ていた参考の方の解説がなかなか理解できず混乱してしまいました。\n\nBootstrapなどの練習も早めに行い、開発にスムーズに進めるよう頑張ります。\n引き続きよろしくお願いいたします。','2021-10-22 10:22:41','2021-10-22 10:22:41'),
