	(10042,17751,668,4,'5-2 課題２（SQL基礎・応用問題）','CRUD処理では特にセレクトにいろんな条件をつけて、自分の欲しいデータを読み込んでいくので、この課題2では色んな条件をもとに検索などするので非常に大事だと感じた。いざというときにデータベースを扱えるようにしていく。','2021-10-22 10:53:12','2021-10-22 10:53:12'),
	(10049,17668,653,1,'DB基礎_5-1','開発環境を整えることができました。\n提出前の確認で漏れがあるため、確認を抜かりなく行うよう気を付けます。','2021-10-22 13:40:33','2021-10-22 13:40:33'),
