	(10053,18213,565,3,'5-2 課題２（SQL基礎・応用問題）','結合を使わずに副問合せで表示させること、問39のようなpairingsとcountriesのテーブルをうまく組み合わせて表示させる部分に苦戦している。\n結合と副問合せ、それぞれの理解がまだ完璧ではないところもあるので調べていく。','2021-10-22 20:29:25','2021-10-22 20:29:25'),
