	(10076,18191,761,4,'PHP_form完成PHP基礎テスト DBハンズオン学習','・PHP基礎4_4~4_5を実施。（昨日に予習を実施してバリデーション、CSRF、XSSについて学習）スムーズにできた。\n・PHP基礎テストは制限時間を全部使って解いた（9点）\n→思考力がまだまだなので、普段の生活から全ての事象になぜ？そのようになっているのか？ということを常に考えることを意識する。\n・DBは全体の土台になるものなので、しっかり基礎を身につける。今週中に完了させてPHP応用に移る。','2021-10-24 09:25:37','2021-10-24 09:25:37'),
	(10078,18415,700,3,'php基礎4-3取組','ポーカーの約チェックプログラムについて取組。\n前回から引き続き実施しており、本日ジョーカー含めたalgorithm4-5の動作も確認完了。\n細かなミスがないかもう一度確認してから次回提出に移りたい。','2021-10-24 09:57:36','2021-10-24 09:57:36'),
	(10079,18422,602,4,'単体テスト、結合テスト、受け入れテスト、発表会の資料作成','単体テストと結合テストについては別紙を用意したおかげで、\n滞りなくテスト行う事が出来ました。\nSQLインジェクションについては後ほどまたお伺いしたいことがございます。\nAPIとAjaxが本当に大変でしたが、なんとか形になって良かったです。\nまだ発表会は終わっておりませんので、シュミレーションをしておこうと思います。','2021-10-24 10:00:23','2021-10-24 10:00:23'),
	(10081,18423,504,3,'パスワード変更　機能実装','本日はパスワード変更の機能実装に取り組みました。\nダイレクトアクセス禁止の機能で再度アップデートもしてブラウザを閉じなくてもアクセス出来ないようにしました。\n目標の完了日よりできる限り早く完成できるように作業を進めていきます。','2021-10-24 10:01:57','2021-10-24 10:01:57'),
	(10083,18412,716,1,'4-3 課題３（アルゴリズム）','【理解できていないところ】\n・phpの関数\n・ポーカーの役判定\n理解できるまでやり込む。','2021-10-24 10:04:35','2021-10-24 10:04:35'),
	(10084,17394,697,4,'自作設計、スケジュール設計','本日は昨日いただいた設計のご指摘を見直して再度設計を組み立て直しました。\n大きい変更などはありませんが、\nご指摘をいただいた点に関して、見方をいろんな方向からみた上で設計をしないといけないなと改めて感じています。\nユーザーの退会後など納得のご指摘があり、すぐ修正に入りました。\n\n確認のOKはいただいたのですが、自身がもう少し画面仕様書の方で手を加えたい部分があり19時以降はそちらに時間を割きました。少しスケジュールも組み立てて火曜日からは開発に入りたいと考えています。\n\n引き続きよろしくお願いいたします。','2021-10-24 10:05:46','2021-10-24 10:05:46'),
	(10085,18105,698,4,'画面仕様書','【課題】\n画面遷移図、画面仕様書、ER図、テーブル定義書を作成\n\n【今回】\n作成したいものを箇条書きで書き出し、画面仕様書を作成しながらイメージを膨らませている。\nこだわりすぎて作品が完成しないと意味がないので、最低限の骨組みを作成した後に機能を足せたらと思う。\n\n【次回】\n題材、ユーザ、機能、非機能を定義したものを作成(紙媒体からデータ媒体に移すだけ)\n画面仕様書を完成させる','2021-10-24 10:07:51','2021-10-24 10:07:51'),
	(10086,18414,718,4,'SQL','今日はSELECT文を用いて抽出する方法を学んだ。\n同じものを抽出する場合でもやり方が何通りかあったりするものもあり、柔軟な発想力が必要だと改めて感じた。','2021-10-24 10:09:49','2021-10-24 10:09:49'),
	(10087,17632,610,2,'PHPバリデーション','引き続きPHPのバリデーションに取り組んでいます。\nリダイレクト処理をするのにセッション関数やバリデーションに\nついて検索していますがどれも自分的によく理解できなかったので\nYouTubeで解決できないか探してみました。\n良さそうな動画を見つけたので見ながら手を動かし作業をしているところです。','2021-10-24 10:28:10','2021-10-24 10:28:10'),
	(10088,17353,662,5,'課題７が発表を除いて修了しました。','結合テスト、受け入れテスト、発表プレゼン資料作成が終わりました。Gitでpush するときに個人認証がパスワードではなくtokenに変更されていたことに気づかずに、時間がかかってしまいました。','2021-10-24 10:32:50','2021-10-24 10:32:50'),
	(10089,18408,745,3,'サンプルサイトの作成','前回から引き続きサンプルサイトの作成を行っています。見た目は少し歪でますが、だんだんと良くなってきました。あと少し微調整をすれば完成になりそうです。調べ事が多く大変ですが少しずつ自分の力になっているような気がします。次回には完成させたいです。','2021-10-24 10:33:48','2021-10-24 10:33:48'),
