	(10091,17669,653,2,'DB基礎 5-1,2','SQL内の操作方法を勉強しました。\nphpmyadminを通すことで、見やすい状態になっていますが、\n他のデータベースを使用していくために汎用性を上げていきたいです。','2021-10-24 10:38:35','2021-10-24 10:38:35'),
	(10101,18377,773,4,'コーティング基礎','HTML CSS基礎や横並びのレイアウトの仕方などJavaScriptの基礎を学び直すことができました。\n特にflex boxの使い方やjQueryでのif文や値の取得で躓いたのでしっかりと復習をしておきたい。','2021-10-24 11:03:38','2021-10-24 11:03:38'),
