	(10127,18459,504,3,'Googleログイン機能実装','本日はGoogleログイン機能実装に取り組みました。\ncomposerを使用してAPI連携しログインの機能を実装しました。\nfecebookやtwitterのログイン機能は今回実装できそうにありませんが、いつか挑戦してみたいと思います。\nもう少しjasonのことも今後詳しく掘り下げていきたいと思います。\nログイン画面は機能実装まで完了したのでメインページのモック作成にも取り組みました。','2021-10-26 09:45:22','2021-10-26 09:45:22'),
