	(10129,18472,715,3,'3-3','３－３では少しでも修正しやすいコード（簡潔なコード）を書くことを意識していますが、やはりまだ無駄が多いです。今回学んだ部分はメディアクエリの設定で、一か所修正した部分を別のサイズでも修正するのを忘れており、サイズ事に修正するときに、頭の変換がうまくいかず時間が掛かかりました。気が付けば当たり前のことなので、もっと視野を広く持ち、コードの組み立てもスムーズに書けるようにしたいです。','2021-10-26 10:00:05','2021-10-26 10:00:05'),
	(10133,17395,697,4,'自作モック作成','本日より自作の進捗とともに報告をさせていただきます。\n\n初めに画面仕様書の微調整をし、\nメールを忘れた方の実装に入るときにプラスしてリセット用のテーブルを作った方がいいのかと考えていました。\n\nその後はモック（画面）の作成に入りました。\nスケジュールでは3日間を予定しています。ログイン系とアプリに入った後のユーザ画面、チャット画面のだいたいの枠が出来あがりました。\n明日は管理者画面を完了にできればいいと考えています。\n\n引き続きよろしくお願いいたします。','2021-10-26 10:04:09','2021-10-26 10:04:09'),
	(10134,18106,698,4,'画面仕様書','【今回】 \nツールを作成するのにどれだけのファイルが必要なのか、またどのような機能を付けたら良いのかを記述するには実際にファイルを作成するのにどのようなソースコードを書く必要があるのかというのも考えなければならないことも多く、時間はかかっている。\n\n【次回】\n水曜、木曜で仕様書やER図などを終わらせたい','2021-10-26 10:06:15','2021-10-26 10:06:15'),
	(10138,18435,761,4,'DB基礎','・課題を完了してテストを受けるところです。\n・明日からPHP応用に入ります。\n・今月中にPHP応用を完了させて11月に自作に移りたいと\n考えてます。\n・DBは開発において根幹になるところなので復習をしっかりして\n明日に臨みます。','2021-10-26 10:19:29','2021-10-26 10:19:29'),
	(10139,18482,772,2,'コーディング基礎、javaScriptの基礎','本日はコーディング基礎をメインに受講させて頂きました。\nまだeducureやSlackに慣れていないところがあり思ったように進めませんでした。また、課題につきましては、深く悩みすぎ時間を多く消費してしまった部分がありました。次回からは視野を広げて色々な情報の中から自分の欲しい情報を適切にピックアップできるよう意識して課題に取り組もうと思います。','2021-10-26 10:22:05','2021-10-26 10:22:05'),
	(10141,18484,704,4,'PHP基礎フォーム','出席ボタンを押すのを忘れてしまいました。申し訳ありません。\nデータ上19:22ごろ出席となっていると思いますが、13:00から参加しております。\n\n今日はcontact.php, confirm.php, complete.phpのhtmlとcssの部分を構築していました。\n明日はphpの方を進めたいです。','2021-10-26 10:25:30','2021-10-26 10:25:30'),
	(10144,18442,769,3,'コーディング基礎、Javascript/jQuery','コーディング基礎は流れ良く課題をこなすことができたが、Javascript/jQueryの方では、分からない部分も多々あり、つまづきました。理解できていない部分がまだあるので、復習していかないといけないと思いました。次はコーディング応用なのでCSSの使い方などを復習して突破していきたいと思います。','2021-10-26 10:33:39','2021-10-26 10:33:39'),
	(10145,18442,769,3,'コーディング基礎、Javascript/jQuery','コーディング基礎は流れ良く課題をこなすことができたが、Javascript/jQueryの方では、分からない部分も多々あり、つまづきました。理解できていない部分がまだあるので、復習していかないといけないと思いました。次はコーディング応用なのでCSSの使い方などを復習して突破していきたいと思います。','2021-10-26 10:33:47','2021-10-26 10:33:47'),
