	(10182,17396,697,3,'自作モック作成','本日は昨日に引き続きモックの作成を進めました。\n大体のレイアウトはでき始めていて、あとはレスポンシブに対応させたいところをBootのレスポンシブをうまく活用して行っていきたいと考えています。\n多少、ずれが生じて今っているとこともありますが、メインはスマホで見る形にするのでまずスマホの画面をしっかりと作り上げていきます。\n進捗率は予定通りに進んでいてあと1日〜1日半でモックは完成すると思います。\n引き続きよろしくお願いいたします。','2021-10-27 10:33:00','2021-10-27 10:33:00'),
