	(10231,17754,668,4,'6-A ハンズオン（オブジェクト指向キーワード調査）','.htaccessを使うと旧ページから新ページへのURLだけ変更してリダイレクトすることや、ログイン機能や、特定IPアドレスのみサイトに入れるようにする機能を追加できるようになり、より実践に近いことを学んだ。','2021-10-28 10:49:51','2021-10-28 10:49:51'),
	(10235,17397,697,4,'自作モック作成','本日は昨日と同様にモックの作成に取り掛かりました。\n進捗率はスケジュール通りで細かい微調整を行う必要がありますレスポンシブ含む）\n少し色合いが単調すぎるかなと感じていますが、機能面をしっかり組み立てたいのでｃｓｓは凝らずにやりたいと思います。あと半日で大体のレイアウトはできるので機能面の実装に移れると思います。\nチャットのレイアウトはなかなか組み立てるのに時間がかかり、参照しながら進めました。\nuserテーブルの中にuser_areaを付け加えました。初期の段階では組み込んでいたのですが、設計の提出で漏れていました。\n自社のツールなのでそのuser_areaを用いて管理者がユーザーの検索がしやすいように作れると思います。\n\nチャット機能に関してはajax,Ratchetのどちらで行うか迷っていますが、どちらでも実装が行えるようすスキル習得のため両者学習を頑張りたいと考えています。引き続きよろしくお願いいたします。','2021-10-28 10:56:01','2021-10-28 10:56:01'),
