	(10250,18557,700,3,'php課題４－４取組','PHPを用いて実際にウェブサイトの構築と応募フォーマットについて学習と取り組み実施。\n外部ファイルとして共通化したり等が、仕組みとして理解はできてきているものの、実際に動作として組み込むことができず苦戦。','2021-10-29 09:06:03','2021-10-29 09:06:03'),
	(10253,18563,715,3,'3-3','本日でコーディング応用を終了する予定でしたが、まさかのレスポンシブが出来ておらず、現在修正中です。どうやら検証ツールの見方も理解できていなかったようなので、とても勉強になりました。１１月からの目標を出遅れないように、早く修正をできるように、取り組みたいと思います。','2021-10-29 10:05:58','2021-10-29 10:05:58'),
	(10254,17755,668,4,'6-A ハンズオン（オブジェクト指向キーワード調査）','コンストラクタが多数出るようになったので復習した。コンストラクタを設定しておくとインスタンスを形成した後にわざわざアロー演算子を使って値を代入しなくても良くなる。インスタンスを形成したと同時に引数に値を入れることでそのまま代入できる。','2021-10-29 10:13:46','2021-10-29 10:13:46'),
	(10255,17398,697,4,'モック作成、DB作成','本日はモック作成とDB作成、少しphpMailerを触っていました。\nモックはほとんど完成し、PCでの画面表示が少し小さいかなと感じているのでその微調整は機能実装で調整していきます。\n本日の進捗率は８０％でもう少し実装に入れればよかったと感じています。\nスケジュールが完成した段階で完成予定日をお伝えすることになっていたのですが、漏れていました。申し訳ございません。\n完成予定日は19日とりなました。Ratchetでどのくらいの時間を要すのかわからす、チャット機能面で多く時間配分を取りました。チャット面で理解が速くなれば、完成予定日を前倒しする予定でございます。\n\n引き続きよろしくお願いいたします。','2021-10-29 10:15:26','2021-10-29 10:15:26'),
	(10256,18445,769,4,'PHP基礎/アルゴリズム','phpを使って入力情報を出力したり、ランダムに値を出したり、日付を表示したりと色々な事を学ぶことができました。一部難しいところもあり、検索力が足らないなと感じました。必要な情報をすぐ使えるように検索力も付けていきたいです。ここの基礎の部分が今後に繋がるので、しっかりと理解していきたいと思いました。','2021-10-29 10:25:30','2021-10-29 10:25:30'),
	(10257,18556,774,3,'JavaScript基礎','2-5まで終了しました。\n19時を過ぎてしまっていた為、次回提出しようと思います。','2021-10-29 10:25:38','2021-10-29 10:25:38'),
	(10259,18109,698,3,'設計書','非同期処理・API連携・出力／読み込みのどれかを取り入れる事が条件とされているので非同期処理を組み込もうと考えている。\n課題pdfに書かれていた事項を見逃しており、CRUDの一覧表示とユーザが二種類以上あること、パスワードリセットが出来ることという部分を次回付け足す。\n\nユーザの中に管理者を足し、管理者は社員の一覧表示ができるように、そしてログイン画面から「パスワードを忘れた場合」を足して遷移するように設定し直す。','2021-10-29 10:28:50','2021-10-29 10:28:50'),
	(10260,18438,761,3,'PHP応用','6-2の機能追加を取り組み。\n提出したがしっかり反映できたいなかったので\n修正後31日に再度、提出します。\n・ここまでの復習を明日までに行う。','2021-10-29 10:29:12','2021-10-29 10:29:12'),
	(10261,18498,772,3,'2020_javascript,jquery','本日はjavascript,jqueryを勉強しました。\n少しづつ専門用語やコードも難しくなってきましたので、しっかりと復習をしていきたいと思います。','2021-10-29 10:30:41','2021-10-29 10:30:41'),
