	(10293,18467,757,3,'javascript/jQuery','本日は課題である2「javascript,jquery-」に取り組みました。\nコードの記載や関数など、色々とインターネットでの情報をもとに見よう見まねで取り組んだ次第ですが、やはりまだまだ理解しきれないところが多く、これから本格的にコードの入力や作成に入っていく前に、ここはまたしっかりと習得したいと思った。まだこの2の課題も今回で終了し切ることができなかったため、必ず次回までに終わらせたい。','2021-10-31 10:07:59','2021-10-31 10:07:59'),
	(10294,18467,757,3,'javascript/jQuery','本日は課題である2「javascript,jquery-」に取り組みました。\nコードの記載や関数など、色々とインターネットでの情報をもとに見よう見まねで取り組んだ次第ですが、やはりまだまだ理解しきれないところが多く、これから本格的にコードの入力や作成に入っていく前に、ここはまたしっかりと習得したいと思った。まだこの2の課題も今回で終了し切ることができなかったため、必ず次回までに終わらせたい。','2021-10-31 10:08:10','2021-10-31 10:08:10'),
	(10296,18603,745,4,'サンプルサイトの作成','サンプルサイトの作成の続きを行いました。本日でサンプルサイトの1つを完成させました。見た目の試行錯誤に時間がかかりましたが講師に確認してもらい、修正無しでクリアできたので達成感があります。次の2つ目のサンプルサイトも引き続き頑張りたいです。','2021-10-31 10:15:23','2021-10-31 10:15:23'),
	(10297,18110,698,4,'製造に取り掛かり始める','【今回】\n画面遷移図、画面仕様書、ER図、テーブル定義書、作成背景を提出し、製造の範囲に入った。\n開発スケジュールを作成したので次回から制作に進む。\n\n【次回】\nモックを作成する。\n《目標》\nログイン画面×2　メニュー画面×2　時計メニューを終わらせる(モックの4割)','2021-10-31 10:15:51','2021-10-31 10:15:51'),
