	(10304,18583,769,3,'4-2 課題２（ループ練習）','for文を使って数値の表示を学びました。まだあまりしっかりと理解ができていない部分があるのでここをしっかりと理解して表示したいように表示ができるようにしていきたいです。火曜から4-3に入っていけるように頑張っていきます。','2021-10-31 10:36:07','2021-10-31 10:36:07'),
	(10305,18582,621,4,'7-2製造','パスワードを再設定するときにメールを送信するが、ローカル環境で動作確認する時postixの設定が必要である。\n自分のGメールから送信できるように設定を行なった。','2021-10-31 10:42:11','2021-10-31 10:42:11'),
