	(10311,17399,697,3,'自作実装機能作成','本日より本格的に実装の方へ入りました。（ログイン機能、編集、削除など）\n進捗率はログインなどの機能面で言うと40%ほど完了しています。\n少しテーブルの設計、構造を変えないとならない場面が出てきて、修正を加えつつ取り組みました。\nメールでの自動送信も取り組みに入っているのですが、ターミナルでの送信は成功したのであとはそれをコードに組み込んでいきます。\n引き続きよろしくお願いいたします。','2021-10-31 10:54:28','2021-10-31 10:54:28'),
