	(10332,18587,602,1,'8-3 ToDoList作成','PostgreSQLの導入に詰まっております。\nインストール自体は上手く行っている様なのですが、\nそもそも仮想環境についての知識がまだまだなので、\n8-2で作成したプロジェクトの中に別ファイルとして\n作成することができパスさえ変えれば良いのか、\nmysqlとPostgreSQLをインストールしていても関係ないのか、\nもう少し考えてみて、詰まってしまった場合は質問させて頂きます。','2021-11-01 15:29:25','2021-11-01 15:29:25'),
