	(10343,18752,761,4,'PHP応用','・課題6_3の提出\n・課題6_4の実施と提出\n→昨日に6_3を終わらせ、６＿4も途中まで終わらせた。\n・自作の開発の流れを検索して学習\n・題材は「勤怠管理システム」にしようかと考えています。','2021-11-02 09:40:48','2021-11-02 09:40:48'),
	(10344,18790,504,3,'カレンダーでの予約ページ機能実装','本日はカレンダーページでの予約機能の実装を取り組みました。\n一応完成はしたのですが、再度正常に機能するか細かく確認していこうと思います。','2021-11-02 09:47:22','2021-11-02 09:47:22'),
	(10348,18757,715,5,'4-A,1','今日からphpの基礎に入りました。事前準備ではひとつ難易度が上がり、不安を覚えました。しかし、4－1を始めると文法の復習の要素が多く、実際にコードを書き始めた方が効率が上がりました。特に変数や演算はどのように表現するとうまくいくのかを考えるのが楽しく、やりがいがありました。\n「どういう結果がほしいのか、目的がはっきりしている」とコードが書きやすくなり、今日はそのことを身をもって学べたと思います。また、その考えを持つと課題の意図も読み取りやすくなったと思います。\n「どういう目的（結果だす目的）でコードを書きたいのか」という考えをコーディング応用から忘れていたような気がするので、しっかり意識していきたいです。','2021-11-02 10:06:02','2021-11-02 10:06:02'),
	(10350,18757,715,5,'4-A,1','今日からphpの基礎に入りました。事前準備ではひとつ難易度が上がり、不安を覚えました。しかし、4－1を始めると文法の復習の要素が多く、実際にコードを書き始めた方が効率が上がりました。特に変数や演算はどのように表現するとうまくいくのかを考えるのが楽しく、思った通りの結果が出るのはやりがいがありました。\n「どういう結果がほしいのか、目的がはっきりしている」とコードが書きやすくなり、今日はそのことを身をもって学べたと思います。また、その考えを持つと課題の意図も読み取りやすくなったと思います。','2021-11-02 10:10:44','2021-11-02 10:10:44'),
	(10351,18824,698,4,'HTML/CSS部分作成','【今回】\nログイン画面とメニュー画面の作成を行った。(メニュー画面は手直しあり)\n進捗率としては予定通り進んでいる。\n\n【次回】\n時計画面、掲示板画面作成','2021-11-02 10:15:05','2021-11-02 10:15:05'),
