	(10361,18890,697,3,'自作機能作成','本日は管理者、ユーザーの基本的な機能を重点的に行いました。\n進捗率としては前回の40%から60,70パーセントほどになりました。\nスケジュール間は順調です。\n少し進捗が遅れた理由としてはcomposerでphpMailerを扱っていたのですが、ローカル環境ではうまくいったのですが、MAMP環境と言ったらいいかわかりませんがなかなかエラーが解決できず、composer,phpmailerの調査に時間をかけていました。\nRatchetでもcomposerを用いて環境構築を行う予定ですが、もう少し根本的なライブラリの仕組みを学習しようと考えています。\n引き続きよろしくお願いいたします。','2021-11-02 10:35:30','2021-11-02 10:35:30'),
	(10363,18726,769,3,'4-3 課題３（アルゴリズム）','今日は目標にしていた4-2を終わるこができました。やり方はある程度は理解できましたが完璧ではないと思います。そこを埋めていけるように復習してきたいです。現在はアルゴリズムに入り、考えたものをコードに起こして表示するのが難しく思います。理解しやすくする為に、表示したいことを紙にまとめたりして1問1問しっかりと考えて学習していきます。','2021-11-02 10:38:46','2021-11-02 10:38:46'),
	(10364,18734,796,3,'コーディング基礎、JavaScript基礎','本日からこのカリキュラムをスタートしました。\n初日はhtmlとｃｓｓの基礎をメインで行いました。分からないことが出てきた際の検索に手こずりましたが、エラーが解消し思い通りに表示が出来た時は小さな達成感がありました。こんなにがっつり勉強するのは久しぶりでしたが、明日から仕事と両立して頑張ります。','2021-11-02 10:46:09','2021-11-02 10:46:09'),
	(10370,18638,773,4,'4-2PHP_Loop','とても難しく躓いていましたがなんとか今日の学習で前に進めることが\nできました。配列の計算やfor文での表示方法をしっかりと復習しておきたい。','2021-11-02 11:02:59','2021-11-02 11:02:59'),
