	(10380,18620,668,4,'6-A PHP応用','各選手の詳細の機能を追加したいが、上手く効かない。詳細で作ったaタグのリンク先がおかしいのか、もしくは、各選手のIDを渡せていないのかもしれないので、それをもう一度確認が必要である。','2021-11-03 04:36:24','2021-11-03 04:36:24'),
	(10386,18589,662,5,'8-1に取り組んでいます','８−１に取り組んでいます。M1のPCではVagrantが使えないので、Dockerにて取り組んでいます。ご理解をお願い致します。','2021-11-03 09:23:35','2021-11-03 09:23:35'),
	(10391,18975,504,3,'発表資料作成','本日は製造の最終チェックをし、提出しました。\n発表の資料の作成にも取り掛かりました。\n本日中に作成し、明日にはチェックしてもらえるよう取り組みます。','2021-11-03 09:53:01','2021-11-03 09:53:01'),
	(10392,18833,774,3,'コーティング応用','本日からコーティング応用に取り組みはじめました。\n3-A,3-1を作業し、現在は3-2に取り組んでいます。','2021-11-03 09:59:56','2021-11-03 09:59:56'),
	(10394,18969,769,3,'4-3 課題３（アルゴリズム）','昨日と同様でアルゴリズムの問題を行いました。表示したい内容やこのように記述するなどはある程度掴めた気がします。でも、それを書くといった時にどう表すのかがまだわからなかったりするので色々と考えたことをとりあえずコード化して試していきたいと思います。\nここの考え方が重要なので時間をかけてでもしっかりと理解していきたいです。','2021-11-03 10:09:22','2021-11-03 10:09:22'),
	(10396,18882,697,4,'自作機能作成','本日は昨日の続きを行いました。\n内容としては管理者画面の見直し、\n新たにユーザがログイン後のパスワード変更、リダイレクトなどの処理を行いました。\nまた、一部パスワードなどのテキストボックスに値を表示、非表示するjsを組み込んでいるのですが、そのアイコンが入力してバリデーションをかけると少し下にずれるといったものが見られ、明日は少しそこの部分を見直してみたいと思って出す。\n明後日、もしくはその次の日以降にはオリジナルの機能の方の実装に入れるように頑張りたいと思っています。\n引き続きよろしくお願いいたします。','2021-11-03 10:31:20','2021-11-03 10:31:20'),
	(10397,18995,772,2,'コーディング応用','3-2を作業中ですが、自分の思ったような配置などができず過去の課題を振り返りながらの作業で進みが遅くなってしまいました。\nスクール時間外なども上手く使い進めていきたいと思います。','2021-11-03 10:31:31','2021-11-03 10:31:31'),
	(10399,18825,698,4,'一部機能作成','【自作課題で作る成果物(明日からは一番下に進捗とともに記載)】\n《PHP》\n・非同期処理を行なったタスク管理(Todoリスト)\n・項目ごとに分けて表示する掲示板\n《JavaScript》\n・カウントダウンタイマー\n・ストップウォッチ\n\n【今回】\nJavaScriptを忘れないために応用として作成を決めたストップウォッチの作成を終えた。\nStart,Stop,Resetのボタンがあるのだが、以下の問題が発生し、対処した。\n\n【エラーと対処】\n・Startを2回連続で押すとStopを一度押すだけでは止まらない\n→add(\'inactive\')とremove(\'inactive\')を使用しStartを選択するまでStopとResetは押せないよう設定\n\n・Stopを押して再度Startを押すと00:00.000からになる\n→最初にStartを押してからStopまでの時間を保持し再開できるよう設定\n\n・ボタンをdivで囲ったらtrue,fauls判定されなくなった(trueでボタンを押せなくする設定にしていた)\n→start.classList.remove(\'inactive\');\n        stop.classList.add(\'inactive\');のようにaddとremoveで判断できるようにした。\n\n【進捗】\n予定通りに進んでいて現時点では問題なく取り組めている。\n\n【次回】\nメニュー画面(社員・管理者)のレイアウトとTodoリストに取り掛かる。','2021-11-03 10:32:52','2021-11-03 10:32:52'),
	(10400,18674,704,3,'DB基礎','ハンズオンが終了し、課題１を取り組み中です。','2021-11-03 10:33:37','2021-11-03 10:33:37'),
	(10409,18639,773,4,'4-2課題2','ループ処理の練習問題で躓いた部分があるので\n昨日に引き続きしっかり復習しておく。','2021-11-03 11:05:07','2021-11-03 11:05:07'),
