	(10445,18970,769,3,'4-3 課題３（アルゴリズム）','昨日と同様でアルゴリズムの問題を行いました。役判定のところで躓き、カードの数字が重複した時や２組重複した時などのカウントの仕方がいまいち分からず検索などをして今日は終わってしまいました。カウント関数を使い、array_count_valuesなどをうまく使えば数字は取れると分かったので色々と試していきたいです。','2021-11-04 10:08:14','2021-11-04 10:08:14'),
	(10446,19042,756,3,'4-3アルゴリズム','調べものと試行錯誤の繰り返しで、どんどんカリキュラムを熟していくことはできないが、ひとつずつ課題に取り組むことで着実に力をつけていきたい。','2021-11-04 10:08:49','2021-11-04 10:08:49'),
	(10451,19038,779,2,'HTML,CSSについて','本日はHTML、CSSについて深く学びました。\n画像を表示させることや画像を揃えることに躓きましたが、解決し理解を深めることができました。今後の復習としましては、フリー写真から画像を持ってきて載せてみたり、右寄りや中央に合わせてみたり、フォントを設定してみたりして自己紹介ページなどの作成を行いより理解を深めていきたいと思います。今日学んだことを今後にしっかり生かしていきたい。','2021-11-04 10:32:28','2021-11-04 10:32:28'),
	(10452,18676,704,4,'DB基礎','課題1取り組み中です。\nデータベースを作成しましたが、phpとの接続につまずいているので、講師の方に質問したことを参考にしながら修正を進めています。','2021-11-04 10:32:37','2021-11-04 10:32:37'),
	(10457,18883,697,4,'自作機能作成','本日はオリジナル機能以外の作成を重点的に行い、検索機能、アイコン機能、\n画像取り込み、読み込み、などを行い、\n進捗率としては70%ほどです。\n画像表示と検索に少し時間がかかりましたがうまく出来ました。\n明日はパスワード再設定用のメールアドレス送信をまずは完成させ、その他オリジナル以外で不足しているところを補いたいとおもいます。\nオリジナル作成には予定通りに入れそうです。\n\n引き続きよろしくお願いいたします。','2021-11-04 10:50:44','2021-11-04 10:50:44'),
