	(10467,18622,668,4,'6-A ハンズオン（オブジェクト指向キーワード調査）','前の課題でできていたバリデーションの追加や編集、確認画面などが違うファイルやディレクトリ構造だと混乱してしまうところがある。さらに細かいスペルミスや大文字小文字などの凡ミスが多いので、もう少し一つ一つを正確に進めていく必要がある。','2021-11-04 11:02:53','2021-11-04 11:02:53'),
	(10468,18640,773,5,'PHP 4-3課題','PHPのアルゴリズムの課題を今日は2つほど進めることができた。\n多数の処理を作る際は一つずつ処理を分解して作ると課題を解けやすい。','2021-11-04 11:24:36','2021-11-04 11:24:36'),
