	(10480,18827,698,4,'PHP自作','昨日の日報を途中で送信してしまい、「日報を編集する」ボタンを押して記述したがその後に「編集」ボタンが表示されずそのままになってしまった。(19:30だったので講師の方にも伝えなかった)\n昨日の日報内容は他の場所へ残していたので、本日は2日分の日報を記載する。\n-----------------------------------\n11/4(木)\n【今回】\nTodoリストのHTML,CSS部分を取組中\nレイアウトが崩れてしまい時間がかかってしまっている。\n進捗は予定通り。\n\n【次回】\n今回の続き\n\n《PHP》\n・非同期処理を行なったタスク管理(Todoリスト)　20%\n・項目ごとに分けて表示する掲示板 未着手\n《JavaScript》\n・カウントダウンタイマー 未着手\n・ストップウォッチ   完了\n\n-----------------------------------\n11/5(金)\n【今回】\n・タスク管理昨日のデータ管理、CRUD外観を整えた。\n・以前作成したストップウォッチのエラーを生かしカウントダウンタイマーではどのようなエラーが起こりうるかを書き出した。\n\n【次回】\n・カウントダウンタイマーの完成\n\n便利なビルドイン関数を扱いきれず、まだまだ無駄なコードを書くことが多いので時短のためにも少しずつ覚えていく。\n\n《PHP》\n・非同期処理を行なったタスク管理(Todoリスト)　30%\n・項目ごとに分けて表示する掲示板 未着手\n《JavaScript》\n・カウントダウンタイマー 未着手\n・ストップウォッチ   完了','2021-11-05 08:46:05','2021-11-05 08:46:05'),
