	(10496,18884,697,4,'自作機能作成','本日はオリジナル機能以外の作成が大幅に進みました。\nPHPMAILERの実行もうまくできました。\nこのライブラリに関してですが、実行はうまくでき、メールも受け取れたのですが、処理スピードが遅く、送信までに時間がかかってしまっていることが挙げられます。\nその他画面ごとの名前の受け取りや値の受け取りもうまくできているのでオリジナル以外は完成間近になります。\n引き続きよろしくお願いいたします。','2021-11-05 10:12:37','2021-11-05 10:12:37'),
	(10498,18677,704,3,'DB基礎','5-1取り組み中です。\nDBへの接続に成功しましたが、データの内容が取得できないので、引き続き取り組んで次の開講日で確認したいと思います。','2021-11-05 10:39:47','2021-11-05 10:39:47'),
	(10499,18623,668,4,'6-2 課題２（サイト機能追加・修正）','sql文で色んなテーブルを操作した。前章での練習問題が生きたと思う。詳細データに別のテーブルから必要なデータを引っ張り出すことができた。オブジェクト指向に苦手意識があるがこの課題はたくさん出てくるのでしっかり理解しながら進めていきたい。','2021-11-05 10:40:50','2021-11-05 10:40:50'),
	(10500,19072,769,3,'4-3 課題３（アルゴリズム）','ポーカーのコードで今までの書き方がうまくいかず、in_arrayを使って指定のもの以外は不正と出るように書き換えました。役判定のところでは、記述がうまくいっておらず、役の判定がうまくされない状況なのでここを見直さないといけないと思いました。考えることが多いと思いますが、一つ一つ分けて考え、しっかりと動くコードを書けるように頑張っていきます。','2021-11-05 10:42:03','2021-11-05 10:42:03'),
	(10501,19100,796,3,'コーディング応用','前半はjQueryの基礎を、後半は指示書に沿って、ホームページを作っていくことをメインで行いました。\nヘッダー部分のところで止まってしまっているので、試行錯誤をして取り組んでいきます。','2021-11-05 10:43:22','2021-11-05 10:43:22'),
