	(10531,18510,681,3,'サイト作成','なかなか課題をおわらせないとという意識になり理解へとつなげられない部分があったのでそこは修正しないとと感じました。','2021-11-06 15:15:02','2021-11-06 15:15:02'),
	(10532,19047,565,3,'5-2 課題２（SQL基礎・応用問題）','サブクエリの使い方に苦戦していましたが、何度も調べ直していたら少しずつ理解していき何門かを解決することができた。\n「サブクエリは単一行を返すことが保証されたクエリでなければならない」このルールを理解したことが大きかったかもしれない。','2021-11-06 19:21:19','2021-11-06 19:21:19'),
