	(10553,19161,769,3,'4-3 課題３（アルゴリズム）','今日も前回と同様でポーカーの考え方の所をやりました。in_arrayを使って色々と確かめたが、多次元連想配列の中の値のチェックがうまくいかず、数値も１〜１３以外の時は不正と表示できるようにするとこでもうまく弾いてくれない状況です。色々な方法で表示ができるので、他のやり方を試したりしていきたいです。','2021-11-07 10:19:51','2021-11-07 10:19:51'),
	(10555,18678,704,3,'DB基礎','課題1取り組み中です。\nフォームからDBへのインサートに苦戦しており、講師の方に質問も参考にしていますがまだ原因がわからない状況です。\nエラーチェックとスペルから見直してみます。','2021-11-07 10:34:50','2021-11-07 10:34:50'),
	(10557,19166,602,4,'8-3 Todolistの作成','LAPP環境構築に手間取っていました。\n最初は新しく環境構築から始めようと思っていたが、\n分からずに8-2の環境を使用しました。\nvagrant-up等を上手くいったがpostgresqlに接続がなかなか出来ない状態でした。\n本日からもう一度新しくインストールし直し始めたのですが、\nなぜか上手くLaravelと接続が可能になり、migrateが成功しました。\nひとまず先に進める事ができるのでTodolistの作成に取り掛かりました。\nあとはherokuにデプロイするだけなので火曜提出目指し頑張ります。','2021-11-07 10:40:57','2021-11-07 10:40:57'),
