	(10560,19022,562,3,'php4-4','ログインフォーム作成\nquery作成中','2021-11-07 10:43:11','2021-11-07 10:43:11'),
	(10562,19147,779,1,'javascript,jquery','本日はjavascript、jqueryについて深く学びました。\nサイトで基礎から理解しましたが課題でつまづき作業が進まなかったため、自分の理解がまだまだ足りないことを痛感いたしました。次の出席までには今回できなかったところをできるように努めたい。','2021-11-07 10:55:58','2021-11-07 10:55:58'),
	(10566,18885,697,3,'自作機能作成','本日は後半からチャット機能の取り組みを始めました。\n初めはRatchetで組み立てていたのですが、Ajaxの方が理解がスムーズで\nAjaxで再度組み直しました。\nAjaxに関しては理解が早いですが、get送信を繰り返し行なってしまう仕組みをどうにかしようを考えていますが、なかなかいい案が出てきていない状況です。\n進捗率としてはチャットのやりとりがまだ出来ていないので、チャット面で言うと２０％ほどにとどまりました。\nその他のオリジナル機能に関しては、テーブル中身を少し修正して、userのテーブルでまとめて管理した方が効率が良いのかなと感じてきています。\n引き続きよろしくお願いいたします。','2021-11-07 11:03:22','2021-11-07 11:03:22'),
	(10569,18642,773,3,'4-3PHP','今日もPHPアルゴリズムを行った。\n少し分からないところに入り進捗が中々進まない。','2021-11-07 11:30:42','2021-11-07 11:30:42'),
	(10570,18756,761,3,'課題7-1','・画面遷移書、画面仕様書の作成','2021-11-07 11:45:02','2021-11-07 11:45:02'),
	(10580,19184,707,4,'php基礎 4-4作成','フォーム作成の最終調整を行なった。\n全体の位置がずれていたので、コードを他のメモに移動させ、少しずつ確認を行なった。\n全体の構成を1から考え直すのは難しいと感じていたが、出来上がったプログラムがあるなら改めて確認ができるので良い機会だと感じた。','2021-11-08 05:18:58','2021-11-08 05:18:58'),
	(10583,18711,648,3,'PHP応用','６−３取組中','2021-11-08 11:35:54','2021-11-08 11:35:54'),
	(10586,19128,620,2,'4-4','jqueryの部分(ボタンの指定ヘッダーの固定、スクロールの指定、)と前回消えてしまったお問い合わせフォームの修正をメインに行いました。yar.let.consの違い、scrollTop()とoffset().topとの違いを理解できないまま使用していたため、エラーが多発し修正に時間がかかってしまった。','2021-11-08 14:54:17','2021-11-08 14:54:17'),
	(10590,18592,662,5,'8-1のDocker版に取り組んでいます。','8-1のDocker版に取り組んでいます。基礎からDockerを学習していますが、DockerHubにてLaravelのimageがpullできないなどの状況です。今週中には環境構築は終わらせたいです。','2021-11-09 04:20:50','2021-11-09 04:20:50'),
	(10592,18938,538,3,'8-3 課題３（TODOリスト作成)','8-3 課題３（TODOリスト作成）取り組み中です。','2021-11-09 05:22:28','2021-11-09 05:22:28'),
	(10596,19216,504,3,'Linux ToDoリスト作成','本日はLinux ToDoリスト作成について取り組みました。\n環境構築自体はできたのですが、使用方法はいまだに分からないところが多いので一つずつしっかり理解していきたいと思います。','2021-11-09 09:31:40','2021-11-09 09:31:40'),
	(10602,18829,698,4,'PHP自作','【今回】\n・フッターヘッダーを社員と管理者画面でデザインを変えてわかりやすくした\n・Todoリストに取り掛かったがMysqlに接続する際にエラー発生\n----------------------------\n《mysql起動時に起きたエラー》\nmysql.sockファイルが消えていて起動できない\n→sudo touch /tmp/mysql.sockで作成\n\nmysql再起動を行なったが失敗する\n→ディレクトリ権限が原因だったのでsudo chown mysql:mysql /tmp\n\npidファイルが存在せず起動できない\n→touch /usr/local/var/mysql/*****.local.pidでpidファイル作成\n\npidファイルを作成したが権限がない\n→sudo chown -R _mysql:_mysql /usr/local/var/mysql/で作成\n\n----------------------------\n\nエラーを治すと新たなエラーが縦続きに発生してしまい、テーブル作成ができていない状況。\n【次回】\n・テーブル作成のエラー解決法を見つける\n・全体のHTML・CSS部分完成(今までは着手し始める機能のフロントさいどを作成し未着手のものは後回しであった)\n\n《PHP》\n・非同期処理を行なったタスク管理(Todoリスト)　20%\n・項目ごとに分けて表示する掲示板 未着手\n《JavaScript》\n・カウントダウンタイマー 完了\n・ストップウォッチ 完了','2021-11-09 10:01:34','2021-11-09 10:01:34'),
	(10608,19256,772,3,'コーディング応用　3-2','本日は前回に引き続きコーディング応用を取り組みました。\n思ったように進んではおりませんが、少しづつコードが読めるようになり、繰り返し使うコードは書けるようになってきました。\nコードをもっと早く書けるよう努力していきたいと思います。','2021-11-09 10:30:08','2021-11-09 10:30:08'),
	(10610,19190,704,4,'db基礎','課題１がほぼ終わったので、最終確認をして明日提出します。','2021-11-09 10:33:31','2021-11-09 10:33:31'),
	(10611,18886,697,4,'自作オリジナル機能作成','本日は続きでチャット機能の作成に入りました。\nだいぶ進捗率が上がり、表示までできました。\nですがAjaxの非同期がページ更新を毎回行ってしまい、最後はその原因を突き止めていました。\n未だにページ更新のようなものがかかってしまっている状況なので明日は修正に入りたいと考えています。\nオリジナル機能のチャット以外ではギフト送信と、メッセージ回数によるギフト付与を考えています。\nメッセージ回数によるギフト付与は\nロジックをもう少し考える必要があり、\n現在あるテーブルで可能かどうか検討中です。\n引き続きよろしくお願いいたします。','2021-11-09 10:33:32','2021-11-09 10:33:32'),
	(10612,19255,796,2,'コーディング応用','見本に沿ってwebサイトの作成を行っています。\n今日までに３－２を終わらす予定でしたが、スムーズに入力を行えず完了することが出来ませんでした。\n次の勉強会に参加するまでに作成完了できるよう取り組んでいきます。','2021-11-09 10:38:38','2021-11-09 10:38:38'),
	(10614,19230,769,3,'4-3 課題３（アルゴリズム）','前回と同様でポーカーのアルゴリズムを行いました。少し進み、判定役のところで詰まっている状況です。同マークの所で詰まっているのでここを多次元連想配列からうまく取り出し、表示できるようにします。','2021-11-09 10:46:21','2021-11-09 10:46:21'),
	(10621,19020,611,3,'4-4 課題4','4-4 課題4','2021-11-09 10:53:39','2021-11-09 10:53:39'),
	(10624,19185,761,3,'課題7-1','機能の再度洗い出し。\n画面仕様書、画面遷移図の作成。\nDB設計','2021-11-09 10:59:30','2021-11-09 10:59:30'),
	(10626,18643,773,1,'4-3-4アルゴリズム','今日は一つも前に進めることができなかった。\n講師に相談してみたが、自分のやり方では上手く行かないのではないかと不安になり、色々調べながらやってみたが上手くいきそうにない。\nそこで今行っている処理をやめて一から考え直すことにした。\n明日は一つでも前に進めたい。','2021-11-09 11:05:21','2021-11-09 11:05:21'),
	(10631,19103,386,3,'php自作','◯ログイン機能\n◯お問い合わせ機能\nログイン機能(30%)','2021-11-09 12:57:23','2021-11-09 12:57:23'),
	(10636,19089,706,3,'課題提出','フロントエンドの実装および課題提出','2021-11-10 00:25:19','2021-11-10 00:25:19'),
	(10639,19246,648,3,'PHP応用','６−３取り組み中','2021-11-10 03:13:24','2021-11-10 03:13:24'),
	(10643,19003,563,3,'5-1 DB基礎 取組中','Cafe-Cafeのお問い合わせフォームテーブルに登録','2021-11-10 08:52:44','2021-11-10 08:52:44'),
	(10647,18830,698,4,'PHP自作','【今回】\n・前回出てしまったデータベース関連のエラー改善\n・Todoリストのテーブルを作成し接続\n\n-----------------------------\n【発生したエラー】\nテーブルを作成し中に値を入れて確認を行なったが接続エラーが出てしまう。\n→PHPファイル内にdefineで記載するhostが間違っていた\n\nテーブルのデータをオブジェクト格納し、var_dumpで確認したところテーブル名指定をしているにもかかわらず異なるDB(今回の場合は前回までの課題で使用したcafeデータベースを読み込んでいた)のなかのテーブルを探し、そのようなテーブルはないと表示される。\n→SELECT* FROM　の後にtask.todosとデータベース名を指定することで解決。\n\n-----------------------------\n【次回】\n・Todoリストを８割まで完成させる\n\n-----------------------------\n【進捗】\n《PHP》\n・非同期処理を行なったタスク管理(Todoリスト)　35%\n・項目ごとに分けて表示する掲示板 未着手\n《JavaScript》\n・カウントダウンタイマー 完了\n・ストップウォッチ 完了','2021-11-10 10:00:31','2021-11-10 10:00:31'),
	(10648,18887,697,4,'オリジナル機能作成','本日はチャット機能の画像、ギフト送信をメインに行いました。\n進捗率としては、オリジナル機能50%ほどになります。\nAjaxを複数使用しているため、Ajaxの起動がバグのようにチャット部分が点滅してしまうことがあります。\n画像送信に関しては仕組みはできたのですが、まだしっかりと表示ができていない状況です。\n\nオリジナル機能のギフト送信に関してはうまくいき、メッセージ回数によってポイントを付与することも順調に開発できそうです。\najaxはもう少し調べて理解する必要があるかと感じています。\n引き続きよろしくお願いいたします。','2021-11-10 10:02:07','2021-11-10 10:02:07'),
	(10651,19231,769,3,'4-3 課題３（アルゴリズム）','ポーカーアルゴリズムでそれそれの役の結果でif文を用いたが、if文が効かないということが起きてしまいました。それぞれの役ごとにifで条件分岐したが、これをまとめないといけないのかと思いました。同マークの時などの時はまとめてif,elseを用いて少しずつでも進めていきます。','2021-11-10 10:06:50','2021-11-10 10:06:50'),
	(10655,19252,774,3,'コーティング応用３−３','コーティング応用３−３に入りました。\n調べつつ、記述していると進みが遅くなりがちですが、次回までに提出できるように頑張ります。','2021-11-10 10:39:32','2021-11-10 10:39:32'),
	(10656,19191,704,4,'DB基礎','5-1の課題を提出し、OKをいただきました。現在5-2作業中です。','2021-11-10 10:41:20','2021-11-10 10:41:20'),
	(10667,18644,773,2,'4-3PHPアルゴリズム','昨日と変わらず、進めることが出来なかった。\n質問しようにも質問の仕方が悪くアドバイスもらえなかった。\nアルゴリズムの考え方自体が思い浮かばずポーカーの役判定で躓いている。明日は公式ドキュメントを確認しながら自力で進めるようにする。','2021-11-10 11:11:43','2021-11-10 11:11:43'),
	(10669,19309,706,3,'課題提出','稼働日のためNo2を提出しました。','2021-11-10 11:25:06','2021-11-10 11:25:06'),
	(10670,19186,761,2,'7-1','画面遷移図の作り方を調査。\n進捗がなかなか進まない状態。','2021-11-10 11:49:31','2021-11-10 11:49:31'),
	(10675,19168,565,3,'5-2 課題２（SQL基礎・応用問題）','サブクエリや結合に対しての理解が少しずつ深まってきている。\n1問,1問を解決するのにまだ時間は結構かかってるが、何度も試行錯誤を繰り返すことによって理解が深まっていことは感じている。','2021-11-11 02:33:28','2021-11-11 02:33:28'),
	(10680,19247,648,3,'php応用」','６−３取り組み中','2021-11-11 04:16:02','2021-11-11 04:16:02'),
	(10681,19005,563,4,'DB基礎　課題１－５','カラムのケアレスミスなど修正\nSQL攻略等、サイトの読み込み学習を行いました','2021-11-11 04:33:23','2021-11-11 04:33:23'),
	(10683,19200,662,2,'8-1に取り組んでいます。','8-1に取り組んでいます。Dockerをコンテナ下で環境構築する方法がいまいち理解できていない現状です。','2021-11-11 06:47:52','2021-11-11 06:47:52'),
	(10685,19339,715,3,'4-1','今日は主に配列の課題を取り組みました。もう少し先まで進められたかなと思うので、問題の理解を早くできるように取り組んでいきたいです。','2021-11-11 08:58:57','2021-11-11 08:58:57'),
	(10688,19330,813,1,'1-1~1-4','なにを質問すればいいのかわかりませんでした。\nネットで調べることの重要さ、解決力を鍛えていかなければいけない。','2021-11-11 09:53:57','2021-11-11 09:53:57'),
	(10690,19332,574,2,'7-1','ER図を進めていましたが、外部キーの認識違いなどで本日中に完成させることが出来ませんでした。\n修正やシステム作成背景、ターゲット資料を作成し明日には、提出できるようにしていきたいです。','2021-11-11 10:04:06','2021-11-11 10:04:06'),
	(10696,19341,769,3,'4-3 課題３（アルゴリズム）','時間はかかりましたが、ポーカーのアルゴリズムでジョーカーを入れて役判別のところまで来ることができました。表現の仕方がジョーカー抜きのところとほぼ一緒なのでうまくコードにして出力できるようにしていきます。','2021-11-11 10:23:59','2021-11-11 10:23:59'),
