	(10701,19335,779,3,'Javascriptクリックするとボタンの見た目が切り替わる操作','クリックするとボタンの見た目が切り替わるよう動作について学んだ。\n時間はかかってしまったが、Jqueryについて以前より理解できるようになってきました。\n今日学んだことは、今後生かせるように復習していきたい。','2021-11-11 10:44:01','2021-11-11 10:44:01'),
	(10702,19187,761,1,'自作設計7-1','重い仕事が入ってしまい、学習に専念できなかった。','2021-11-11 10:48:03','2021-11-11 10:48:03'),
	(10703,18888,697,4,'オリジナル機能作成','本日は昨日に引き続きオリジナル機能の作成に入りました。\n進捗率としては80%以上になります。\nショップからの購入やその遷移もうまく行っています。\nひとつだけ、チャット機能における非同期通信の画像送受信と、その非同期通信のリロードがうまく行かず、他のオリジナルの方の作成へ進みました。\n画面がリロードされてしまうことは、大体の実行で起きているのですが、本日の数回はその現象が起きずうまく実装できる場面がありました。\njs の部分が原因だと思うので明日はその点を見直しつつ行います。\n引き続きよろしくお願いいたします。','2021-11-11 10:50:55','2021-11-11 10:50:55'),
	(10707,18645,773,3,'4-3課題アルゴリズム','今日は何とか課題を終わらせることができました。\nしかし確認不足による修正が何度も発生してしまった。\n早く終わらせようと必死になり確認を怠り、講師の方にご迷惑を掛けてしまった。今後しっかりと確認作業を行うよう自分でチェック表を自作し確認作業行う。','2021-11-11 11:17:50','2021-11-11 11:17:50'),
	(10709,19337,668,4,'６−２　php応用課題２（機能追加）','本日は得点履歴と削除機能、追加機能の追加を行った。ひとつの機能を追加するのにかなり時間がかかってしまうのでなるべく時間短縮、効率化を目指して取り組んでいく。','2021-11-11 13:04:01','2021-11-11 13:04:01'),
	(10714,19348,621,3,'自作発表資料作成','稼働日の為、課題の提出のみ行いました。','2021-11-12 02:34:11','2021-11-12 02:34:11'),
