	(10719,18831,698,4,'PHP自作','セッションエラーで送信出来ていませんでした。\n\n【今回】\nTodo管理昨日作成\nエラーが続いてしまい進捗が遅れている(詳しいエラーは12日の日報でまとめて報告)\n\n【次回】\n今回のエラー解消と制作を進める','2021-11-12 04:02:11','2021-11-12 04:02:11'),
