	(10728,19382,715,4,'PHP基礎/アルゴリズム4-1','４－１を確認待ちまで進みました。配列と関数の使い方が少し実践的になり、「こういう使い方をしていくのか」と学びました。一方で応用をしきれずに忘れてしまう機能もありそうだったので、こういったコードが書けるということを忘れず、復習し今後しっかり使えていけるようにしたいです。','2021-11-12 09:03:34','2021-11-12 09:03:34'),
	(10730,19285,538,3,'8-3 課題３（TODOリスト作成）','8-3 課題３（TODOリスト作成）取り組み中です。','2021-11-12 09:52:10','2021-11-12 09:52:10'),
	(10734,19160,740,3,'1-4','お腹を壊してしまいしっかりと取り組むことが出来なかったので、体調管理と共にしっかりやらなければいけないと思いました。','2021-11-12 10:07:39','2021-11-12 10:07:39'),
	(10735,19366,574,3,'7-1設計　ファイル確認、修正','確認を行いましたが、単純なミスを残したまま提出してしまいました。より丁寧に確認していきます。\n指摘事項を基に、改めて他の人が見た際に理解できるか考えながら修正を行っていきます。','2021-11-12 10:08:56','2021-11-12 10:08:56'),
	(10736,19354,769,3,'4-4 課題４（お問い合わせフォーム）','今日はなんとかポーカーアルゴリズムを作成することができました。\nポーカーを作る上で重複回数を取得したり、連続する数値の出力の仕方などの勉強がすごくできたと思っております。ジョーカーを入れての表現の仕方などもジョーカー抜きを応用すれば作ることができました。また、エラー出力の際にbinファイルのみしか見れておらず、confの方を直さないといけないのにエラーが出力されないといったことがありました。そういったことも踏まえ、分からないこと、疑問に思ったことをどんどん調べたり、聞いたりして知識を増やしていきたいです。','2021-11-12 10:09:10','2021-11-12 10:09:10'),
	(10738,18832,698,4,'PHP自作','近頃educateを開くと「データの取得に失敗しました」と出ることが増えたので進捗報告ができているのかが不安です。\n\n【今回】\nタスク管理機能を後は非同期処理にすることができたら完成というところまで進んだが、DB接続関連でエラーが起きてしまうことも少なくないので焦らず慎重に進める。\n\n《昨日から起きたエラー》\n・削除を押してもデータが消えない\n→異なるデータベースに接続される（DB指定で解決）\n・削除しますか？のアラートでキャンセルを押しても削除されてしまう\n→if文ミス\n・チェックボックスに印を入れても一つまでしかcssが適応されない\n→書く場所を間違えていた\n\n【次回】\nできるところまでタスク管理機能を進める\n\n【進捗】\n《PHP》\n・非同期処理を行なったタスク管理(Todoリスト)　80%\n・項目ごとに分けて表示する掲示板 未着手\n《JavaScript》\n・カウントダウンタイマー 完了\n・ストップウォッチ 完了','2021-11-12 10:17:07','2021-11-12 10:17:07'),
	(10740,19193,704,4,'DB基礎','課題5-2提出し、OK頂きました。これから確認テストを受けます。','2021-11-12 10:36:01','2021-11-12 10:36:01'),
	(10742,19380,772,3,'コーディング応用3-2 3-3','本日はコーディング応用の続きに取り組みました。\n一個の作業に少し時間がかかり過ぎていると感じておりますので、まずは次の工程での優先順位など「工程の道筋」をもう少し意識して引き続き取り組んでいきたいと思います。','2021-11-12 10:47:39','2021-11-12 10:47:39'),
	(10748,19374,796,4,'コーディング応用','３‐２の修正と３‐３のホームページ作成を行いました。\n３‐３については今のところ比較的スムーズに進んでいます。\nレスポンシブの復習をしながら進めていきます。','2021-11-12 10:53:43','2021-11-12 10:53:43'),
	(10750,19188,761,5,'今後の方向性の擦り合わせ、React基礎','○３者面談で今後の擦り合わせ\n・１月に発表会\n・２月エンジニアデビュー\n○今後の学習の流れ\n１、React基礎\n（typescript,Next.jsも）\n２、Laravel基礎（Dockerで環境構築）\n3,API学習\n4,React+Laravelの連携\n5,設計\n6,制作\n７、AWS（成果物をデプロイ）\n8,発表会\n9,企業面談（8章）\n10,エンジニアデビュー\n\n今後の流れが明確になったので明日以降React周りの基礎を学習していきます。','2021-11-12 11:02:08','2021-11-12 11:02:08'),
