	(10768,18889,697,4,'自作オリジナル機能作成','本日はチャット機能のajax更新時の修正をしつつ、他のオリジナルを仕上げていきました。\nあと２日、もしくは３日で完成できるかと思います。\n\nチャットないでの画像送信がなかなかうまくいかず、ネットで質問したりしています！\nオリジナルで余裕が出たら少し試してみたいことがあったのでできる範囲でやってみたいと思います！\n引き続きよろしくお願いいたします！','2021-11-13 14:22:31','2021-11-13 14:22:31'),
	(10770,19183,746,3,'javascript,jquery','ボタンを押した際に入力されている内容を記憶して、アラートで表示させたり、if文を使って条件ごとに異なる動きをつける方法を学んだ。','2021-11-14 03:56:12','2021-11-14 03:56:12'),
