	(10774,19445,602,2,'8-3 課題3（TODOリスト）取り組み','herokuにデプロイの作業だが、ひたすらlaravel-uiが無いというエラーが出ていました。\n結果的にcomposer.jsonの記述だけがエラーの原因だった様です。\nherokuに先にインストールしなければいけないのかとも考えましたが\ncomposer.jsonがその役割を担っているんだと思います。\nherokuは比較的簡単に色々設定してくれる様なので\n詳細はよく分からずにいます。\nAWS等はカスタマイズして作っていく様なので追々勉強します。\nあとはsendgridのエラーとherokuとgitの連携だけだと思いますので、\n次回で終われるよう頑張ります。','2021-11-14 10:04:34','2021-11-14 10:04:34'),
	(10775,19031,698,4,'PHP自作','【今回】\nTodoリストに非同期処理を施し始めた。\n\n------------------------------\n《発生したエラー》\n非同期処理で削除やチェックボックスにチェックを入れるなどはできたが新規登録はfetchで書き換えてもうまく動作しない\n→カスタムデータ属性でidをつけているのでDBにレコードを挿入した後でないと更新されない\n------------------------------\n【次回】\nエラーの原因を探るとともに少しデザインが崩れてしまっているので修正していく。\n\n【進捗】\n《PHP》\n・非同期処理を行なったタスク管理(Todoリスト)　90%\n・項目ごとに分けて表示する掲示板 未着手\n《JavaScript》\n・カウントダウンタイマー 完了\n・ストップウォッチ 完了','2021-11-14 10:04:47','2021-11-14 10:04:47'),
	(10776,18891,697,4,'自作機能作成','本日は先日チャット送信時の画像送信がうまくいかなかった部分を重点的に行い、さらにユーザーが相手とのチャットを行っていく上でメッセージ件数をカウントし、カウントに応じで両者にポイントを付与する機能の実装を行いました。\n前者の画像送信に関してはデータベースには入れることができ、問題も解決できました。その表示に関してはcssを調整し、表示に関しても成功しました。\n\n画像送信の問題が些細なミスコードの部分が原因でしたので、これほど長く時間がかかるとは思いませんでした。\nミスがあると思われる場所以外のところでのミスでしたので今後気を付けていきたいと思います。\n\nまた、チェックをしていてチャットを送信後には、一番下のチャットを表示するようにスクロール設定をしているのですが、過去の内容を見たい時にスクロールすると一番下に戻ってしまうものが実装されてしまいそれに関して次の課題としています。\n引き続きよろしくお願いいたします。','2021-11-14 10:06:34','2021-11-14 10:06:34'),
	(10777,18586,610,2,'PHPバリデーション','PHPのバリデーションに取り組んでいます。先日の相談会で教えて頂いたことを参考に進めていますが、まだ上手くいっていません。フォームに入力した値をGETで受け取り、SESSIONで次のページに渡す、ということが理解できたので引き続き色々な方法を調べながら頑張ります。','2021-11-14 10:06:43','2021-11-14 10:06:43'),
