	(10779,19438,718,4,'MVC課題　ログイン機能','本日はログイン機能の実装を行なった。今のところ順調に進んでおり、ユーザーデータを登録するところまで完成した。後はログイン出来るようにするだけなので引き続き頑張っていきたい。','2021-11-14 10:16:43','2021-11-14 10:16:43'),
	(10780,19420,769,3,'4-4 課題４（お問い合わせフォーム）','今日はお問い合わせフォームの作成をしました。全体のページは作成できたので、そこから、JavaScriptを使用したりして、ボタンを押した時にtopに戻ったりできるようにしていきたいです。次の日の目標は、Javascriptを使用しての部分とページ遷移からのバリデーションに入ることを目標として頑張っていきます。','2021-11-14 10:16:45','2021-11-14 10:16:45'),
