	(10785,19430,745,3,'サンプルサイトの作成2','2つ目のサンプルサイトを作成中です。ヘッダーの作成をし、メインの表示を作っています。配置や見た目を考慮して進めていますが、1つ目のサンプルサイトと同様に時間がかかってしまっていますが、正しく表示できるように試行錯誤していきます。','2021-11-14 10:29:00','2021-11-14 10:29:00'),
