	(10789,19408,574,3,'7-1,7-2','設計の確認、提出後、スケジュール作成と実装機能確認を行っていました。これまで学習した知識から機能実装にどのくらいかかるのか、予定日までに余裕をもって完成させるには1日当たりどのくらい進める必要があるか、考えることが出来ました。\n\n製造スケジュール\n11/15(月）モック制作、テーブル作成、機能制作　3/34\n11/16(火）機能制作　8/34\n11/17(水）機能制作　8/34\n11/18(木）機能制作　11/34\n11/19(金）機能制作　18/34\n11/20(土）機能制作　25/34\n11/21(日）機能制作　32/34\n11/22(月）機能制作、機能テスト　34/34\n11/23(火）機能修正、機能テスト\n11/24(水）機能修正、システム提出\n11/25(木）機能修正、システム提出、発表準備\n11/26(金）発表準備、発表','2021-11-14 10:39:01','2021-11-14 10:39:01'),
	(10790,19444,772,3,'コーディング応用3-3','本日も引き続きコーディング応用3-3に取り組みました。\nメディアクエリの使い方の部分で忘れてしまっていた所があり、復習に少し時間が取られってしまったことや、前回書いたコードの中で今回の課題とは相性の悪い部分がありそこの修正に時間がかかってしまいました。\n前回の日報で記載した「工程の道筋」を考えることは少しづつできてきているので継続して続けていきたいと思います。','2021-11-14 10:40:00','2021-11-14 10:40:00'),
	(10793,19448,651,4,'課題4-5 バリデーション','序盤、前日に誤って記述していた.htaccessの存在を忘れ、localhostのページに接続出来ない状態になってしまっていて、エラーメッセージ４０３が出て作業が出来ず時間を使ってしまった。\nページ移動時の入力情報の保持と、confirm～とcomplete～へのダイレクトアクセス時にcontact～にリダイレクトする処理が出来た。','2021-11-14 10:53:39','2021-11-14 10:53:39'),
