	(10835,19032,698,4,'PHP自作','【今回】\nオリジナル作成のタスク管理機能を大体終わらせることができた。\n\n残るところは2つウィンドウを出していた際の対策で、1つの画面で「タスク完了」と削除してももう一つの画面ではデータが残ってさらに削除ができてしまったり、\n\n片方でチェックボックスに印を入れているにもかかわらずもう１つの画面でもチェックができてしまう状態なので、片方が既に動作を行なっているものは「既に〇〇済みです」などのアラートが出て、削除されたものであればそのままデータを消すようにしたい。\n\n-------------------------\n【発生したエラー】\n・SyntaxError: Unexpected token < in JSON at position 1\n→jsonを扱う過程でexit;を記述し忘れてしまい、本来読み込まれないHTML部分が読み込まれたことによってエラーが起きた。\n-------------------------\n【次回】\nタスク管理機能を完成させる。\n社員情報のデータベースとテーブルを作成し、ログインページと繋げる\n\n【進捗】\n《PHP》\n・非同期処理を行なったタスク管理(Todoリスト)　95%\n・項目ごとに分けて表示する掲示板 未着手\n《JavaScript》\n・カウントダウンタイマー 完了\n・ストップウォッチ 完了','2021-11-16 10:11:23','2021-11-16 10:11:23'),
	(10836,18892,697,4,'自作修正と発表資料作成','本日は自作のオリジナル機能を修正しつつその後に自作の実装動画とzipファイルを提出し確認をもらいました。\n\n発表資料はほとんど完成したのですが、自作の方で修正が必要な箇所が見つかりその修正を後半は取り組みました。\n\n明日、講師の方にお時間をいただけたら自作のチェックをしてもらいたいと考えています。\n自作を作成していてこんな機能があったらさらにいいなと思える場面が多くあり、次に学ぶLalavelの時はAPI ,Azureを同時に学びつつ、どのような形で時s買うに組み込めるのか考えながら学んでいきたいと考えています。\n引き続きよろしくお願いいたします。','2021-11-16 10:16:34','2021-11-16 10:16:34'),
	(10840,19421,769,3,'4-4 課題４（お問い合わせフォーム）','全体ページのフッター部分ができていなかったのでそこを直しました。また。ボタンを押したらトップに戻ったり、スクロールし始めるとその背景が黒になったりするのをjsで行いましたが、エラーでうまく動かなかったので、jsの使い方、記述方法を見直したりしていました。そこを早く抜け、バリデーションの方に行けるように頑張っていきます。','2021-11-16 10:24:31','2021-11-16 10:24:31'),
