	(10881,19532,769,3,'4-4 課題４（お問い合わせフォーム）','今日は、ヘッダー、フッターを外部ファイルにして共通化することを行いました。上手くヘッターの部分ができていないので、元からやり直しましたが、まだうまくいっていないので修正をしていきます。あと、jqueryを使ってのトップに戻る様にしたり、ページ内での移動はできたので明日は外部ファイルの所とバリデーションに進める様に頑張っていきたいです。','2021-11-17 10:01:37','2021-11-17 10:01:37'),
