	(10885,18893,697,4,'資料課題提出、Git学習','本日は発表のパワーポイント提出からその修正、Git学習を行いました。\n\n特に困ったことなどはなく、発表会ではスライドがメインですが口頭で肉付けを多くする予定です。\n\nギットに関しては基本的なことは理解していたのですが、一から動画を拝見して忘れていた部分や理解がまだ追いついていなかった部分などもありました。\n以前、スクールに通う前に学習したGitの理解度はあまり深くまだ理解していなくもう一度しっかり学習できる機会なのでスピード感を持ちつつLaravelに入れるように頑張ります。\n\n引き続きよろしくお願いいたします。','2021-11-17 10:18:47','2021-11-17 10:18:47'),
