	(10921,18894,697,3,'ハンズオン','本日はGit hub共有と新しい項目のハンズオンを行いました。\nGitHubはすんなりと終えられたのですが、ハンズオンのVagrant がなかなか起動せず、起動したと思ったらその次がうまく行かず、Mac,Windows 両方試したのですが未だに解決できていません。\n以前、元々インストールしていたものがあったのでそのバージョン差異もエラー要因の一つでしたが他に原因があるかと思います。\n明日も引き続きよろしくお願いいたします。','2021-11-18 10:05:40','2021-11-18 10:05:40'),
