	(10969,19534,769,3,'4-4 課題４（お問い合わせフォーム）','今日はモーダルウィンドウとアラートの設定を終えました。その後にお問い合わせ内容をデータベースに入れる所で入力しても入らず設定をしていました。あとデータベースに入れれたらバリデーションをかけ、他ページから飛べないように設定していけば良いので、ここを日曜の13時すぐに出せるように、データベースの使いからしっかり復習していきたいです。','2021-11-19 10:20:03','2021-11-19 10:20:03'),
	(10970,18895,697,3,'LAMPハンズオン','本日は昨日の続きを行いました。\nLAMPの最後の工程まで進めたのですが、ツールをアンインストールしたりなどでだいぶ時間がかかってしまいました。\n最後のファイル表示がうまくいかず、調査中になります。\nスクールのカリキュラムの説明通りに行っているのですが、その通りにいかない場面が多くすごく困惑してしまいました。\n\nテラテイルにも質問を投下して解決するつもりです。\n引き続きよろしくお願いします。','2021-11-19 10:25:18','2021-11-19 10:25:18'),
