	(11005,19641,769,3,'4-4 課題４（お問い合わせフォーム）','今日は入力フォームをやっており、前日までデータベースに入れて値を取得して表示しようとしていたが、ここの課題はデータベースを使わないのでpostをつかって値の受け渡しをすることに切り替えました。今日、入力した値を確認ページで表示させ、それを送信で完了画面にいく所とバリデーションがかけれたので、後確認画面から入力画面に戻った時に入力内容が消えない様にすることとURLで遷移できないようにすることろなので、しっかり実装をしていきたいです。','2021-11-21 10:07:41','2021-11-21 10:07:41'),
	(11006,19644,829,4,'初めての勉強会でした。','javasquriptと、初めてjquerryを学習した。\ngoogleで調べなければ答えが見つからないと感じるようになった。\n調べたり、読回力をよりつけてカリキュラムにこれからも臨もうと思いました。','2021-11-21 10:08:20','2021-11-21 10:08:20'),
	(11007,18896,697,3,'LAMP再構築','本日は環境構築が前日からうまくいかなかったので全てアンインストールし直し、再度行うことや、各エラーの調査をひたすら行なっていました。\n\nバージョンを下げたり、色々な工夫をして行なってみたのですが、今までに起きてこなかったエラーが発生し、そのエラーもネットにはあまりでまわっていないもので講師の方も見たことのないエラーで頭を悩まされました。\n明日以降はWindowsで再構築し直してみようと思います。\n引き続きよろしくお願いします。','2021-11-21 10:10:32','2021-11-21 10:10:32'),
	(11008,19406,698,2,'PHP自作','【今回】\nsqlでエラーが立て続けに発生し、解決に追われている。\n・MySQL起動出来ず\n・PhpMyAdminにログイン出来ず\n・MAMPは再起動を行った。dockerなど他のソフトウェアは動いていない\n\n\n【次回】\n月曜に上記のエラー原因を見つけ、火曜からまた機能制作を行う。\n\nスクールとは無関係だが、\n右目を怪我してしまい、片目だとコードミスが多いため、少しでも良くなるよう治療を進める。\n\n\n予定では26日に完成としているので予定通りになるよう励む。','2021-11-21 10:11:59','2021-11-21 10:11:59'),
	(11012,19466,704,3,'PHP応用','課題2取り組み中です。選手一覧に国名を追加したいのですが、エラーのため課題１の資料も参考にしながら進めています。','2021-11-21 10:29:52','2021-11-21 10:29:52'),
	(11013,19661,602,1,'8-3todolist sendgridやmailgunの設定','本番環境でのパスワードリセットに必要なメールの実装に取り組んでおりました。\n再発行リンクを送るボタンを押下時５００エラーになり、エラーログが出てこなかったが、heroku config:set APP_DEBUG=trueでエラーを出力することに成功\n2段階認証がどうのこうの言うgmail側の設定かと思い2段階認証を有効にしてみたが、エラーのままでした。\nmailgunを使用してみましたが、5505.7.1リレーが拒否されましたのエラーが表示。\n.envファイルの設定がおかしい様でただいま調査中です。','2021-11-21 10:39:58','2021-11-21 10:39:58'),
	(11018,19471,761,3,'React×typescript基礎','・React×typescript基礎\n・Reduxtoolkit活用でstate管理\n・firebase基礎\n→ログイン＋タスク管理アプリ制作\n現在、Twitterクローン制作中','2021-11-21 10:47:31','2021-11-21 10:47:31'),
	(11019,19461,716,4,'4-4 課題４','html,css,jsの実装が完了しました。\n残りはphpだけなのでどんどん進めていきたいと思います。','2021-11-21 10:49:39','2021-11-21 10:49:39'),
	(11020,19637,700,3,'課題No,4-5＆5-1取組中。','4-5バリデーション機能をお問い合わせフォームへ実装について、確認OKが出たため5-1DB基礎へ移行。\nバリデーション機能実装については、確認画面から戻るを押下時、入力値を維持する設定については可能だったが、それ以降リロードしてもずっと保持され続ける為、unsetを使用してリロード時にリセットされるように変更を加えた。\n\n苦労した点として、入力画面にてエラーが出た際、同じフォームへリロードをかけることについてなかなか実装がうまくいかず、最終的には入力画面のPHPファイルにif文を使用し、エラーが出たか出ていないかで画面をリロードするか次の確認画面へ遷移するかを作成したが、当初はうまく実装できず、何が間違っているのかを一つ一つ検証しながらつぶしていったため、ここが苦労した。','2021-11-21 10:50:33','2021-11-21 10:50:33'),
	(11021,19657,621,4,'LAMP、Laravel環境構築','LAMPとLaravelの環境構築を行いました。\n環境を整えるにはターミナルで指示をして操作する。\nコマンドを少しでも間違える（空白なしなど）でもエラーが発生して上手くいかないのでコマンドは正しく実行する必要がある。','2021-11-21 10:58:49','2021-11-21 10:58:49'),
	(11022,19614,779,1,'コーディング応用','今回はコーディング応用を前回の引き続き行なった。\n作業していていまいち理解できてないところが所々あり、復讐時間を人よりも倍必要だと感じました。進歩も遅れているため、勉強時間を多くに必要。','2021-11-21 11:00:09','2021-11-21 11:00:09'),
	(11027,19675,757,3,'コーティング応用（３−１）','本日は前回行えなかったコーティング応用のカリキュラムを実施。\nなんとか記載の記事を確認しながら３−１は無事終了。\nだが、３−2のHP作成にて手詰まりとなってしまう。\nこういった０からの作成を行うに当たっての思考力・判断力に弱いと再確認させられた。','2021-11-21 14:13:24','2021-11-21 14:13:24'),
	(11030,19552,620,2,'4-4','入力フォームの課題2のバリエーションのXSS指定とスクロール処理をメインに行った。\nXSS処理に関しては、htmlspecialchars関数を使用してみたものの、うまく動作に反映できなかったので、placeholderで処理を行った。\nスクロール処理の関数がまだ残ってるので引き続き行う。\n送信できてませんでした。申し訳ごさいません。','2021-11-21 23:33:34','2021-11-21 23:33:34'),
