	(11052,19642,769,3,'4-4 課題４（お問い合わせフォーム）,4-5','とりあえず終わった為、提出した所画面サイズに応じた対応ができていないところやjsのバリデーションを勘違いしていた為、その直しをしていました。\nバリデーションをやっている時にアラート表示で複数項目をまとめてアラートで出す方法がわからず、一つずつでてしまう為そこを改善することと、一つ一つバリデーションにかかるように見直していきたいです。','2021-11-23 10:24:41','2021-11-23 10:24:41'),
	(11053,19737,772,3,'PHP基礎　4-1','本日はphp基礎4-1に取り組みました。\nターミナルでエラー表示が出てしまい改善するのに時間がかかってしまい進捗が遅くなってしまいました。\nまた、動画＋Web上の解説を見ながらなぜこのコードなのか、どのコードがどこに対応したものなのかを頭に入れることをもう少し意識して進めていきたいと思います。','2021-11-23 10:34:28','2021-11-23 10:34:28'),
	(11056,18632,668,4,'6-3 課題３（ログイン機能）','ログイン管理ページの作成を行なった。より実際のサイトで実装する内容に近づいた。データベースとの照合があるので、前回までに学んだsql文を生かしていきたい。','2021-11-23 10:43:35','2021-11-23 10:43:35'),
	(11057,19684,779,2,'コーディング３−３','HTMLで作業を進めていく中でタグが増えていくとCSSでつまづくことがあります。自分の中でのクラスやタグの繋がりなどがまだまだ理解が乏しいのだと感じました。\nコーディングの知識は今後必要不可欠なところなので一つも不安要素を残さずおこなっていきたい。','2021-11-23 10:45:17','2021-11-23 10:45:17'),
	(11058,19627,761,3,'React、typescript基礎','Twitterクローンアプリ制作\n→google認証機能の実装、メール・パスワード認証機能の実装。\n→firebaseとの連携','2021-11-23 10:51:22','2021-11-23 10:51:22'),
	(11063,19755,827,3,'コーディング基礎、JavaScript、ｊQuery','ｈｔｍｌ歴があった分そこはすぐに終わりましたが、次がタグ指定が悪いのか中々進めません。予習してきます。','2021-11-23 11:04:00','2021-11-23 11:04:00'),
	(11064,18897,697,3,'環境構築','本日はWindowsでの環境構築を再構築してみました。\n\nWindowsでも同じような症状が見られました。\nスクールに通う前にインストールしていたツールが複数残っていて、完全にアンインストールされていなかったものもあり、それを完全に消すことで不明なエラーの解決ができました。\nまた、Macでの構築は講師の方に尋ねた内容が自分の説明が至らなかったのかそこで微妙に違いがあり、解決が見えてきました。\nネット中のエラーを網羅するほどコマンドを打って試していたのでようやく前進できよかったです。\n引き続きよろしくお願いします。','2021-11-23 11:24:54','2021-11-23 11:24:54'),
	(11066,19697,704,4,'PHP応用','課題２の１〜6のうち２まで終了し、３に取り組み中です。\ndel_flgがあまり理解できていないのでしっかし調べたいです。','2021-11-23 11:38:11','2021-11-23 11:38:11'),
	(11068,19226,773,3,'4-4、4-5課題','今日4-4が完了した。\n難しかったところはやはりJS処理のところで躓いた。\nしかし検索して何とか処理を実装することができた。少しずつだが検索力が身についてきたと思う。次からはバリデーションの実装である。\nJS側とPHP側の両方で実装するということなので頑張っていきたい。','2021-11-23 12:19:25','2021-11-23 12:19:25'),
	(11083,19693,538,3,'8-3 課題３（TODOリスト作成）','8-3 課題３（TODOリスト作成）取り組み中です。','2021-11-24 03:19:32','2021-11-24 03:19:32'),
	(11087,19467,746,3,'2-2','toggleclass,removeclassを使ってclassの付け外しを行うことで、複数のボタンに対して対象のボタンがクリックされた時と違うボタンがクリックされた時で異なる動きを与える方法を学んだ。','2021-11-24 05:45:56','2021-11-24 05:45:56'),
