	(11094,19752,829,3,'3-2 サンプルサイト作成１','3-2 サンプルサイト作成１の作業中です。\nサンプルサイトのようなものを作成するのは久し振りの為、\nさまざまなWebページの「検証ツール」を見て、参考にしながら作成していこうと思います。','2021-11-24 10:05:11','2021-11-24 10:05:11'),
	(11095,19643,769,3,'5-1 課題１（データ参照・挿入・更新・削除）','今日は4-5まで終了した為、5に入りデータベースに値を入れる所から行いました。データベースには接続できていることは確認取れたが、データベースに値が入らない状況なのでコードを見直したり、検索していきたいです。','2021-11-24 10:06:00','2021-11-24 10:06:00'),
	(11098,19628,761,3,'React&typescript基礎','・tweet機能の実装\n・Reduxtoolkitの基礎学習','2021-11-24 10:27:59','2021-11-24 10:27:59'),
