	(11100,18633,668,4,'6-3 課題３（ログイン機能）','ログイン機能で新規か既存かでの条件分岐を加えた。そこで、ユーザー権限を加えるのに苦戦している。さらにデータベースを絡めるのにひとつのファイルに書きがちになってしまう。まだ綺麗にかくことはできないが、見やすさは今後の課題である。','2021-11-24 10:37:20','2021-11-24 10:37:20'),
	(11101,19801,653,3,'5－2　SQL　、　６－A 　ハンズオン','オブジェクト指向は考え方の問題なので、実践で身に着けていく必要があると感じました。\n単体テスト、結合テストといったことは前職も行ったことがあるので、関連付けていけるといいと思います。','2021-11-24 10:38:42','2021-11-24 10:38:42'),
	(11104,19777,825,3,'コーディング基礎','コーディング基礎の内容に取り組んだ。もともと知っていることが多かったが、知識として身についていない部分があることが確認できた。','2021-11-24 10:45:38','2021-11-24 10:45:38'),
	(11110,19787,574,2,'7-2','画像の選択、確認画面で表示、送信（保存）という流れを行っていましたが、一時保存した画像を移動させることができませんでした。\n別の移動方法や、移動させずに中止、失敗時に削除するというやり方で可能かどうか調べていきたいです。\n\n製造スケジュール予定\n\n11/24(水）機能制作\n11/25(木）機能制作、システム提出、機能修正、発表準備\n11/26(金）発表準備、発表','2021-11-24 12:17:43','2021-11-24 12:17:43'),
	(11111,19227,773,3,'4-5課題','今日からバリデーションの課題に入り、JSとPHPの両方でバリデーションを組み込む。今日は何とかJS側のみ実装することができた。\n明日はPHP側の実装を終わらせたい。','2021-11-24 12:58:39','2021-11-24 12:58:39'),
	(11122,18898,697,3,'Laravel 環境構築','本日は引き続き環境構築に励みました。\nスクールの手順とはだいぶかけ離れてしまっていますが、エラーを解決できています。\nですが、そのせいなのかわかりませんがLaravelに入った時にパッケージはインストールできるのに表示ができないなど手順通りにいかないことが多々あります。\nVagrant virtualbox の知見はだいぶ出来てきていると思うので早くコードに入りたいと思っています。\n引き続きよろしくお願いします。','2021-11-25 03:54:44','2021-11-25 03:54:44'),
