	(11133,18899,697,4,'Laravel環境構築','これまでvagrant,virtualboxzそしてlaravelの環境を作ってきて、ようやく自身のパソコンの原因が見えてきました。\nすごく長い時間構築になってしまい申し訳ありません。\nスクールの手順や記載されている通りにはなっていませんがインストールや構築自体ができていれば大丈夫とのことなので明日には構築を終わらせ、Todoリスト作成に入りたいと思います。必ず明日終わらせます！\n\nまた、早急に課題を終わらせDockerやその他のツールを触ってみたいのでそこに学習を向けられるよう頑張りたいと思います。\n引き続きよろしくお願いいたします。','2021-11-25 10:20:22','2021-11-25 10:20:22'),
	(11134,19829,574,2,'7-2','DBへの受け渡しエラー修正に時間がかかってしまいました。まとめて確認すると確認漏れや原因が分かりにくくなってしまうので、原因と考えられる要素に対して、1つずつ確認を行い素早く修正できるようにしていきます。\n\nスケジュール予定\n\n11/26(金）機能制作\n11/27(土）機能制作\n11/28(日）機能制作、システム提出、システム修正\n11/29(月）システム修正','2021-11-25 10:25:51','2021-11-25 10:25:51'),
	(11136,19699,704,3,'PHP応用6-2','本日午後から体調を崩してしまい、ほとんど進められませんでした...。\n今日はしっかり休んで明日こそ提出したいと思います。','2021-11-25 10:26:35','2021-11-25 10:26:35'),
	(11138,19808,769,3,'5-A ハンズオン（DB基礎学習）','今日は入力フォームで入力したデータをデーたベースに入れるところで値が入らず、検索をしたりしていました。デバックで少しづつやって行ったりすればできると分かったが、まずここのデータベースに入れることができないとシステム全般で成り立たないのでここの入れるところを頑張っていきたいです。','2021-11-25 10:39:11','2021-11-25 10:39:11'),
	(11139,19685,779,1,'コーディング応用３−２修正','今回はコーディングの修正を行いました。\nただコード作成するだけでなく、もっと相手の見やすいものを作る意識で作業を行なっていくように心がけたい。','2021-11-25 10:40:35','2021-11-25 10:40:35'),
