	(11186,18900,697,4,'Laravel 学習、todoリスト','本日は環境構築が無事に終わり、\nTodoリスト作成に最後に入りました。\nLaravelの環境構築までだいぶ時間がかかりましたが、それ以前の内容はよく言えば濃い学習ができたと思います。\nTodoリスト作成ではpgsql やLaravelコマンドやその他のコマンドなど理解するものが多いなと感じたので現場でも通用するように理解をさらに深めていければと思っています。\n引き続きよろしくお願いいたします。','2021-11-26 10:18:00','2021-11-26 10:18:00'),
