	(11191,19809,769,3,'5-A ハンズオン（DB基礎学習）','今日はデータベースにデータが入った為、データベースのデータを画面に表示させることろまで行いました。また、削除も行いましたが、削除を行うと全データが消えてしまったりしたので、ここを見直していきたいです。','2021-11-26 10:32:20','2021-11-26 10:32:20'),
