	(11203,19229,773,3,'4-5,5-A,5-1課題','今日は4−5が完了した。実装の際にXSS対策をどこで行うのがいいのかやセッション値の取り扱いを学習しながら実装できたので良かったです。\n今度からDBに入るのでしっかり勉強しながら進めていきたいです。','2021-11-26 11:19:01','2021-11-26 11:19:01'),
