	(11228,19870,621,5,'todoアプリ制作、herokuデプロイ','gitにはenvファイルは反映されないのでherokuにデプロイする際は、herokuに標準搭載されているファイルに設定を記述する必要がある。\n自動デプロイはgitと連動させるだけで簡単に設定できる。','2021-11-28 09:41:25','2021-11-28 09:41:25'),
	(11231,19906,718,3,'php自作','本日は、PHPの自作に取り組んだ。現在自分はどういうことができてどういうことは出来ないのかを考えた上で、どういったものを作りたいか考えた。企画は全体を決める大切なものなのでしっかり考えて自身の納得のいく作品にしていきたい。','2021-11-28 10:06:34','2021-11-28 10:06:34'),
	(11234,19904,829,3,'NO3 3_3','NO3 の3_3を取り組み中です。\n指示書を読んで、認識ミスがありサイト幅を間違えたりしてページを作成してしまった。\n繰り返しサイト等を読んで、読み間違いを防ごうと思う。','2021-11-28 10:13:17','2021-11-28 10:13:17'),
