	(11238,19861,574,2,'7-2','メッセージ関連、リクエスト関連の画面でエラー修正を行っていました。修正に時間がかかってしまいましたが、次回の勉強会には資料を作成して提出できるようにしておきたいです。\n\nスケジュール予定\n11/28（日）機能制作\n11/29（月）機能制作、全体テスト、修正\n11/30(火）全体テスト、提出、修正','2021-11-28 10:27:41','2021-11-28 10:27:41'),
