	(11242,19865,827,3,'カリキュラム2－1～5','if分とfor分に手こずりました。\n次のカリキュラムには進みますが、理解度を高めるためにこちらの復習も継続します。','2021-11-28 10:34:01','2021-11-28 10:34:01'),
	(11243,19908,769,3,'5-A ハンズオン（DB基礎学習）','今日は削除ボタンで削除するところをやりましたが、条件分岐でデータが入っているときは削除としても毎回お問い合わせページに行くとアラートがでて削除されるとこになったり、行のIDをうまく取得できていなったりして削除ができないのでここをうまく削除できるようにしっかりと考えていきます。','2021-11-28 10:34:21','2021-11-28 10:34:21'),
	(11244,19905,669,3,'4-4','入力チェックの設定しています。','2021-11-28 10:39:46','2021-11-28 10:39:46'),
	(11245,19745,716,3,'4-5 課題５（XSS、バリデーション、メール送信）と4-4 課題４（お問い合わせフォーム）','新しいことがかなり多くて理解に時間がかかってしまいました。\nバリデーションも残り値の保持のみ','2021-11-28 10:42:54','2021-11-28 10:42:54'),
	(11247,19909,839,2,'課題No1終了','カリキュラムに沿って、課題No1を終了致しました。\n自分なりに勉強していた時は、例に沿って入力するばかりでしたが、\n今回目標に対して、何が必要かを自分で考え、\nわからないことは検索し、調べるという作業に非常に時間がかかりました。\n基本的なことをもっと勉強したいと思います。','2021-11-28 10:45:40','2021-11-28 10:45:40'),
	(11255,19631,761,3,'タスク管理アプリ制作','ReactとTypescriptで\nタスク管理アプリ制作。','2021-11-28 11:19:54','2021-11-28 11:19:54'),
	(11261,19803,538,3,'8-3 課題３（TODOリスト作成）','8-3 課題３（TODOリスト作成）取り組み中です。','2021-11-29 07:11:27','2021-11-29 07:11:27'),
	(11265,19577,722,3,'４−３取り組み','４−3\n４、５問目取り組み','2021-11-29 14:39:54','2021-11-29 14:39:54'),
	(11268,18901,697,3,'Todoリスト学習','本日はLaravelとpgsql を用いてtodoリストの学習を行いました。\n\nLaravelのコマンドやMySQLとは違うpgsqlの学習は新鮮味がありより早く吸収しなければなと感じた1日でした。\n少しずつエラーは発生していますが、解決できているので問題ないかと思います！\n引き続きよろしくお願いします！','2021-11-30 03:43:08','2021-11-30 03:43:08'),
	(11271,19638,707,3,'バリデーションについて','jクエリのバリデーションを行なった。\nアラートにてバリデーションを行なったため、追加や改行部分に手間取ったが、配列の追加を行ったこととjsonを使用したことで解消された。','2021-11-30 07:52:08','2021-11-30 07:52:08'),
	(11272,19966,850,3,'JQueryが課題','HTML CSSの基本操作、JSの基本構文は理解。\n\n「課題2-2」でクリックされたボタンのIDを取得する方法「var id = $(this).attr(\"id\");」を見つけ出すまでにかなり時間がかかった。\n\n「課題2-３」でJQueryのanimateが何故か機能しなかったから調べる必要あり','2021-11-30 08:50:51','2021-11-30 08:50:51'),
	(11273,19966,850,3,'JQueryが課題','HTML,CSSの基本操作、JSの基本構文はかなり理解できた。\n\n「課題2−２」でクリックされたボタンのIDを取得する方法を導き出すのに時間がかかった。「var id = $(this).attr(\"id\");」\n「課題2-3」のanimateが何故かうまく機能しないから解決策を探す必要あり。','2021-11-30 08:54:25','2021-11-30 08:54:25'),
	(11279,19960,838,4,'CABテスト、No.1、No.2-3まで','13時よりCABテストを実施し、その後課題に取り組み始めました。\n16時前頃にNo.1の確認OKをもらい、その後19時までNo.2に取り組み、No.2-3実施まで完了しました。\n時間外でNo.2の残りを実施するつもりです。\n括弧同士の組み合わせなどを把握するのにまだ少し時間がかかってしまい、コードとしては問題なくても括弧不足でエラーが起きていることがよくあるので、カーソルを合わせずとも把握できるようにしたいと思います。','2021-11-30 10:17:41','2021-11-30 10:17:41'),
	(11281,19972,796,3,'PHP基礎　ループ','PHPのfor文のレッスンを終わらせることができました。\n終盤の問題になるにつれ考え方が難しくなっていき、時間がかかってしまいました。\n復習しつつ進んでいきます。','2021-11-30 10:26:01','2021-11-30 10:26:01'),
	(11282,18636,668,4,'6-3 課題３（ログイン機能）','ログイン機能とログアウト機能をつけることが出来たので、あとはユーザーによって機能を変える機能をつける。roleの列に値によって権限をかえ、表示を変えるようにする。','2021-11-30 10:27:37','2021-11-30 10:27:37'),
	(11284,19973,772,3,'php基礎　4-1,4-2','本日は引き続きphp基礎に取り組みました。\nスクール外の時間でタイムゾーンの問題が解決できず本日の最初の時間が取られてしまい目標より進捗状況が遅れてしまっているので4−２はすぐに終わらせて4−３に進めるようにしていきます。\n4−２は初めはなぜそのコードになるかわからなく、web上の答えから逆算したり、解説をみているとなんとなく仕組みがわかってきました。\n4−２の残り半分もこの調子で取り組んでいきます。','2021-11-30 10:34:12','2021-11-30 10:34:12'),
	(11285,18902,697,2,'postgres,todolist','本日は、postgresSQLとそれに関連するGUIやmigrateに関して深く調べ理解を深めました。\n以前から予期せぬエラーが度々発生していましたが、postgresSQLに関しても多くのエラーが発生し、その調査に時間がかかっています。\nLaravelに関しては動画などを参照しつつ、コマンドや書き方の理解をより深められるようにこれからしていおうと思っています。\nSQLやvagrant,laravelの関係性がいまいちリンクできていない状況がありその辺りも整理しつつ明日から行っていきます。\n引き続きよろしくお願いいたします。','2021-11-30 10:37:35','2021-11-30 10:37:35'),
	(11287,19832,827,3,'コーディング応用','タグ指定に慣れてきたので3に着手。レイアウトの予習をした上でまた次回取組みます。','2021-11-30 10:44:09','2021-11-30 10:44:09'),
	(11288,19929,769,3,'5-A ハンズオン（DB基礎学習）','今日も前回に引き続き削除を行いました。ajaxを使い、削除ボタンでアラートが出て、OKの時のみ消える様になったが、アラートが複数回でてしまう問題が起こっています。一回のアラートだけにしたいので、アラートの記述の部分の見直しをもう一度しっかりしていきます。','2021-11-30 10:44:21','2021-11-30 10:44:21'),
	(11292,19862,574,2,'7-2','ユーザーの削除、Ajaxで意図しない画面遷移、動きが発生し修正していました。\n本日中に提出はできませんでしたが、しっかりと修正を行い明日提出できるようにしたいです。\n\nスケジュール予定\n12/1（水）提出、修正後提出','2021-11-30 10:58:33','2021-11-30 10:58:33'),
	(11293,19680,773,4,'5-1SQL課題','今日はPHPとSQLの連携を勉強しました。\n前回の時にphpMyAdminをインストールしていたので、ブラウザ上でテーブルの作成や挿入、削除等の一連の動作を確認しました。\nまた課題のフォームの連携をしデータの受け渡しを行っている途中です。','2021-11-30 11:10:20','2021-11-30 11:10:20'),
	(11297,19632,761,3,'React・typescript学習','自作の準備。\nタスク管理アプリ制作のつづき。','2021-11-30 12:01:41','2021-11-30 12:01:41'),
	(11301,19785,648,3,'php応用','６−３取り組み中','2021-11-30 17:08:10','2021-11-30 17:08:10'),
	(11307,20017,850,4,'課題No.2クリア、課題3−1完了、課題3−２作業中','【本日の学び】\n本日はメディアクエリの学習メインに行っていました。また、先日学習したJQueryの要素の値の取得についてさらに理解を深めることに努めていました。（親要素、子要素に対しての値取得など）\n\n【進み具合】\n現時点で課題3−１を終わらせ、課題3-2のレイアウト設計＆webページ制作に必要となる知識を学習しています。\n\n【今後の予定】\n予定としては明日中に3−2を終え、再度メディアクエリの予備知識を習得してから3−３に取り組んでいこと思っております。','2021-12-01 09:09:42','2021-12-01 09:09:42'),
	(11308,20017,850,4,'課題No.2クリア、課題3−1完了、課題3−２作業中','【本日の学び】\n本日はメディアクエリの学習メインに行っていました。また、先日学習したJQueryの要素の値の取得についてさらに理解を深めることに努めていました。（親要素、子要素に対しての値取得など）\n\n【進み具合】\n現時点で課題3−１を終わらせ、課題3-2のレイアウト設計＆webページ制作に必要となる知識を学んでいます。\n\n【今後の予定】\n予定としては明日中に3−2を終え、再度メディアクエリの予備知識を習得してから3−３に取り組んでいこうと思っております。','2021-12-01 09:10:53','2021-12-01 09:10:53'),
	(11314,19711,610,3,'DB基礎','ＤＢハンズオンを終え、テーブル作成に入りました。\nまだ聞きなれないワードがたくさんあり、検索にも時間が\nかかりますが地道に頑張ります。','2021-12-01 10:08:22','2021-12-01 10:08:22'),
	(11315,19930,769,3,'5-A ハンズオン（DB基礎学習）','今日はアラート数回でてしまうのが治り、データベースのデータを削除できる様になりました。原因としては、whileの中に入っていたため、ループ処理が行われていたことです。また、引き続き、編集(update)を行いましたが、ここもIDに応じた値が取得できない状況であるため、見直さないといけません。削除、編集ボタンにはそれぞれのIDを振ってある為、受け取りの部分が原因であると考えます。これから明日の１３時まで実装を考えてIDに対した値が取得できなかったら講師の方に質問していきます。','2021-12-01 10:10:55','2021-12-01 10:10:55'),
	(11316,20021,838,4,'No.2、No.3','残っていた課題No.2の4,5を確認完了し、No.３に着手し始めました。\n1は実施完了し、現在3−2を実施中です。\n何となく作り方のイメージは沸いているので、今まで学習してきたことを応用して早めにクリアできるようにしたいと思います。','2021-12-01 10:20:35','2021-12-01 10:20:35'),
	(11317,19995,704,4,'PHP応用','6-3取り組み中です。パスワードの暗号化の作業中です。','2021-12-01 10:28:25','2021-12-01 10:28:25'),
	(11322,18637,668,4,'6-3 課題３（ログイン機能）','ログイン機能全て実装することができた。roleのカラムはセッションを使って保存しておくことで、ページ移動しても保持した値によって条件分岐できた。セッションを残しておくことは実際には危険なことなのでログアウトと同時に消すような処理も行なった。','2021-12-01 10:47:29','2021-12-01 10:47:29'),
	(11323,20011,651,3,'phpでのバリデーション','jsのバリデーションが終わり、ｐｈｐでのバリデーションを制作中です。\n勉強会を２０時までと勘違いしており、日報の提出が遅れ申し訳ありません。','2021-12-01 10:49:14','2021-12-01 10:49:14'),
	(11329,20023,574,2,'7-2','昨日と同じく画面の修正を行っていました。\n画面を整えて、しっかりと修正を行い明日こそ提出できるようにしたいです。\n\nスケジュール予定\n12/1（水）提出、修正後提出','2021-12-01 11:17:52','2021-12-01 11:17:52'),
	(11330,19633,761,3,'Laravel基礎','・Dockerで環境構築\n・artisanコマンドの理解\n・Reactの組み込み\n・Todoリスト作成','2021-12-01 11:21:12','2021-12-01 11:21:12'),
	(11336,19681,773,3,'5-1課題','今日はDBにフォームの内容を登録する時にセッションが切れてしまい、完了画面に遷移できなくなってしまったのを修正した。\nセッション作成時にトークンを作成しパラメータとは別枠でセッションを\n完了画面まで運びこむことに成功し、無事完了画面に遷移できるようになった。','2021-12-01 12:59:49','2021-12-01 12:59:49'),
	(11339,19790,537,3,'データベース','pdo\nデータベース接続\nselect文\nmySQL','2021-12-01 14:22:39','2021-12-01 14:22:39'),
	(11340,20111,779,3,'日付の誤り','日付謝って参加してしましした。','2021-12-01 14:47:27','2021-12-01 14:47:27'),
	(11343,20037,648,3,'php応用','６−３取り組み中','2021-12-02 03:57:06','2021-12-02 03:57:06'),
	(11344,18903,697,4,'Laravel周辺環境再構築','本日は発表もあったので、その準備と少し修正を行い、その後はLaravelのエラーが立て続けに起きていたので再構築をおこなっていました。\n\n講師の方に幾つか質問していたのですが、環境構築はトライアンドエラーで詰まると時間がかかることだけれどトライアンドエラーを繰り返してやってみてくださいとのアドバイスをいただき、その言葉が励みになり大きく進歩できました！\n\n面接練習も始まり忙しくなりますが、引き締めていきます！\n引き続きよろしくお願いいたします！','2021-12-02 03:57:44','2021-12-02 03:57:44'),
	(11351,20130,779,1,'コーディング３−３','細かい設定がまだ理解できていないです。\nレスポンシブ時にレイアウトの崩れが目立つため、引き続き作業に取り組みたい。','2021-12-02 09:35:19','2021-12-02 09:35:19'),
	(11353,20094,850,3,'課題「3−１」「3−２」クリア','【本日の学び】\n課題3−２に取り組んだことでレイアウト作成の流れを経験し、HTML・CSSの扱いに慣れてきました。\n\n【今後の課題】\n明日再度メディアクエリの扱い方、今までの復習をメインに行っていき、\n準備ができたら課題3−3に手をつけていきます。','2021-12-02 09:54:31','2021-12-02 09:54:31'),
	(11355,18904,697,4,'Todoリスト、Laravel再構築','本日は昨日講師の方と何度もやりとりしていたDB接続を初めに行いました。\n何度も何度もトライアンドエラーを繰り返し、どこをどう見ればよいのか、そのエラーの場合はどの道順を辿ればいいのか理解が深まってきました。\n終盤では無事解決でき、本格的にtodolist の作成に入ることができると思います！\n面接練習などが入ってきますが、しっかりと準備を怠らず1月から引き締めていけるよう頑張りたいと思います！\n引き続きよろしくお願いいたします！','2021-12-02 10:02:44','2021-12-02 10:02:44'),
	(11366,20038,648,3,'php応用','６−４取り組み中','2021-12-02 10:43:15','2021-12-02 10:43:15'),
	(11370,20101,838,3,'3-2','昨日に引き続き3−2に着手していました。\nこう作ればできるだろうというイメージはあるが、思い通りにできず時間がかかってしまっています。','2021-12-02 10:55:12','2021-12-02 10:55:12'),
	(11372,19963,769,3,'5-1','今日はデータベースのデータ編集まですることができ無事に5-1をクリアすることができました。編集でデータ取得の際に少しつまづきました。データを表示する際に、編集パスにIDを渡す記述がうまくできていないのが原因でした。ここのIDデータ取得で今後ミスをしないようにもう一度復習して行きます','2021-12-02 11:06:03','2021-12-02 11:06:03'),
	(11381,19682,773,3,'5-1課題','今日はSQLへの登録と編集更新、削除機能を実装した。\nその時にディレクトリ構成を少し考えながら実装してみた。\nそのためパスが違ってしまったので修正に手間取った。','2021-12-02 13:50:10','2021-12-02 13:50:10'),
	(11384,19775,668,4,'6-4確認テスト（お問い合わせ作り直し）','mvc形式でcafeのサイトを作り直しを行なった。基本的にphp応用で取り組んだ。内容をそのまま当てはめていくが、パスの構造がまるっきり買えわっているので、画像の反映やうまくrequireやheaderで呼び出し、リダイレクトできないので、その修正が必要。','2021-12-03 03:00:43','2021-12-03 03:00:43'),
	(11386,19634,761,3,'React,Typescript学習','タスク管理アプリの制作の続き','2021-12-03 04:20:37','2021-12-03 04:20:37'),
	(11387,20231,839,3,'課題No2終了','backgroundのdが入っていないなど、正しいコードを書けているにも関わらず、\n動かないという凡ミスが多かったので、一文字一文字確認が必要だと思いました。\n分からないことを書き出して、調べてると、時間がかかる作業ですが、\n一番身につくので、これからも続けて行きたいと思います。','2021-12-03 05:03:38','2021-12-03 05:03:38'),
	(11389,19996,704,4,'PHP応用「','申し訳ありません、昨日日報を提出するのを忘れてしまいました。\n昨日は課題6-3を終了し、今日から6-4(確認テスト)に取り組みます。','2021-12-03 06:05:19','2021-12-03 06:05:19'),
	(11392,20230,700,3,'課題５-1DB作成','課題５－１DB作成について前回より着手中。\nDBに実際にフォームから登録された内容を反映することがうまくいかず、苦戦したが、DB側の設定に問題があることを確認して(DB自体には接続はできて、trycatchで自分が設定したエラー文がかえってくるので)、修正したところ登録動作は完了。\n続いてコンタクトフォームにテーブルを作成したり等で本日提出。\n現在確認待ち。','2021-12-03 09:03:20','2021-12-03 09:03:20'),
	(11394,20202,850,5,'課題3−3クリア','【本日の学び】\nメディアクエリを使用したWEBページのレスポンス対応の応用を課題3-3で行いました。\n\n【今後の課題】\n課題No.1, No.2, No3がスクールが開始して四日で完了してしまったので、JQuery、レスポンス対応の操作を忘れないよう復習しつつ、PHPの学習を進めていこうと思っています。','2021-12-03 09:34:07','2021-12-03 09:34:07'),
	(11396,19815,740,3,'2-2','体調不良の為殆どできてないです','2021-12-03 09:55:00','2021-12-03 09:55:00'),
	(11397,20243,829,3,'NO4 課題１（PHP基礎構文）','NO4 課題１（PHP基礎構文）取り込み中です。\nPHPの基礎の記述の仕方等を調べた後に、コードの作成に取り組みます。','2021-12-03 10:01:14','2021-12-03 10:01:14'),
	(11402,20224,838,3,'3-2,3-3','昨日に引き続き3−2に着手し、確認OKをいただきました。\n続いて3−3に着手し始めました。3−2に少し手間取った分、多少理解が深まったので、今のところ順調に作成できています。','2021-12-03 10:15:24','2021-12-03 10:15:24'),
