	(11415,20238,574,2,'7-2','サイト全体の確認と資料作成を行っていました。時間がかかってしまいましたが、次回こそ提出したいです。\n\nスケジュール予定\n12/5（日）提出、修正完了','2021-12-03 10:41:19','2021-12-03 10:41:19'),
	(11417,19964,769,3,'5-2 課題２（SQL基礎・応用問題）','今日はSQLの使い方で複数のrテーブルからデータを取得するやり方を学びました。余計なところに空白を入れたりしていると「エイリアスがついています」とエラーが出たりする為そこら辺も注意して行って行かないといけないと思いました。また、BETWEEN句やIN句、LIKE％などの使い方などをコメントアウトで使い方としてまとめたので見返していきもっと理解していきたいです。','2021-12-03 10:52:42','2021-12-03 10:52:42'),
	(11418,19776,668,4,'6-4 確認テスト（お問い合わせ作り直し）','cafeのお問い合わせをmvcで作り直すことができた。前回と違いエラーメッセージをページを遷移する時にセッションを使い保持させた。requireを使い同じページ内をぐるぐる回すような構造だったのでひとつのページに増長になってしまっていた。今回学んだmvcを使い、ファイルを分けることで使い回ししやすくなった。','2021-12-03 10:54:52','2021-12-03 10:54:52'),
	(11423,18905,697,3,'Laravel Todoリスト','本日はLaraveltodoリストの作成を行いました。\n前半は面接練習とその対策に時間をかけたので後半に本格的にリストの組み立てを行いました。\nLaravelは手順と仕組みが分かればある程度大丈夫な感覚があります。\n\n何度も繰り返してLaravelを定着していきたいと思います！\n引き続きよろしくお願いします！','2021-12-03 11:00:17','2021-12-03 11:00:17'),
	(11431,19683,773,3,'5-2課題','SQLの問題集を解き続けています。\n特に躓いていないが何をやっているか後で見返してみても\n分かるようにコメント入れておくようにする。','2021-12-03 12:55:00','2021-12-03 12:55:00'),
