	(11446,20294,602,5,'Linux基礎/フレームワーク','カリキュラム8が終了致しました！\n最後のパスワードリセットのエラーにつきましては\nheroku側の設定がLaravel7系からはMAIL_DRIVER=mailgunと設定しなければいけないところを\nMAIL_MAILER=mailgunと誤って記載していたのが原因でした。\n何回も見ていた記事をもう一度見直すと発見できた内容でした。\nこういった事も何回も起こしております。\nここから実務に入らせて頂くことになりますが、\nこういったミスを無くしていくよう努めて参ります。','2021-12-05 00:38:07','2021-12-05 00:38:07'),
	(11447,20356,757,3,'コーティング応用','本日は課題３−３「サンプルサイト作成2」に取り組む。\n今までの応用を活かし基本ベースの作成はかかるも、完成とは至らず。','2021-12-05 03:10:16','2021-12-05 03:10:16'),
	(11448,20148,716,3,'DB事前準備','残りCRUD処理、SQL命令の種類の理解です。\n終わり次第テーブルの作成です。\n今週、来週までにDBが終わるように調整する。','2021-12-05 03:19:16','2021-12-05 03:19:16'),
	(11449,20338,745,3,'サンプルサイト2の作成','本日はレスポンシブを導入しましたが、サイトが全体的に左寄せになってしまっているので中央寄せに調整出来れば完成になると思います。','2021-12-05 03:22:09','2021-12-05 03:22:09'),
	(11452,20327,850,4,'課題4−1クリア, 4−２作業中','【本日の学び】\n昨日の休みではPHPの基本構文をUdemyで学習し、本日はforループを使ったアルゴリズムの課題を行いました。\n\n【今後の課題】\nこれからはコーディングが複雑になってくるはずなので基本をしっかりマスターし、徐々に使用できる関数を増やしていこうと思います。','2021-12-05 08:33:59','2021-12-05 08:33:59'),
	(11455,20354,839,3,'3_2サンプルサイト作成１まで','3_1は問題なく完了することができました。\n現在3_2を取組み始めました。\n一つ一つの画像やコンテンツを表示するのはできたので、\n指示通りに組み立てています。\n丁寧に時間をかけて行えば完成すると思いますが、\n目標日数でできるよう努めたいと思います。','2021-12-05 09:26:34','2021-12-05 09:26:34'),
	(11457,20014,707,4,'バリデーション完成','バリデーションの作成が完了した。\n最初はcontact自身にリダイレクトしようとしたが、プログラムが動かなく手間取りリダイレクト先を変更した。\nまたsessionによる受け渡しもカリキュラムを通して学んだ。','2021-12-05 09:46:29','2021-12-05 09:46:29'),
	(11467,20295,838,3,'3−3','先日に引き続いて3−3に着手し、確認OKまでいただきました。\nOKはいただきましたが、サンプルに比べて異なり、その形にうまく合わせることができていないという点で納得できていないので、復習して確認しようと思います。','2021-12-05 10:33:44','2021-12-05 10:33:44'),
	(11468,19998,704,4,'PHP応用','今日提出したかったのですが、残念ながら間に合いませんでした。\nほぼ完成したので、明日仕上げて火曜日に提出するようにしたいです。','2021-12-05 10:38:08','2021-12-05 10:38:08'),
	(11469,20240,769,3,'5-2 課題２（SQL基礎・応用問題）','今日はSQLの練習問題の基礎を終えることができました。条件体重が９０k以上ある場合などの時はWhere句を使ったり、UNION、UNION ALLの使い分けから内部結合、外部結合の記述を知ることができました。自分的に副門合わせが難しく思ったので、ここを中心に全体の復習もしていきたいと思いました。','2021-12-05 10:38:49','2021-12-05 10:38:49'),
	(11470,19757,697,3,'面接練習対策、Laraveltodo','本日は来週の面接練習に向けての準備とTodo list作成を行いました。\n\n面接で聞かれて詰まりそうな単語はなるべく避けるようには考えているのですが、もっと相手を誘導させられるような言葉を考えなければなと感じています。\n\nリスト作成は覚えることが多いなという印象で、どの機能を実装する場合の手順などもっと理解が得られればと思っています。\n引き続きよろしくお願いします','2021-12-05 10:50:06','2021-12-05 10:50:06'),
