	(11497,20477,700,3,'（SQL基礎・応用問題）取組中','phpmyadminからmysqlを実行して練習問題に取組中。\nこの課題5を始める前の事前勉強にてmysql実行して各項目を検索することを一通りやっていたため、調べつつではあるが序盤はスムーズにできたが、\n後半になるにつれ色々とエラーが頻発し、苦戦。\n一通りは終えたものの、調べた内容をそのまま実行し検索結果を表示しているにすぎないので、もう一度問題とmysql実行文を照らし合わせてデータ取得のやり方を勉強中。','2021-12-07 08:58:08','2021-12-07 08:58:08'),
	(11498,20328,850,1,'課題4-2クリア 課題4-3作業中','【本日の取り組み】\n今日はPHPのポーカーの役判定のアルゴリズムに取り組んだのですが、今までの課題の中で1番悩みました。また、完成したと思って提出した課題が実際にはうまく機能していなかったので反省です。\n\n【今後の課題】\n実際の現場ではちょっとしたミスが致命傷になるはずなのでしっかり確認作業を行い、作業ペースよりも確実性を当分は重視していこうと思います。','2021-12-07 09:24:12','2021-12-07 09:24:12'),
