	(11515,20484,574,2,'7-2','ajaxや検索が想定通りの動きではなかったため、修正していました。\n1つの機能に対して、最後まで記述してから確認をしているので、細かく区切って修正して完成させたいです。\n\nスケジュール予定\n12/8（水）ajax、検索機能修正\n12/9(木）提出、修正完了','2021-12-07 10:29:32','2021-12-07 10:29:32'),
	(11516,20368,704,5,'7-1PHP自作','PHP応用6-4を提出し、OKをいただきました。\nPHP自作を開始し、7-1作業中です。','2021-12-07 10:31:30','2021-12-07 10:31:30'),
	(11518,20424,796,1,'PHP基礎','本日はポーカーの役を自動判定するプログラムの作成を行いました。\nまだ、半分も終えてないくらいの進捗です。\n考えたことを処理として書くのが難しく、先週から進みが悪い状況です。\n引き続き、理解することを第一に進めていきます。','2021-12-07 10:42:55','2021-12-07 10:42:55'),
	(11519,20135,668,4,'7-1設計','新しく自作演習に入り、さらに実践に近いものになった。ここでの流れをしっかり学習し、現場でも活かせるように大変なところや工夫できたところなど自分の力にしていきたい。','2021-12-07 10:43:13','2021-12-07 10:43:13'),
	(11523,20241,769,3,'6-A ハンズオン（オブジェクト指向キーワード調査）','今日から課題6に入ることができました。MVCの構造の所で、自分が前に学んだ、railsのように別ファイルに記述する内容を分けていくということがわかりました。インスタンス変数の使い方などどんどん学んでいき、課題7で自分の作りたいサービスを作れるように頑張っていきたいです。また、自クラスのメソッドを呼ぶときは、＄this->をつけて呼び出すということがわかりました。これから今まで以上に難易度が上がってくると思うので、ノートに大事なことをメモったり、コメントアウトでどんどんメモしていったりしていきたいです。','2021-12-07 10:51:11','2021-12-07 10:51:11'),
	(11525,20416,838,4,'4-1','4−1に取り組んでいました。\nPHPのコード自体は他の言語と大差ないのでそこまで苦戦はしませんでしたが、PHPの導入や設定に少し苦戦しています。','2021-12-07 10:54:21','2021-12-07 10:54:21'),
	(11528,20267,761,3,'Laravel基礎、AWS基礎','LaravelとReactを連携してTodoリストの制作。\n→Dockerで環境構築\nAWS基礎学習\n→UdemyでVPC,EC2、IAM を学習。','2021-12-07 11:04:51','2021-12-07 11:04:51'),
	(11532,19916,773,3,'5-2,6-1課題','今日はSQLとPHP応用課題を行なった。\nSQLの操作や基本的な文法は学べたと思っていたが確認テストでは\n結果はあまり良くなかった。課題を行いながら時間ができたらSQLの\n復習をしておく。\n応用課題では、オブジェクト指向を学んでいる。しっかりと理解してから\n進み、コメントアウトを活用し後で見返した際にわかりやすいようにする。','2021-12-07 13:02:18','2021-12-07 13:02:18'),
	(11533,19993,837,3,'HTML','HTML基礎','2021-12-07 13:08:42','2021-12-07 13:08:42'),
	(11541,19010,563,2,'xampp バグ対処','エラーが出てApacheが起動しない事象の対処\n重複ポート等試しましたが、そこまで進捗が進んでいないため万全を期して、再インストールを行いました。\nそれに伴い壊れたDBの改修とバックアップを行いました。\n調べたところ稀にxamppで適切な閉じ方を行わない（×で閉じるなど）と、今後注意したいです。','2021-12-07 21:46:07','2021-12-07 21:46:07'),
	(11542,20489,872,5,'コーディング基礎','1_4 画像の表示\n1-3 flexbox\n1-2 marginとpadding\n1-1 複数要素の配置\n1-D id,classについて\n1-C css基礎知識\n1-B html基礎知識\n1-A 学習の準備','2021-12-07 23:16:31','2021-12-07 23:16:31'),
	(11544,19758,697,3,'面接練習、対策','本日は面接練習、対策をメインとして行い、残った時間でLaravelの残っているエラーを調べていました。\n\n面接に関してはもっと柔らかく会話ができるようにしなければなという印象です。\nLaravelのほうはほぼ完成していてエラー箇所とデプロイ環境を整えれば終わるので早急に完了させたいと思います。\n引き続きよろしくお願いいたします。','2021-12-08 01:17:04','2021-12-08 01:17:04'),
	(11548,20485,648,3,'PHP自作','７−１取り組み中','2021-12-08 04:00:47','2021-12-08 04:00:47'),
	(11552,20500,850,3,'課題4−３クリア','【本日の活動】\n昨日、今日とでポーカーのアルゴリズムの課題に取り組みついに課題をクリアできました。ただ、プログラムが少し複雑になってしまっているので、もう少しシンプルにできたんじゃ無いかと思います。\n\n【今後の課題】\nなるべくシンプルなプログラムを作っていくために、使えそうなメソッドをもっと身につけ、固執せず柔軟にプログラムを作っていこうと思います。','2021-12-08 08:41:42','2021-12-08 08:41:42'),
