	(11572,20465,769,3,'6-1','今日はMVCの所を行いました。昨日の続きでテキストを見て行っていましたが、途中でエラーでうまく表示されなくなってしまい、見比べたりしていましたが、改善されなかった為、もう一度初めから作り直しました。ここに時間を使ってしまったのがいけなかったです。現在、詳細ページの作成で選手毎に表示されるようにして、明日提出できるように頑張っていきます。','2021-12-08 11:02:33','2021-12-08 11:02:33'),
	(11574,20136,668,4,'７−１　設計','テーマを決めるのに時間がかかった。自己満足のサイトでは意味ないので、需要のありそうなものをテーマにした。本日はさらに、マトリクス表を作りサイトの遷移表を作るためにデザイン還付のようなものに取り掛かった。早く形にできるように素早くやっていく。','2021-12-08 11:05:42','2021-12-08 11:05:42'),
	(11577,20436,565,3,'5-2 課題２（SQL基礎・応用問題）','基礎問題の問42を、講師のアドバイスを参考に解くことができた。\n応用問題の数問に苦戦しているので、SQLの文法を改めて見直して調べていく。','2021-12-08 11:41:08','2021-12-08 11:41:08'),
	(11579,19917,773,3,'6-2課題','6-2課題に入り前回作成したものに機能追加を行っている。\n①選手の国表示は難なく表示できたものの、次の②得点履歴の\n表示でもたついた。最初は一つの関数、sql構文ですべてを表示させようとしていたが、難しく大変だった。しかし得点履歴専用の関数を作成することで解決できた。あとはvar_dumpを使いしっかりとデータが流れているか確認しながら実装できた。','2021-12-08 12:44:00','2021-12-08 12:44:00'),
	(11583,20486,648,3,'PHP自作','７−１取り組み中','2021-12-08 13:34:32','2021-12-08 13:34:32'),
