	(11589,19761,697,3,'面接練習、todo作成','本日は明日の面接に向けての準備と引き続いているtodoの作成を行いました。\n面接に関しては自信を持って話すことはできると思うのでいかに一緒に働きたいと思わせられるかという視点を持って取り組んでいきたいと思っています。\ntodoに関してはほとんど完成なのですが、認証機能の方で手順通りになかなか進まないことが多く、homesteadを用いて再度構築してみたいと考えています。\n引き続きよろしくお願いいたします。','2021-12-09 01:41:42','2021-12-09 01:41:42'),
