	(11639,19760,697,3,'面接練習メイン、homesteadでLaravel環境構築','本日は、松下さん同席の面接練習をさせてもらいました。\nエンジニア目線のさまざまな質問をいただき、フィードバックも多くいただき今後の面接での糧になりました！\n自身の足りない部分であったり、実際に一緒に働きたいと思ってもらえるのかどうなのかという視点がさらに重要であることを再度確認できたと思います。\n本番ではしっかりを自分を伝え、相手が働きたいと思えるような受け答えをしていきたいと思っています。\n引き続きよろしくお願いいたします。','2021-12-10 04:02:51','2021-12-10 04:02:51'),
