	(11674,19919,773,3,'6-2-4課題','今日は選手情報の論理削除の続きを行なった。\n論理削除の仕組みを理解できたのですが、sqlへの更新方法に手間取りました。そこでsqlの接続等を見直し変数一つ一つのがどういうものなのかを見直し、またエラー文を読み解くことで解決することができました。\n次は編集機能の実装に取り掛かります。','2021-12-10 12:33:22','2021-12-10 12:33:22'),
	(11676,19762,697,3,'面接練習、環境再構築','本日は、Laravelの環境構築を様々な仮想環境を用いて構築する練習を兼ねて行いました。\nHomestead,valet,dockerなどです。\ndockerに関してはもう少し理解が必要かなと感じました。それ以外はうまく出来たと感じています。\nTodoの方がLaravelのバージョンが最新なのが行けないのか、手順通りに作成してもなかなかエラーが治らず苦労しています。\nWindowsの方でも行っていますが、ベイグランドやvmの時にだいぶ構築に苦労してどこがいけないのかだんだん早期にわかってきました！\n来週からは本格的に面接が入るので引き締めていきます！','2021-12-10 15:26:13','2021-12-10 15:26:13'),
