	(11703,20683,850,4,'課題4−４取組中','課題4−4のトップページのメニューバーのスクロール追従、指定したコンテンツへのスクロール移動の実装、お問い合せページの入力画面、確認画面、完了画面のレイアウトが完了し、現在入力内容の正規表現チェックを進めています。サインインに関してはまだ手をつけていません。\n\nここ数日間は課題よりも今後のためにレスポンシブ対応（flex box, css grid）の理解とJQueryの学習をメインに進めていました。この数日でかなり実力がついてきたような気がします！','2021-12-12 09:28:57','2021-12-12 09:28:57'),
	(11707,19766,697,3,'Laravel取り組み','本日はLaravel8のバージョンで色々変わった部分があるとのことでしたのでそれを踏まえてもう一度リスト作成に入りました。\nほとんどの手順は理解できていて、環境構築であったり、接続に時間を要しています。\nLaravelに関してはAmazonで書籍を購入し、12月いっぱいLaravelに力を入れられたらと思っています。\n14日には面接の調整ができていたら面接が入るかもしれないのでそれに向けて準備したいと思います！','2021-12-12 10:03:08','2021-12-12 10:03:08'),
	(11710,20625,769,3,'6-2','今日は、金曜の夜から土曜日まで悩んでいた選手詳細に得点歴をしっかりと表示するとこができました。得点を入れた選手は表示できていたが、得点を入れていない選手は得点の値がない為、プレイヤー情報も表示されませんでした。原因として、内部結合で行っていた為です。外部結合にしてみると表示できたので値がない(NULL)の時は、外部結合で行っていくと今回でわかったのでよかったです。\nまた、今日は論理削除まで行え、編集のフォームを作り、モデル、コントローラーを記述していくところです。cafeの所で行った物も振り返りながら、考え進めていきたいです。','2021-12-12 10:12:01','2021-12-12 10:12:01'),
