	(11716,20702,772,3,'php基礎　４−２','本日もphp基礎に取り組みました。\n思っている以上に進まずかなり進行度が遅れています。\nやり方などを見直し遅れを取り戻していきたいと思います。','2021-12-12 10:36:06','2021-12-12 10:36:06'),
	(11725,20459,773,3,'6-2-5課題','今日は6-2課題の編集機能追加を行った。\nMVCのデータ受け渡しは問題なく送信されているのでSQL更新できたと\n思っていたが、実際にはSQLの方では更新されていなかった。\n原因を探るためvar_dumpでデータを一つ一つ確認してみると\nSQL更新の際のexecuteの後にエラーが発生していることが判明した。\nそこでexecuteの後に$stmt->rowCountで更新しようとしたカラムを\n確認すると違う（1なのが0）ことが判明。\n更新するidがしっかりと受け渡せていないことが原因と突き止めるところまで進んだ。次回までに解消していく。','2021-12-12 11:18:02','2021-12-12 11:18:02'),
