	(11788,20774,620,3,'4-4提出・修正','講師より、includeが2つあるので1つにまとめて、doctypeを消して提出した。fotterの部分でdoctypeを消すと、エラーが発生するので、cssを修正して再度提出する。','2021-12-14 14:31:54','2021-12-14 14:31:54'),
