	(11790,20139,668,3,'7-1設計','画面遷移書が完成した。サイトの構造を把握するのに大事なところなので、誰が見てもわかりやすいように作った。ER図と仕様書もあるので、そちらもわかりやすいように作成していく。','2021-12-14 15:30:10','2021-12-14 15:30:10'),
	(11798,20747,648,3,'PHP自作','７−１取り組み中','2021-12-15 03:57:52','2021-12-15 03:57:52'),
	(11800,20530,563,2,'cafe DB基礎','SQL基礎課題を進めました','2021-12-15 05:45:16','2021-12-15 05:45:16'),
	(11809,20802,722,1,'4-3取り組み','４−３を提出したが、役判定に見落としがあり再提出となった。\n手札に０（存在しないので不正で出力）がある状態でストレートの判定が\n出たため、チェックを行っていたが修正方法がわからないまま時間を終えた。\n次回の出席は日曜日だが、それまでに修正を終えたい。','2021-12-15 09:49:38','2021-12-15 09:49:38'),
	(11812,20422,611,3,'4-4 課題4','4-4 課題4','2021-12-15 09:53:43','2021-12-15 09:53:43'),
	(11813,20803,850,3,'課題4-5クリア MySQL環境構築完了','時間がかかりましたがついに課題4-4と4-5が完了しました。\n今回の課題でかなり手を動かしたのでjQueryとPHPのコーディングがずいぶん楽になってきました。\nまたMySQLの環境構築が終わり、現在SQLの基本操作について学習しています。','2021-12-15 10:01:24','2021-12-15 10:01:24'),
	(11816,20826,769,3,'6-2','mvcでの編集を行いました。昨日に引き続き行いましたが、uniform_num 、position 、country_id が読み取れず、更新できない状況にあるという所です。\nもう一度、mvc構造の作りのカリキュラムから見直し、理解を深めここをできるようにして、進んでいきたいです。','2021-12-15 10:07:16','2021-12-15 10:07:16'),
	(11817,20807,827,3,'3-A','普段はdivタグを使わず画像化してしまう事が多かったのでcssで多少苦戦していますが、次回は完全＆提出致します。','2021-12-15 10:21:58','2021-12-15 10:21:58'),
	(11818,20816,774,4,'php基礎 4-1','php基礎 4-1(lesson1~13)まで取り組みました。\n一度で全部覚えようとせず、進みながら触れながら定着させていければいいなと思います。','2021-12-15 10:27:38','2021-12-15 10:27:38'),
	(11820,20708,704,5,'PHP自作','7-1設計が終了しました。\nスケジュールを作成しました。進捗は以下になります。\n今日のタスク：計画表作成\n完了予定日：12/15\n進捗率：100%','2021-12-15 10:31:56','2021-12-15 10:31:56'),
	(11821,20810,562,3,'php 4-5　バリデーション','前回に続きエラーの修正中','2021-12-15 10:39:15','2021-12-15 10:39:15'),
	(11823,20799,838,3,'4−3','引き続き4−3に着手していました。3まではあまり苦労しませんでしたが、４以降に時間がかかってしまっています。明日には確認してもらえるようにします。','2021-12-15 10:44:24','2021-12-15 10:44:24'),
	(11825,20140,668,4,'7-1 設計','仕様書とER図の作成に取り組んだ。仕様書は画面の機能をわかりやすく記述していき、ボタンごとで細かく遷移先もわかるようにした。ER図はテーブル毎でのリレーションを組むのが難しくまだ完全に理解できていないという感じなので、しっかり復習して取り組んでいきたい。','2021-12-15 10:49:15','2021-12-15 10:49:15'),
	(11831,20104,773,3,'6-3課題','ログイン機能実装を行っていたがroleによって権限を分けるところで躓き思うように進めることができなかった。\n明日はしっかりと実装できるように取り組んでいく。','2021-12-15 12:44:05','2021-12-15 12:44:05'),
	(11843,20748,648,3,'PHP自作','７−１取り組み中','2021-12-16 03:59:01','2021-12-16 03:59:01'),
	(11853,20755,826,4,'php4-4,5','php4-4,5','2021-12-16 09:02:51','2021-12-16 09:02:51'),
	(11854,20804,850,1,'課題5−１取組中','SQLのデータ操作、検索方法などを学習しました。また、PHPからphpMyAdminのデータベースに変数で定義した固定値を渡すことができましたが、Sessionやpostの値を渡す方法がわからず、現在息詰まっています。\n\nただ、sessionやpostの送信方法がわかれば、一気に進められると思います！','2021-12-16 09:47:32','2021-12-16 09:47:32'),
	(11864,20827,769,3,'6-2','今日も詰まってしまった編集の所を行いました。\nPOSTで値は編集ページから、編集完了ページに値の受け渡しはできているので、そこにまず、バリデーションをつけ更新ボタンを押すと引っ掛かるようにし、その後に更新できるようにするよう、1つづつ考えていきます。前回まで、一度にモデル、ビュー、コントローラーを触っていて、途中整理がつかなくなってしまったりとしていたのでここを改善していきたいです。ですが、時間のかかり過ぎもよく無いので、お客さんに納品することを頭に入れ引き続き実装に取り組んでいきます。','2021-12-16 10:30:44','2021-12-16 10:30:44'),
	(11865,20709,704,5,'PHP自作','７−２製造取組中です。\n本日の進捗は以下になります。\n\n取組内容：モック作成(1) [login, signup, about.php]のうち、\nlogin.php, signup.phpと共通のheader.php, footer.php\n進捗率：75%\n完了予定日：12/17','2021-12-16 10:38:25','2021-12-16 10:38:25'),
	(11866,20731,839,3,'3_1、3_2完了','3_1、3_2ご確認をいただき、完了することができました。\nサイトの幅の意味を勘違いしていたせいで、\nかなり完成まで遠回りしてしまったことが反省点です。\nこれは実際の業務中でも起こりうることだと思います。\n3_3は細かいところまで作業指示を確認を行い、\n作業に取り組み始めています。','2021-12-16 10:38:36','2021-12-16 10:38:36'),
	(11867,20607,779,1,'php４−２','for文のループ処理について学びました。\nfor文にはwhile文やforeach文などがあるので課題では指示に従った文を使用するが、もしwhile文だったらどういう構造になるのかなども考えながら進めていきたい。今後ポートフォリオ作成する時がきたらfor文を使用して、ログイン済んでるならホーム画面表示、済んでなければログイン画面表示するや商品在庫有れば在庫数表示してカートにいれるボタンをアクティブにし、在庫なければ在庫ありません表示して、カートに入れるボタンを押せなくするなど活用できたらいいなと思います。','2021-12-16 10:48:02','2021-12-16 10:48:02'),
	(11871,20749,648,3,'PHP自作','７−１取り組み中','2021-12-16 10:59:22','2021-12-16 10:59:22'),
	(11873,20793,826,4,'php4,5','php4,5','2021-12-16 11:40:09','2021-12-16 11:40:09'),
	(11875,20105,773,3,'6-3課題','ログイン機能の実装を引き続き行った。\nユーザー登録を実装できたがroleによって権限を分けるところで躓いている。\n良い方法がないか検討し実装していきたい。','2021-12-16 12:44:16','2021-12-16 12:44:16'),
	(11883,20780,537,3,'pdo','カラムを削除した際のポップアップ','2021-12-17 03:34:15','2021-12-17 03:34:15'),
	(11884,20141,668,4,'7-1 設計','仕様書の大部分は完成することができた。計画の段階ではあるが、予想以上に細かい作業が多くコーディングとは違う大変さを感じる。このままスピードをあげて作成していく。','2021-12-17 03:43:26','2021-12-17 03:43:26'),
	(11890,20893,838,3,'4-4','4-3の確認OKいただいたので4−4の取り組みを開始しました。ページ遷移など少しややこしいので時間がかかりそうですが、簡単なところから徐々に進めていくつもりです。','2021-12-17 09:28:23','2021-12-17 09:28:23'),
	(11892,20917,829,4,'4-2 課題２','PHPの必要な環境構築がようやく済んだようで、\nここからエラーを解消させていきながら4-2 課題２を進めていこうと思います。','2021-12-17 10:02:31','2021-12-17 10:02:31'),
	(11893,20805,850,5,'課題5-1取組中','昨日息詰まっていた点がありましたが、朝起きたらphpMyAdmin側の設定ミスのせいだったのに気づきすぐ解決できたので時間ロスがなく、今日は有意義に勉強できました。\n\nSQLの検索、挿入、更新、削除についてW3schoolsのドキュメントを読み込んだのでデータ操作はかなりマスターできました。また、mySQLの学習に入ってから世界観が広がった感じがしてかなり楽しくなってきました！','2021-12-17 10:08:49','2021-12-17 10:08:49'),
	(11894,20531,563,2,'データ参照　学習','課題２　１7まで','2021-12-17 10:17:39','2021-12-17 10:17:39'),
	(11896,20710,704,4,'PHP自作','フロントエンド制作中です。本日の進捗は以下になります。\nモック作成(1) [login, signup, about.php] 進捗100%　完了予定日12/17\nモック作成(2)  [index, admin.php] 進捗60%　完了予定日12/21','2021-12-17 10:32:08','2021-12-17 10:32:08'),
	(11897,20828,769,3,'6-2','今日は、登録時のバリデーションをかけましたが、それに対応してエラーメッセージの出力が常に出ている状況にあります。バリデーションはOKなのですが、ここのエラーメッセジをできるようにします。\nまた、今日学んだこととして、formアクションのpostでデータ送信する際にinput type hiddenで非表示にして値のみを送信するようにして、そのPOSTで送った値をコントローラーで受け取り、バリデーションに引っ掛かる時にページ遷移しずにそのページに滞在するようにリダイレクトで＄POST[\'id\']を使い行いました。データのみの送信のように日々学んだ事をノートに書くなりしてアウトプットしていき知識をつけていけるよう頑張っていきたいです。','2021-12-17 10:34:31','2021-12-17 10:34:31'),
	(11899,20900,796,2,'PHP基礎','本日もポーカーの役を自動判定するプログラムの制作を行いました。\nチェックをしていただきましたが、エラーになる部分があったので修正中です。\n今後、提出の際はしっかりチェックすることを心掛けていきます。','2021-12-17 10:47:19','2021-12-17 10:47:19'),
	(11910,20106,773,3,'6-3課題','今日はrole値によって権限を分ける作業を行っていたが思うように実装できなかった。DBにあるユーザー情報をセッション値に入れ、そこにあるrole値を検出して分けるように実装してみたがエラーが出る。\n次回までにエラーを読み解き実装していく。','2021-12-17 12:22:15','2021-12-17 12:22:15'),
	(11914,20885,386,3,'フレームワーク７－A','100パーセント','2021-12-17 19:34:17','2021-12-17 19:34:17'),
	(11916,20705,740,3,'4-1','4-1に入る前にコーディング応用が不安だったので復習してました','2021-12-18 02:14:43','2021-12-18 02:14:43'),
	(11928,20671,565,3,'5-2 課題２（SQL基礎・応用問題）','応用問題の問16関連の問題に苦戦していた。\n外部結合と副問合せでまとめ方の理解を深めないといけないと思った。\n講師の方に教えていただきながら問題を解決することができたので良かった。','2021-12-19 00:19:37','2021-12-19 00:19:37'),
	(11929,19922,610,3,'DBデータ挿入','以前の相談会で教えて頂いた、DBについてのyoutubeを見ました。\nなんとなく以前よりはDBについてのことが理解できたような気がします。課題を進めていくうえで更に理解が深まればと思います。','2021-12-19 04:05:56','2021-12-19 04:05:56'),
	(11930,20981,757,3,'サンプル課題サイト２','本日課題３−３に取り組む。\nレスポンシブ対応の変化がどうしても上手くいかず手詰まりの状態。\n自分の検索方法が悪い。','2021-12-19 04:25:47','2021-12-19 04:25:47'),
	(11932,20672,565,3,'5-2 課題２（SQL基礎・応用問題）','問16の対戦国のゴール数の取得の解決に取り組んだ。\n結合に関しての理解を深めていかないといけない。','2021-12-19 05:04:50','2021-12-19 05:04:50'),
	(11939,20533,563,3,'DB基礎','問２８まで学習\nDB<form>タグ使わないよう修正','2021-12-19 09:24:50','2021-12-19 09:24:50'),
	(11942,20142,668,4,'7-1 設計','ER図の作成に少し難航している。この図をつくることでシステムの構造を可視化できるので、後で自分だけでなく誰が見ても、もしも改修するようなときが来ても分かりやすいような図を作成していく。','2021-12-19 09:36:14','2021-12-19 09:36:14'),
	(11946,20829,769,3,'6-2','完全にバリデーションのエラーメッセージ表示にて止まってしまいました。cafe-cafeで行った時のように記述したり、セッションを使いviewに空の情報を送る為に別の変数を与えたりとしましたがうまくいきませんでした。ネット検索でもララベルの情報やケイクphpの情報などでこんがらがっている部分もあるかもしれないのでもう一度綺麗に作り直した方が良いのかなと思いました。講師の方に質問させて頂きましたが、とりあえずは、エラーメッセージで止まっているのはいけないので、更新周りを正常に動く様にしていきます。にしてもここで数日と止まっているので焦りはありますが、１つ１つ落ち着いて検索から実装までしっかりとしていきます。','2021-12-19 10:18:12','2021-12-19 10:18:12'),
	(11947,20711,704,4,'PHP自作','今日はフロントエンドの実装を行いました。\n進捗は以下になります。\nモック作成(2)  [index, admin.php]　進捗100% 完成予定日12/21\nモック作成(3)  [mypage, review, edit.php] 進捗100% 完成予定日12/23','2021-12-19 10:29:27','2021-12-19 10:29:27'),
	(11948,20932,838,3,'4-4','引き続き4−4に取り組みました。大枠はある程度できたので、ページ遷移などの関連づけを進めていくつもりです。','2021-12-19 10:30:24','2021-12-19 10:30:24'),
	(11951,20892,839,2,'３＿３取組み中','どうしても、メニューと画像がうまく配置できず、詰まってしましました。\nそれ以外はできているので進めていきたいと思います。','2021-12-19 10:41:45','2021-12-19 10:41:45'),
	(11960,20460,773,3,'6-3課題','今日はログインした際のユーザー情報の取得を行いました。\n前回エラーが発生していたところを修正しました。どこが原因か探すのに時間が掛かってしまった。結果として、DBからデータを取得するSQL文に問題があったみたいです。そこでPHPドキュメントからPDOを検証し修正するとうまくユーザーデータが出力されました。無事role値もセッション値に入れることができたので次はrole値によっての機能の制御を実装していきます。','2021-12-19 11:42:14','2021-12-19 11:42:14'),
	(11966,20646,376,3,'5-1','データ挿入、取得','2021-12-20 00:04:16','2021-12-20 00:04:16'),
	(11969,20967,850,3,'課題5-1確認中','日報の提出を忘れていました。申し訳ありません。\nPDOとmysqliの学習を行い例外処理とトランザクションを理解しました。現在課題5−１を終え、明日提出予定です。','2021-12-20 04:33:24','2021-12-20 04:33:24'),
	(11974,20425,611,3,'4-4 課題4','4-4 課題4','2021-12-20 10:02:18','2021-12-20 10:02:18'),
	(11976,20750,648,3,'PHP自作','７−１取り組み中','2021-12-20 14:16:09','2021-12-20 14:16:09');
